1824020300000003	Roast Tilapia	Roast the tilapia in the preheated oven for 15-25 minutes or until the internal temperature reaches 145F (62C).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300000001	Prepare the Tilapia	Prepare the whole tilapia ensuring it's clean and descaled. Pat dry, score the surface, brush with olive oil, and stuff with garlic and fresh herbs. Add sliced lemons onto the herbs. Season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010012	Preparing the Dough	In a large mixing bowl, combine the flour and water (and yeast if you're using it). Loosely place some plastic wrap on the bowl (it needs some air circulation, just want to keep any critters out) and let the mixture sit undisturbed at room temperature for 4-5 days (the longer it ferments, the deeper the flavor).	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300010006	Brown onions	In a large, heavy pot, add the sliced onions and turn the heat to medium. Cook the onions dry, stirring frequently. They will give up their water, wilt, and eventually brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300000005	Preheat Oven	First, preheat your oven to 400F (200C). Line a baking or roasting tray with non-stick baking paper.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300000006	Prepare Pepper Sauce	Start by making your pepper sauce by combining all ingredients (except for salt) inside a blender or food processor. Pulse until chunky. Transfer to a small sauce pan and bring to a boil. Reduce heat and simmer for 10 minutes. Adjust flavor with salt and sugar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010015	Review Fermentation	The mixture will be fizzy. The color will be very dark and, depending on the humidity, a layer of aerobic yeast will have formed on the top. (Aerobic yeast is a normal result of fermentation. If however, your batter forms mold on it, it will need to be discarded.).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010016	Remove Fermentation Liquid	Pour off the aerobic yeast and as much of the liquid as possible. A clay-like batter will remain. Give it a good stir.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300000004	Start the Banku	Mix corn dough, cassava dough, and salt in a saucepan, then place it over high heat and allow it to cook. As it cooks, add some water and stir continuously. Keep adding water until the mixture comes together. It should be solid, but not firm.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300000007	Finish and Shape Banku	Lower the heat to medium-low. Add a lid on the pot and allow the banku to steam for 5 minutes. Remove from the heat and give it one final stir. Then, place large scoops of banku dough into a damp bowl and roll it until nicely shaped.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010011	Add hard-boiled eggs	When you are about 15 minutes out from serving, stab the hard-boiled eggs all over with a fork, then add to the pot. You can either strip the meat from the bones or leave it as-is. Add salt if needed, then serve with rice, break, or Ethiopian injera.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300000002	Assemble Banku with Tilapia Fish	Serve the tilapia with the prepared banku. Drizzle more lemon juice over the fish if desired and arrange banku balls around the fish or separately. Drizzle some hot pepper sauce over the cooked tilapia and garnish with sliced vegetables or herbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300010003	Add Tomatoes and Chicken	Add tomatoes followed by chicken, stir and saut for about 2-3 more minutes. Add chicken stock/ water if necessary to prevent any burns.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010002	Prep and Cook Vegetables and Spices	Heat up large Saucepan with oil, add onions, garlic, ginger, cinnamon stick, curry leaves, cardamom pods and curry powder, stir occasionally for about 2-3 minutes until onions are translucent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010004	Season	Adjust for salt, pepper and stew consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010009	Add spices	When the onions are close to browning, add the butter, garlic, and ginger. Then add the tomato paste, berbere, black pepper, cardamom, and fenugreek. Mix well.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300010001	Simmer	Next add chickpeas, potatoes and chicken broth , about 1 1/2 cup, add more as needed. Bring to a boil and let it simmer until sauce thickens, it might take 25 minutes or more.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300010005	Rub the chicken	Rub the chicken or pheasant all over with the lemon juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010010	Braise chicken	Add the chicken pieces and turn to coat. Cook another few minutes, until the meat turns opaque. Add some salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010007	Simmer	Pour in the stock and mead or wine. You want all the meat to be covered by about an inch; add water if you need to. Bring to a simmer, taste for salt, cover the pot and cook gently until the meat is tender, typically about 2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010008	Brown onions	They will give up their water, wilt, and eventually brown.	a525810e-5531-4f97-95a4-39a082f7416b	t	1
1824020300010014	Final Cooking	Heat a non-stick skillet over medium heat. Depending on how good your non-stick pan is, you may need to very lightly spray it with some oil. Spread the bottom of the skillet with the injera batter - not as thin as crepes but not as thick as traditional pancakes. Allow the injera to bubble and let the bubbles pop. Once the bubbles have popped, place a lid on top of the pan and turn off the heat. Let the injera steam cook for a couple or so more minutes until cooked through. Be careful not to overcook the injera or they will become gummy and soggy. 	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010017	Cook One at a Time	Remove the injera with a spatula and repeat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010013	Cooking The Batter	In a small saucepan, bring 1 cup of water to a boil. Stir in 1/2 cup of the injera batter, whisking constantly until it is thickened. Then stir the cooked/thickened batter back into the original fermented batter. Add some water to the batter to thin it out to the consistency of crepe batter. I added around 2/3 cup of water, but this will vary from batch to batch. The batter will have a sweet-soured nutty smell. 	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824020300010018	Serve	Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010019	Cook tomato paste	In a medium sized pot, heat your oil on medium-high heat. Once the oil is heated add the onions you set aside and fry just until they turn golden brown. Once the onions have turned brown in color add the tomato paste and fry for 2-3 minutes. Then add the blended tomato mixture (reserve about 1/4 cup and set aside) and fry the mixture with the onions and tomato paste for about 30 minutes. Make sure you stir consistently so that the tomato mixture does not burn.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010020	Final cooking	When the liquid has almost dried up add the remaining tomato stew, cover, and let it cook for another 5-10 minutes until the liquid has completely dried up. Turn off the heat, mix thoroughly, and your Jollof Rice is ready to be eaten!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010021	Prepare tomato blend	Blend your tomatoes, red pepper, scotch bonnet peppers in a food processor or blender for about 45 seconds, make sure that everything is blended well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010043	Prepare Ribs	Heat one burner on your gas grill to low, or preheat to 200F. Place ribs on a large piece of foil and coat all sides with dry rub. Let sit 10 minutes, then tightly wrap in foil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010022	Add seasonings and rice	After 30 minutes, turn the heat down to medium, add the chicken stock. Mix and add your seasonings (salt, curry powder, thyme, all purpose seasoning, and the Knorr stock cube). Continue to boil for 10 minutes. Add the parboiled rice to the pot. Mix it very well with the tomato stew. If you need to add water so that the rice level is with the tomato mixture/chicken stock go ahead and do so. Add the bay leaves, cover the pot, and cook on medium to low heat for 15-30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010023	Prepare Apricots	In a small saucepan over medium-high heat, bring chicken broth to a boil. Remove from heat and add dried apricots. Let sit at least 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010028	Cook Onion and Garlic	Reduce heat to medium and add onion to the pot. Cook until soft, 5 minutes. Add garlic and ginger and cook until fragrant, 1 minute more, then add tomato paste and stir until coated. Add cinnamon stick, saffron, and spices and cook until toasted, 1 minute more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010026	Marinate Lamb	In a large bowl, toss lamb with about 2 teaspoons salt. Let sit at room temperature for 1 hour or overnight in the refrigerator.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010025	Combine and Simmer	Add lamb, apricots, and broth to pot and season with salt and pepper. Bring to a boil, then reduce heat and let simmer, covered, until lamb is tender and liquid is reduced, about 1  hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010027	Brown Lamb	In a tagine or Dutch oven over medium-high heat, heat oil. Add lamb and cook until golden, about 4 minutes per side. Work in batches as necessary. Remove lamb from pot and place on a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010024	Finish and Serve	Remove from heat and stir in cilantro. Garnish with toasted almonds, mint, and more cilantro. Serve over warm couscous.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010030	Serve	Serve warm with Cornmeal mash or rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010029	Mix the Chicken	Mix chicken with a spoon or with hands until they are well coated, set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010032	Marinate the Chicken	Place chicken in a large bowl or saucepan, rub with lemon juice, salt, garlic, thyme, white pepper and chicken bouillon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010031	Add Garlic, Chili Pepper and Paprika	Add garlic, chili pepper and smoked paprika, stir for about a minute then add onions and tomatoes, saut 2-3 minutes until onions are translucent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010033	Prevent Any Burns	Add chicken stock if necessary to prevent any burns.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010036	Add Chicken Stock and Squash	Add chicken stock or water (about 2 cups or enough to cover chicken), add chicken bouillon, and squash. Bring to a boil and let simmer until sauce thickens, which might take about 20 or more minutes depending on the type of chicken used. Throw in okra, continue cooking until desired texture is reached about 5 minutes or more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010035	Adjust Salt	Adjust salt, pepper and stew consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824020300010034	Cook the Chicken	Heat up large saucepan with palm and canola oil, then add chicken, brown both sides for about 4-5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010001	Ugali	Heat the water in a pan with medium high heat. Once it comes to a boil, slowly whisk in the cornmeal. Turn the heat down to low and stir constantly. Make sure to smash out any lumps. Cook for 8 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
