1824021800010025	Make Egusi Soup	Start by blending the peppers, tomatoes and onion with a little water. Heat some palm oil in a large pot and add the blended mixture. Season with salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010027	Prepare Iyan	Boil the yam in some salted water until soft. Place in a food processor and blend with a little water to form a thick, smooth consistency. Scoop into a bowl, ready to be served with the egusi soup.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010028	Cook Egusi Soup	Stir in the vegetable stock and sprinkle the ground egusi over the top. Cover and simmer on medium-low heat for 15 minutes. The egusi should cake and form little air pockets.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010026	Serve	Serve hot with some pounded yam or boiled yam.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010030	Cook Egusi Soup	Stir in the vegetable stock and sprinkle the ground egusi over the top. Cover and simmer on medium-low heat for 15 minutes. The egusi should cake and form little air pockets. Add the chopped spinach, give it a good mix and cook uncovered for a further 5 minutes. At this point you can add in some extra chopped vegetables or mushrooms as a meat alternative.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010031	Make Egusi Soup	Start by blending the peppers, tomatoes and onion with a little water. Heat some palm oil in a large pot and add the blended mixture. Season with salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010029	Serve	Serve hot with some pounded yam or boiled yam. A winning combination.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010032	Prepare Iyan	Boil the yam in some salted water until soft. Place in a food processor and blend with a little water to form a thick, smooth consistency. Scoop into a bowl, ready to be served with the egusi soup.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010035	Season and Form Patties	Preheat grill to medium heat. Divide ground beef into 4 portions and form patties that are about 1/2" thick and 1" wider than the burger buns. Season patties generously with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010036	Toast Buns	Spread the cut-side of the bun with softened or melted butter and toast the cut side on a skillet or on the grill until golden brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010034	Grill Patties	Grill hamburger patties (indent-side-up) covered for 3-5 min each side on the grill. Flip burgers when juices are accumulating on top of the burger and you have a good sear. Apply cheese in the last 1-2 minutes of grilling then cover with the lid and cook until the internal temperature of beef reaches 160F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010033	Prepare Toppings	Slice, and prepare all of your burger toppings and sauces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010037	Prepare Dough and Filling	Preheat oven to 375. On a lightly floured surface, roll half the dough to a 1/8-in.-thick circle; transfer to a 9-in. pie plate. Chill while preparing filling. In a small bowl, combine sugars, flour and spices. In a large bowl, toss apples with lemon juice. Add sugar mixture; toss to coat. Add filling to crust; dot with butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010038	Bake	Bake on the lowest rack 60-70 minutes, until crust is golden brown and filling is bubbly, covering with foil halfway if crust begins to get too dark. Cool on a wire rack. If desired, serve with ice cream and caramel sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010039	Roll Dough and Prepare Crust	Roll remaining dough to a 1/8-in.-thick circle. Place over filling. Trim, seal and flute edge. Cut slits in top. Beat egg white until foamy; brush over crust. If desired, sprinkle with turbinado sugar and ground cinnamon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010040	Rest and Serve	Let ribs cool 5 minutes. Slice and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010042	Prepare Dry Rub	In a small bowl, whisk brown sugar, paprika, salt, garlic powder, and cumin.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010023	Prepare Avocados	Cut open avocados lengthwise, remove the pit, and use a spoon to scoop out the flesh into a medium-sized mixing bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010041	Cook Ribs	Place ribs bone side up on cooler side of grill and cover. After 1 1/2 hours, rotate ribs 180 and cook 1 1/2 hours more. Make sure grill temperature does not exceed 200F. Once they've cooked 3 hours total, you should be able to see bones protruding from meat when you peek inside foil. Remove ribs from grill and transfer to a large baking sheet. Open foil and let ribs rest 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010032	Brown Beef	Using a cooktop-safe slow cooker insert or a heavy bottomed pot, melt two tablespoons of ghee on medium heat and add the beef with two cinnamon sticks. Brown on all sides, 5-7 minutes per side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010082	Serve	Slice with pizza cutter and enjoy!	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010089	Bake Broccoli Bites	Bake for 10 mins or until undersides are golden. Flip over (some melted cheese may seep out, causing them to stick  gently coax these ones from the baking paper). After flipping, cook for 5 mins longer or until bottoms are golden. Cool slightly then serve with tzatziki.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010106	Cut and Simmer Pork	Cut the pork into chunks between 1 and 2 inches across. Just barely cover with water and bring this to a simmer. Skim any froth. Add salt to taste and the avocado leaves and simmer uncovered until the water has almost cooked away.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010164	Review Fermentation	The mixture will be fizzy. The color will be very dark and, depending on the humidity, a layer of aerobic yeast will have formed on the top. (Aerobic yeast is a normal result of fermentation. If however, your batter forms mold on it, it will need to be discarded.).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010064	Rehydrate Wakame	Soak the wakame in a small bowl of warm water for at least 5 minutes to rehydrate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010166	Deglaze and Simmer	Add the white wine, and deglaze the pan by using a wooden spoon to scrape the brown bits off the bottom of the pan. Let the sauce simmer for 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010171	Finish Sauce	Stir in the Greek yogurt (or sour cream) evenly into the sauce. Taste, and season with a generous pinch of two of salt and pepper as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010176	Make the Bchamel Sauce	Melt the butter in a small saucepan over medium heat. Add the flour and cook, whisking constantly, for 2 minutes. Add the milk and whisk until evenly combined. Bring to a boil, then reduce the heat to medium-low and simmer, whisking constantly, for 2 minutes, until the mixture thickens. Whisk in the Parmigiano Reggiano, salt, and pepper. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010181	Cook Onion and Rice	Melt butter in a saucepan over medium-high heat. Add onion; cook and stir for 2 minutes until onion begins to soften, then stir in rice. Continue cooking and stirring until rice is glossy and the onion begins to brown on the edges, about 5 minutes more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010178	Cook with Chicken Stock	Cook and stir until chicken stock has been absorbed into rice, 5 to 7 minutes. Add 1/2 of the remaining chicken stock, and continue stirring until it has been absorbed. Finally, pour in remaining stock, and continue stirring until the risotto is creamy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010182	Prepare Ingredients	Cut the cherry tomatoes, red pepper and spinach leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
