1824031700010193	Add Spices and Deglaze	Stir in the chili powder, cumin, paprika, and oregano and stir vigorously for 30 seconds. Pour in the red wine to deglaze the pot, scraping up any browned bits. Simmer rapidly for 3 to 4 minutes, or until the smell of alcohol has cooked off and it's jammy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010198	Add Remaining Ingredients	Pour in the vegetable broth, pinto beans, navy beans, cocoa powder, bay leaves, soy sauce, chopped chipotle peppers + adobo sauce, hand-crushed tomatoes + their juices, salt, black pepper to taste, and 1 tablespoon maple syrup. Stir well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
