1824031400010090	Preheat Oven and Prepare Baking Tray	Preheat oven to 230C (210C fan-forced). Line a baking tray with baking paper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010163	Cooking The Batter	In a small saucepan, bring 1 cup of water to a boil. Stir in 1/2 cup of the injera batter, whisking constantly until it is thickened. Then stir the cooked/thickened batter back into the original fermented batter. Add some water to the batter to thin it out to the consistency of crepe batter. I added around 2/3 cup of water, but this will vary from batch to batch. The batter will have a sweet-soured nutty smell. 	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010063	Mix Miso Paste	Remove the kombu from the soup. In a small bowl, stir the miso paste together with some of the hot broth until the mixture is smooth, then stir it back into the soup.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010073	Combine and Cook Soup Ingredients	Pour the chicken broth into the Dutch oven with the onions and garlic, and bring to a boil over high heat. Add the potatoes, and boil until fork tender, about 10-20 minutes. Reduce the heat to medium and stir in the coconut milk and the cooked sausage; heat through. Add the bacon and the kale into the soup just before serving and cook 'til the kale is bright green and softened. Add salt and pepper to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010174	Salt the Eggplant	Sprinkle 1 teaspoon of salt evenly all over the eggplant slices. Lay out a few layers of paper towels on a large cutting board or baking sheet. Arrange about one-third of the eggplant slices in a single layer and cover with more paper towels. Continue stacking the eggplant and paper towels, finishing with a final layer of paper towels. Let sit for 1 to 2 hours. Press on the paper towels to absorb any excess liquid before proceeding.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010179	Add Wine and Squash	Pour in white wine; cook, stirring constantly, until it has evaporated. Stir in mashed squash and 1/3 of the hot chicken stock; reduce heat to medium.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010185	Serve	When it is done, place a large plate on top of the pan and flip the omelette as fast as you can. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010186	Finish Cooking	The other side will cook a lot quicker, it only needs about 1-2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010188	Melt Butter	Melt the butter in the frying pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010189	Prepare Baking Dish	Spread the mixture onto the bottom of a 10-inch round baking dish. Spread mashed potatoes evenly over the top. Sprinkle with Cheddar cheese and dot with remaining butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010190	Cook Impossible Burger	Heat 1 tablespoon butter in a 10-inch skillet over medium to medium-high heat. Cook and stir the meatless ground beef with shallots and garlic until browned and crumbly and shallots are soft, about 10 minutes. Add peas and carrots, gravy, Worcestershire sauce, salt, and pepper. Saute for 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010199	Simmer Chili	Bring the chili to a boil over high heat, then reduce to a gentle simmer (this is lowest heat on my small burner). Take care to not boil or too rapidly simmer the chili, as it will break down the beans too much. Cook, stirring every 10 minutes, until thick and velvety and the flavors have melded together, about 1 1/2 hours (or up to 2 hours). Discard the bay leaf.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010019	Remove from heat and stir in vanilla and butter	Remove saucepan from heat, and stir in vanilla and butter.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
