1824021800010049	Grilling Ribs with BBQ Sauce	Adjust grill to high heat, or preheat to about 450. Remove ribs from foil and place directly on grill. Using a pastry brush, generously baste with BBQ sauce. Flip rack and baste other side with sauce. Grill until sauce is caramelized and meat has visible grill marks, 1 to 3 minutes. Flip again and continue to grill until sauce on other side is caramelized, 1 to 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010050	Rest and Serve	Let ribs cool 5 minutes. Slice and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021800010047	Ribs Cooking	Place ribs bone side up on cooler side of grill and cover. After 1 1/2 hours, rotate ribs 180 and cook 1 1/2 hours more. Make sure grill temperature does not exceed 200. Once they've cooked 3 hours total, you should be able to see bones protruding from meat when you peek inside foil. Remove ribs from grill and transfer to a large baking sheet. Open foil and let ribs rest 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
