1824031700010173	Fry the Eggplant	Line another baking sheet with a few layers of paper towels. Pour enough oil into a large (12-inch) skillet to measure about -inch deep and heat over medium heat until hot (If you dip a piece of eggplant into the oil, it will sizzle immediately). Working in batches, add as much eggplant as will fit in a single layer and fry, flipping once, until golden brown, about 3 minutes per side. Transfer to the paper towel-lined baking sheet. Repeat, frying the remaining eggplant and layering it between sheets of paper towels to drain.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
