1824021900010094	Add the garlic and spices	Add the minced garlic, the remaining 1 tablespoon of Cajun seasoning, and the red pepper flakes to the pan. Stir together for 30 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010095	Cook the sausage	Add the remaining 1 tablespoon of oil along with the sausage to the same pan and saute for a couple of minutes, until lightly browned on both sides. Remove the sausage to the plate with the chicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010096	Saute the veggies	Add the onion, bell pepper, and celery, and saute for 4 to 5 minutes, until the veggies have softened. If you need to add a splash more oil feel free to do so.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010092	Season the chicken	In a medium mixing bowl toss together the diced chicken with 1 tablespoon of Cajun seasoning, until evenly coated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010097	Add the shrimp	Remove the bay leaf, add the shrimp to the pan along with the sausage and chicken, gently stir, cover, and turn off the heat. The shrimp will cook through in about 4 to 5 minutes, and all of the liquid should be absorbed by the rice. Taste the jambalaya and season with extra salt and pepper if you'd like.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010098	Add the rice and liquid	Add the rice and toast with the veggies and spices by stirring for a minute. Then add the bay leaf, tomatoes, and broth. Give it a stir, bring to a simmer, then reduce the heat to low, and cover. Cook for about 7 to 8 minutes, stirring occasionally just to make sure the rice isn't sticking to the bottom of the pot, until the rice is al dente. *See notes on rice below	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824021900010099	Garnish	Before serving, garnish with sliced green onions and chopped parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022000010100	Preheat the Oven	Preheat the oven to 200C (400F) and position a rack in the middle. Lightly grease a 9-inch cast iron skillet or 9-inch square baking dish with butter and place skillet/dish into the oven to heat up.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022000010101	Bake	Bake until the cornbread begins to brown on top and a toothpick inserted in the centre comes out clean (about 20-23 minutes). Allow to cool for about 10 minutes before slicing and serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022000010103	Make Batter	In a large bowl whisk together the flour, cornmeal, sugar, baking powder (if using), baking soda and salt. Make a well in the centre and add the buttermilk and eggs. Mix together well to combine, then add in the slightly cooled melted butter. Mix again until 'just' combined (don't over mix).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022000010102	Prepare to Bake	Carefully remove your 'hot' pan or dish from the oven with oven mitts, and pour the batter into the hot skillet or dish. Listen to that sizzle! That's what you want.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022000010104	Melt Butter	Alternatively for cast iron skillets: heat 1/2 cup of unmelted butter in your cast iron over stove top on medium heat until melted, turn heat off then allow the butter to cool slightly before adding to the batter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022300010001	Make the vinaigrette	In a medium bowl, combine the shallot, mustard, honey, vinegar, oil, salt, and pepper. Stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022300010002	Make the salad	Place the romaine on a large platter. Top with the eggs, chicken, tomatoes, blue cheese, bacon and avocado. Remove shallots from vinaigrette and scatter over the salad. Drizzle with vinaigrette and serve family style.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022300010101	Cook Beef	Add in the ground beef and cook and crumble until brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022300010102	Saut Vegetables	In a large pot add the olive oil over medium high heat. Add the onion, bell pepper and garlic and saut until almost tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022300010103	Combine Ingredients and Simmer	Add in the beef broth, tomato sauce, diced tomatoes, pinto beans, kidney beans, chili powder, oregano, cumin, coriander, salt and cayenne. Bring to a boil and reduce to a simmer until it starts to thicken and flavors combine about 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010001	Assembly	Top each piece of bruschetta with a couple spoonfuls of the tomato mixture, top with basil leaves and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010002	Tomato Topping	Combine all tomato topping ingredients into a mixing bowl and fold together. Set aside and allow mixture to marinate for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010003	Bruschetta Prep	Preheat oven to 350F. Brush a baking sheet with 1 tablespoon oil and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010006	Bake Bruschetta	Bake bruschetta for 6 minutes. Flip and continue to bake for an additional 4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010007	Brush Baguette	Brush each slice of baguette with the butter and oil mixture on both sides.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010004	Oil and Butter Mixture	Stir together remaining oil and melted butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010005	Cooling	Remove from oven and cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010010	Prepare the Shrimp	Fill a medium saucepan or small pot with water and bring it to boil on high heat. Once the water boils, add the shrimp and cook for 2 minutes. Remove the shrimp from the water and let them cool for 5 minutes. Peel the shells from the shrimp. Lay a shrimp on its side on a chopping board. Gently press the shrimp down with one hand and use the other to slice the shrimp in half, horizontally.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010012	Roll the Spring Rolls	Quickly dip a sheet of rice paper in the lukewarm water to moisten the entire surface. Lay the wet rice paper on your work surface. Place a piece of butter lettuce close to the bottom edge of the rice paper. Arrange a small pinch each of rice noodles, carrots, cucumber, red bell pepper, and mint leaves over the center of the lettuce leaf. Arrange 3 pieces of shrimp about 1 1/2 to 2 inches below the top edge of the rice paper. Roll up the spring roll.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010008	Set Up Spring Roll Station	Fill a large bowl with lukewarm water to wet the rice paper sheets. Transfer all the vegetables, shrimp, herbs, and noodles into bowls and arrange them on your worktop. Dip your hand in the water and brush water over the surface of the chopping board so that it is damp.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010011	Prepare the Dipping Sauce	Pick your dipping sauce of choice and mix all the sauce ingredients together. Make sure to use warm water for the nuoc cham so that the sugar dissolves more easily. Taste the sauce and adjust the seasonings as necessary.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010013	Serve	Serve the spring rolls with the dipping sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010009	Prepare the Noodles	Fill a large saucepan or small pot with water and bring it to boil on high heat. Turn off the heat. Let the noodles sit in the hot water for about 5 to 8 minutes. Once the noodles have softened, drain and rinse the noodles under cold water. Cut the noodles with kitchen scissors several times so they are shorter and easier to grab.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010018	Shape the Samosa	Once the dough has rested, give it a quick knead. Then divide the dough into 7 equal parts of around 58-60 grams each. Start working on a piece of dough, keep the remaining dough balls covered at all times with a moist cloth else the dough will dry out. Roll one dough ball into a circle-oval kind of shape, around 6-7 inches in diameter and then cut it into two parts. Take one part and apply water on the straight edge/side. I usually mix some flour with water so that it forms a nice glue. Now bring the two ends of the straight edge together and pinch them to form a cone. See picture (#20) for a better idea.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010019	Fill the Samosa	Pinch the pointed ends to make it a perfect cone shape. Fill the samosa with the potato filling, around 1 to 2 tablespoons. Dont overfill the samosa. Now again apply water all around the circumference of the cone as you have to seal it. Pinch the opposite side (side opposite to where you pinched to form the cone) to form a plate (see picture #23). Now pinch the edges and seal the samosa.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010015	Kneed and Rest the Dough	Press some flour between your palm- it should form a shape (& not crumble)  means oil is enough and well incorporated. Now, start adding water, little by little and mix to form a stiff dough. Dont overwork the dough and dont knead a soft dough. It should just come together and form a stiff dough. I used around 6 tablespoons of water here. Cover the dough with a moist cloth and let it rest for 40 minutes. I usually soak a paper towel in water and then squeeze out all the water and then cover my dough with that. While the dough is resting, start working on the filling.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022400010016	Start Samosa Filling	Boil potatoes until soft. Peel the skin and them mash the potatoes. Set aside. Heat 2 tablespoons of oil in a pan on medium heat. Once the oil is hot, add the cumin seeds, fennel seeds and crushed coriander seeds. Let the seeds sizzle for few seconds and then add the chopped ginger, green chili and hing. Cook for 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022400010017	Continue Samosa Filling	Add the boiled & mashed potatoes and green peas to the pan. Mix everything together. I use my potato masher to combine the spices and seasonings well with the potatoes and peas. Add the coriander powder, garam masala, amchur, red chili powder and salt. Mix to combine. Once its all well incorporated, remove pan from heat and let the filling cool down a bit.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010020	Fry the Samosa	Your samosa is now ready. Repeat with remaining dough. Always remember to keep the filled samosa covered with moist cloth while roll and fill the others. Now heat oil in a kadai on low heat. To check if oil is ready, drop a small piece of dough into the oil. It should take few seconds to come up to the surface. That means the oil is ready. Drop the shaped samosas into the oil. Fry on low heat. After around 10-12 minutes, the samosa will become firm and light brown in color. At this point, increase the heat to medium and fry until it gets nicely browned. Dont overcrowd the kadai/wok, fry 4-5 samosas at a time. And each batch will take around 20 minutes since we fry on low heat so be patient.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010014	Prepare Samosa Dough	Start by making the samosa dough. To a large bowl, add flour, ajwain, salt and mix well. Add the oil and then start mixing with your fingers. Rub the flour with the oil until the oil is well incorporated in all of the flour. Do this for 3 to 4 minutes, you dont want to rush this step. Once incorporated,  the mixture resembles crumbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	4
1824022400010029	Storage Option	You may place it in the fridge if making more than 30 minutes ahead of time. I recommend plopping a pit in the middle, adding a splash of lime juice to the top layer, and covering it very tightly with plastic wrap (so no air gets to the guacamole) in order to prevent browning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010028	Mix Spices	If you would like your guacamole smoother, use a fork or your potato masher to mix in the spices as you mash the mixture. If you like your guacamole a little chunkier, use a rubber spatula to stir in the spices until well combined!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010026	Add Cilantro and Tomatoes	Add cilantro and tomatoes and stir until combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010030	Drain and Serve	Remove from oil with a slotted spoon and transfer to prepared rack to cool. Serve warm with tahini sauce alongside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010034	Form Balls	Using a 1-ounce cookie scoop or 2 spoons, portion chickpea mixture into 1 inch balls (about 2 tablespoons each). Using clean hands, roll each ball, tossing between both hands and lightly squeezing to compress, until smooth and compact (mixture will feel wet). Arrange balls on a clean plate or parchment-lined baking sheet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010039	Combine Ingredients	In the bowl of a food processor fitted with the S blade, add the olives, capers, tomatoes, garlic, oregano, parsley, basil, lemon juice, olive oil, and black pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010035	Process for Spreadable Tapenade	For a spreadable tapenade, process until a paste is formed, stopping to scrape down the bowl a few times.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010207	Prepare Broccoli and Chickpeas	Add the chopped broccoli and chickpeas to a separate parchment-lined baking sheet and drizzle with avocado oil. Sprinkle with a little salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010214	Stuff and Bake the Mushrooms	Spoon the stuffing into the cleaned portobello caps and top with the goat cheese. Transfer the caps to a sheet pan and bake until the portobellos are tender, 15 to 20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010018	Mix the sugar, cornstarch, and salt	Mix sugar, cornstarch, and salt together in a small bowl.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031100010035	Shred and Re-Cook Beef	Reserve about a cup of shredded beef and place it in a sealed container in the fridge. Add the wheat berries along with the rest of the shredded beef and 1 tablespoon of kosher salt back into the slow cooker. Add a little more water if the wheat berries are not submerged. Cover the slow cooker and cook on low for 6-8 hours or high on 3-4 hours, whichever works best for your schedule. Check halfway through and make sure it still has enough water to not burn (because it is a slow cooker, it may very well not, whereas if done in the oven it might). If desired, you can also remove some chewy wheat berries at this point and place them with the reserved shredded beef in the fridge.	a525810e-5531-4f97-95a4-39a082f7416b	f	3
1824031200010087	Prepare Pita	Brush on a little olive oil on the pita.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010092	Melt Chocolate	Melt the chocolate with coconut oil and combine. You can do this by microwaving for 15-30 seconds and then consistently stirring.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010160	Preparing the Dough	In a large mixing bowl, combine the flour and water (and yeast if you're using it). Loosely place some plastic wrap on the bowl (it needs some air circulation, just want to keep any critters out) and let the mixture sit undisturbed at room temperature for 4-5 days (the longer it ferments, the deeper the flavor).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010065	Prepare Kombu	Gently rinse the kombu piece. Place it in a medium pot with the water and gently simmer for 10 minutes. Don't let it boil, or the kombu flavor will turn bitter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010197	Serve with Toppings	Serve with toppings of choice, such as pickled onions, chopped cilantro, sliced scallions, vegan sour cream, avocado, tortilla chips, etc.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010195	Thicken with Masa Harina	Stir in the masa harina, if using. Simmer for 3 minutes, until the texture has further thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010203	Prepare Thai Peanut Sauce	Put together the Thai Peanut Sauce by combining the peanut butter, coconut aminos, lime juice, garlic, and water. Whisk until thoroughly combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010208	Preheat Oven	Preheat oven to 400 degrees Fahrenheit.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010025	Taste and Adjust	Taste and add extra salt or lime juice if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010024	Mash Avocados	Use a potato masher or fork and gently mash the avocado, leaving it a little bit chunky at this point.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010032	Process Chickpeas	Drain chickpeas well, pat dry, and transfer to a food processor. Pulse until chickpeas are halfway broken down. Add onion, garlic, cilantro, parsley, salt, baking powder, coriander, and cumin and continue to pulse until finely chopped but not pasty. Sprinkle flour over and pulse just until combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010036	Garnish and Store	Garnish with parsley leaves and olive oil for drizzling. Store in a covered container in the refrigerator for up to two weeks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010034	Finish and Serve	Melt the last tablespoon of ghee into the dish. Taste for more salt, but realize you have salted the onions and mushrooms already.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010005	Cook Chicken	Heat the remaining one tablespoon of olive oil in a large skillet over medium-high heat. Then sear the chicken for 4-5 minutes on each side, until they're golden brown and have reached an internal temperature of 160 degrees Fahrenheit. Let the cooked chicken rest for a couple of minutes. Then slice into strips.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031300010009	Cook Chicken	Heat the remaining one tablespoon of olive oil in a large skillet over medium-high heat. Then sear the chicken for 4-5 minutes on each side, until they're golden brown and have reached an internal temperature of 160 degrees Fahrenheit.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010097	Combine Dry Ingredients	Add the walnuts, sunflower seeds, oats, and coconut and stir together until combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010165	Serve	Enjoy!	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010070	Serve	Discard the bay leaf, ladle the soup into bowls, and garnish with finely chopped fresh parsley and black pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010072	Prepare Italian Sausage	If making Italian sausage: combine all ingredients in a bowl and mix well. Alternatively, combine all ingredients in the saucepan and stir well when browning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010196	Add Garlic, Jalapenos, and Tomato Paste	Add the garlic, jalapeos, and tomato paste, and cook for 2-3 minutes, stirring very frequently, until tomato paste is darker in color. If it starts to dry out, add a splash of water and scrape up any browned bits.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010204	Bake Sweet Potatoes	Bake for 35-45 minutes or until the sweet potato can be easily pierced with a fork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010210	Top with Mango Pineapple Salsa and Sauce	Top with mango pineapple salsa and a generous amount of Thai Peanut Sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010213	Cook Vegetables	Add the carrot and squash to the pan and cook for 2 minutes. Then add the spices and cook for 1 minute. Add in the preserved lemons, passata and the water. Pop the lid on and simmer for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031700010215	Cook the Rice	Heat the oven to 400F. Rinse the chickpeas. Strip the parsley leaves from the stems; coarsely chop the leaves. In a pot, combine the rice with 1 cups salted water and 1 tablespoon oil. Bring to a boil, then reduce to a simmer, cover, and cook until the rice is tender, 25 to 30 minutes. Remove from the heat, gently stir in the chickpeas, cover, and let stand for another 10 minutes. Fold in the parsley and vinegar and season to taste with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010021	Heat the milk	Heat milk in a medium saucepan over medium heat until bubbles form at the edges.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022400010027	Add Spices	Add cumin, garlic powder, onion powder, 1/2 tsp salt, pepper, and 1 TBS lime juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010031	Fry Falafel	Into a large heavy pot fitted with a deep-fry or candy thermometer, pour oil to a depth of 2 inches. Heat over high heat until thermometer registers 350 degrees Fahrenheit. Set a wire rack in a large baking sheet. Working 6 to 7 at a time, gently lower falafel into oil and fry, adjusting heat as needed, until deeply browned on all sides, 2 to 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010033	Soak Chickpeas	Pour chickpeas into a large bowl and add cold water to cover by at least 2 inches. Cover and refrigerate overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010038	Pulse for Chunky Spread	For a chunky spread, pulse up to 15-17 times, stopping to scrape down the bowl a few times.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010037	Pulse for Relish	For a relish, pulse a few times, then scrape down the bowl. Pulse a few more times, and the relish will be ready.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010042	Serve	Once golden on both sides, transfer to a warmed serving plate. Squeeze over lemon, then sprinkle over the thyme leaves and sesame seeds. Drizzle honey to taste and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010040	Cook Feta	Carefully place the feta into the oil, it should sizzle straight away, and cook 4-5 minutes, until deep golden underneath. Carefully, turn it over and repeat. If it looks like it's colouring too quickly or starting to burn, turn the heat down a little.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010041	Heat Oil	In a small skillet, heat the oil over medium heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010043	Prepare Feta	Take the feta out of the package. If it was stored in brine you can rinse it first but don't dry it off. Place it in a bowl with the flour and turn to coat, pressing the flour on to it as much as possible.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010044	Season	Season with salt and lots of black pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010046	Serve	Serve immediately or save it for later in the fridge. It's good hot and cold!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010045	Boil Edamame	Boil edamame for 3-4 minutes. Drain in cold water and dry with paper towel.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010048	Heat Sesame Oil	In a pan over high heat, add sesame oil. When the oil is hot, almost smoking, add edamame pods and fry for about 2-3 minutes, until the pods are slightly charred.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010047	Add Soy Sauce	Add soy sauce and stir until the sauce has evaporated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010049	Roast the Eggplant	Preheat the oven to 400F and wrap the eggplant in foil. Roast the eggplant for 50 to 60 minutes, or until it is soft and collapses to the touch. Remove from the oven and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010051	Prepare the Eggplant	Once cool to the touch, peel the skin from the eggplant, removing any big clumps of seeds. Place the flesh in a strainer over a bowl and let stand for 20 minutes to remove excess water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010050	Blend the Ingredients	Place the eggplant flesh, tahini, lemon juice, olive oil, garlic, and salt in a food processor and pulse until smooth. Transfer to a serving dish, sprinkle with chopped parsley, smoked paprika, and red pepper flakes, if using. Serve with pita and veggies.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010053	Combine Ingredients	Combine blended cilantro/serrano, remaining lime juice, cucumbers, and onion. Do not add tomatoes or shrimp yet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010055	Serve	Mix well and serve with tostadas, tortilla chips, or crackers. Top with avocado slices if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010054	Cut Shrimp	Cut the shrimp into smaller pieces as desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010059	Final Touches	If eating immediately, add diced avocado. If not, top with avocado slices when serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010056	Blend Cilantro and Peppers	Roughly chop the cilantro and serrano peppers, blend them with a little lime juice, salt, and optional sugar to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010058	Prepare Vegetables	Prepare the tomatoes, red onion, cucumber, and jalapeno pepper by chopping them into small pieces. Remove seeds from jalapeno, skin from cucumber, and juice limes and lemon to obtain 1 cup of fresh juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010052	Add Tajin and Tomatoes	Add Tajin (or Clamato juice) and tomatoes to the marinated shrimp mixture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010057	Marinate Shrimp	Add shrimp to the mixture and let it marinate in the fridge for 15-20 minutes until the shrimp is pink on the outside and white/opaque in the center.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010060	Let Dough Rise	Turn the dough into an oiled bowl, cover the bowl, and let the dough rise until doubled in bulk, about 90 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010063	Deflate and Divide Dough	Gently deflate the dough, and divide it into six pieces (for thin baguettes) or three pieces (for thicker Italian loaves).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010061	Knead the Dough	Knead the dough for about 7 minutes in a stand mixer; or 8 to 10 minutes by hand, on a lightly greased work surface. You may also knead this dough using the dough cycle on your bread machine; once it's finished kneading, transfer it to a bowl to rise, as directed below.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010064	Proof the Dough	Cover the loaves with lightly greased plastic wrap, and let them rise for 1 1/2 to 2 hours, or until they're nice and puffy. Towards the end of the rising time, preheat your oven to 450F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010066	Score and Bake	For a classic look, make three diagonal slashes in each loaf, cutting about 1/4" deep. For taller, rounder baguettes, don't slash. Bake the baguettes for about 25 minutes, or until they're a rich golden brown. If you baked in baguette pans, remove the loaves from the oven and unmold. Turn off the oven, return the loaves (without the pan) to the oven, and crack the oven door open a few inches. If you baked on a parchment-lined baking sheet, simply turn off the oven and crack the oven door open a few inches. Letting the loaves cool right in the turned-off oven helps preserve their crunchy crust.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010065	Cool and Store	Remove the sourdough baguettes from the oven, and cool them completely on a rack. Store any leftovers in a paper bag for a day or so; after that, they'll probably be better suited to making breadcrumbs than eating. Freeze for longer storage.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010062	Stir Ingredients	Stir in the salt, sugar, yeast, and gluten, then an additional 1 1/2 to 2 cups (180g to 240g) of flour. Stir until the dough pulls away from the sides of the bowl, adding only enough additional flour as necessary; a slack (sticky) dough makes a light loaf.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010067	Shape and Place Dough	Shape each piece into a 16" long loaf, and place the loaves, at least 4" apart, on parchment-lined baking sheets, or in lightly greased baguette pans (French loaf pans). If you're using baguette pans, make the loaves 15" long.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010068	Combine Ingredients	In a large bowl, combine the water, starter, and 3 cups (360g) of the flour, mixing until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010070	Form Dough Balls	Lightly butter two 9-inch cake pans. Line pans with parchment paper. Pour one tablespoon of olive oil into the center of each pan. Divide dough in half with a large spoon or rubber spatula and place one piece of dough in each pan, turning to coat with oil. Tuck edges of dough underneath to form a rough ball.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010072	Sprinkle and Bake	Sprinkle tops with Italian seasoning (or fresh herbs) and flaky sea salt. Transfer the pans to the oven and immediately reduce the temperature to 425F. Bake for 22 to 28 minutes, until the tops are golden and the undersides are crisp. Remove pans from the oven. With a metal spatula remove bread rounds from the pans and transfer to a cooling rack.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010071	Prepare the Dough	In a medium-large bowl, combine flour, salt, and instant yeast. Stir well. Add the warm water. Using a Danish Whisk, sturdy wooden spoon or a rubber spatula, mix until all of the flour is well incorporated. Cover the bowl with plastic wrap and refrigerate for at least 8 hours and up to 24 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010075	Preheat Oven	Preheat oven to 450F with a rack positioned in the center of the oven.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010074	Serve or Store	Serve warm or allow to cool completely then store in a zippered bag.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010073	Rest Dough	Cover each pan tightly with plastic wrap and allow the dough balls to rest for 2 hours (it may take as long as 3 hours, depending on the warmth of your kitchen). The dough should cover most of the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010069	Drizzle Oil and Dimple Dough	Drizzle another tablespoon of oil over each round of dough. With oiled fingers, using both hands, press straight down and create deep dimples that go all the way through the dough (in other words, you'll actually be making deep holes). If necessary, gently stretch the dough as you dimple to allow the dough to fill the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010078	Chill the Dough (Optional)	If time permits, wrap the dough tightly in plastic wrap and chill for 24 hours. If not, scoop cookie dough onto baking sheets. I suggest using parchment paper or Silpat silicone baking sheets on light-colored baking sheets. If you using dark colored baking sheets, the bottoms of the cookies may brown quickly and can burn. I suggest using light-colored cookie sheets.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010079	Bake	Bake for 8-11 minutes or until the edges just begin to turn a light golden color. Remove from oven and let set for 5 minutes before removing from the cookie sheet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010076	Add Eggs and Vanilla	Add eggs and vanilla. Mix for 1 minute longer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010077	Preheat Oven and Prepare Dough	Preheat oven to 400 degrees (if not chilling the dough). Check your oven temperature using an oven thermometer since some ovens run hot. If you suspect your oven runs hot, preheat oven to 385 degrees. In a large mixing bowl, cream butter, brown sugar, and sugar for 4 minutes until light and fluffy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010080	Stir in Flour, Cornstarch, Baking Soda, and Salt	Stir in flour, cornstarch, baking soda, and salt. Mix just until combined. Fold in chocolate chips.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010081	Rest the Dough	Remove the dough from the bowl onto a clean countertop lightly dusted with flour. Lightly dust the top of the scones with flour. Flatten the dough to a 1" thickness and cover. Leave to rest for 30 to 45 minutes in the refrigerator.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010084	Cut the Scones	Remove the scone dough from the refrigerator and cut to the desired shape using a round biscuit cutter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010082	Prepare Raisins or Sultanas	If using, soak the raisins or sultanas in hot water for 20 to 30 minutes. Drain before adding to the recipe.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010083	Combine Wet Ingredients	In a separate small mixing bowl, whisk two eggs and the buttermilk together. Stir the liquid into the crumb mixture. Add the raisins, if using, and mix until evenly distributed. Continue to gently knead the dough by hand just until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010085	Mix Dry Ingredients	Mix the dry ingredients (all-purpose flour, baking powder, pinch of salt), butter and sugar together in a large bowl until crumbly. Work the butter into the dough as you would pie dough.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010087	Bake the Scones	Bake on baking sheets for around 12 to 15 minutes, or until light golden brown. Leave at least 1 1/2" of space between each scone. Cool on a wire rack before serving warm or at room temperature with jam and clotted cream.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010086	Preheat Oven and Prepare Scones for Baking	Preheat the oven to 400F (205C). Cover and rest the scones for another 20 minutes in the fridge. Whisk the third egg and gently egg wash the top of the scones with a pastry brush.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010088	Add Garlic	Add the minced garlic to the remaining melted butter. Loosely cover and microwave for 15 seconds. Brush the warm naan with the garlic butter (scooping out some of the garlic to sit on top) and sprinkle generously with cilantro. Serve warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010089	Cook Naan	Heat a large, heavy bottomed skillet over medium heat. Roll each dough ball out until it is about 1/4 inch thick and approximately 6 inches wide. Brush the dough lightly with butter and place one at a time onto the hot skillet. Cook until large bubbles form on the surface, about 2 minutes. Flip the dough and cook the other side until golden, about 1-2 more minutes. Stack the cooked flat bread on a plate and cover with a towel to keep warm as you cook the remaining pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010091	Mix Milk and Yogurt	Whisk in the warm milk and plain yogurt into the yeast mixture until well-combined. Pour into the well in the dry ingredients. Stir until a dough is formed, then turn out onto a lightly-floured surface and knead until smooth, about 3-4 minutes. Transfer the dough to a large, lightly oiled bowl and cover loosely with a damp kitchen towel. Let rise at room temperature until doubled in size, about 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010090	Combine Yeast Mixture	In a glass measuring cup, combine the yeast, sugar, and water and let sit until very foamy, about 10 minutes. Meanwhile, whisk the flour and salt together in a large bowl and create a well in the center.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010092	Prepare Dough Pieces	Turn the dough out onto a floured surface. Knead briefly into a disc and cut the dough into 12 equal-sized pieces. Roll each piece into a ball.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010095	Cool and Serve	Remove all the parchment paper and allow to cool completely on a cooling rack before slicing. Use a cake leveler for even slices. Serve with whipped cream and fruit or make a layered cake. Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010130	Prepare Berry Compote	Meanwhile, prepare Berry Compote, if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010132	Release Pressure	When cooking is complete, press Cancel to turn off heat. Use natural release for 10 minutes, then release remaining pressure.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010131	Prepare Oatmeal	Melt butter in Instant Pot. Add oats; cook about 5 minutes, stirring frequently.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010096	Add Dry Ingredients and Oil	Sift the flour, matcha powder, and baking powder into the egg yolk mixture in three parts, gently folding after each time. Matcha powder must be sifted as it clumps together easily. Next, add the vegetable oil. Tip: To help incorporate the oil better, mix a few spoonfuls of the batter with the oil before adding.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010037	Transfer to Slow Cooker	Add the 10 cups of water and place the insert in the slow cooker or transfer the ingredients from the pot to the slow cooker. Set the slow cooker on low and cook overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031300010003	Prepare Avocado Dressing	When the chicken is done marinating, make the avocado dressing. Place all the dressing ingredients to a food processor and blend until creamy. Set aside.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010096	Form Cookies	Take about 1 1/2 Tbsp from this mixture and roll in your hands as to form cookies or patties.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010166	Cook One at a Time	Remove the injera with a spatula and repeat.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031500010170	Rest Dough	Cover each pan tightly with plastic wrap and allow the dough balls to rest for 2 hours (it may take as long as 3 hours, depending on the warmth of your kitchen). The dough should cover most of the pan.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010069	Saute Vegetables	Heat the oil in a large pot or Dutch oven over medium-high heat. Add the onion, carrots, and celery, and saute for 3 to 4 minutes. Then add the garlic and saute for another minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010205	Assemble Buddha Bowls	Assemble the buddha bowls by adding the quinoa, sweet potatoes, broccoli, and chickpeas to a bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010202	Bake Broccoli and Chickpeas	Bake for 20 minutes or until the broccoli is tender and slightly golden brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010211	Saute Onion	Heat the oil in a tagine pot or a heavy-bottomed casserole pot. Saute the onion for 5 minutes until softened, then add the garlic and saute for another 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031700010216	Prep the Portobello Stuffing	Peel and finely chop the shallot. Finely chop the cremini mushrooms. Carefully remove the stems from the portobellos and chop them. Using a spoon, remove the gills from the caps. In a pan over medium-high heat, warm 1 to 2 tablespoons oil until hot but not smoking. Add the shallot, cremini, and portobello stems. Season with salt and pepper and cook, stirring frequently, until the mushrooms begin to soften, 4 to 5 minutes. Add the spinach and cook, stirring occasionally, until the leaves are wilted and most of the liquid has evaporated, 4 to 5 minutes longer. Remove from the heat and season to taste with more salt and pepper, if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010222	Add Ginger and Garlic	Add ginger and garlic. Mix well and cook for 30 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010223	Garnish and Serve	Garnish with chopped cilantro and squeeze fresh lime juice on top before serving with steamed rice or bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010004	Add Potatoes and Broth	Add potatoes, vegetable broth, rosemary, and thyme to the pot. Increase heat to medium-high and bring to a rolling simmer.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010008	Saut Vegetables	Heat a large pot over medium heat. Once hot, add water (or oil), garlic, shallots/onion (optional), carrots, and celery. Season with a bit of salt and pepper and stir. Saut for 4-5 minutes or until slightly tender and golden brown. Be careful not to burn the garlic (turn heat down if its cooking too quickly.)	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010013	Cook Lentils	Add lentils and stir. Reduce heat to low and simmer uncovered for 15-20 minutes or until lentils and potatoes are tender.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031100010038	Add Spices and Beef	Add the coriander and cardamom and stir through. Add the reserved shredded beef and chewy wheat berries, if you have them, and heat through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010001	Marinate Chicken	Combine the marinade and chicken fillets in a shallow dish or plastic bag. Marinate the chicken for 2-6 hours in the fridge.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824022400010093	Bake	Line two 6 inch cake pans with parchment paper along the sides and bottom. Pour in the batter and bang the pan twice to remove large air bubbles. Bake until a toothpick inserted in the center comes out clean and the crust is golden brown with a raised center, about 27 to 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031300010007	Combine Marinade and Chicken	Combine the marinade and chicken fillets in a shallow dish or plastic bag. Marinate the chicken for 2-6 hours in the fridge.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010100	Stir Mixture	Stir with a fork until the chia seeds aren't clumping anymore.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010167	Form Dough Balls	Lightly butter two 9-inch cake pans. Line pans with parchment paper. Pour one tablespoon of olive oil into the center of each pan. Divide dough in half with a large spoon or rubber spatula and place one piece of dough in each pan, turning to coat with oil. Tuck edges of dough underneath to form a rough ball.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010071	Remove Ham Bone and Add Ham	Using tongs, remove the ham bone to a cutting board and dice the remaining meat (about 1 cup of diced ham), then add it back to the soup. Stir and simmer uncovered for an additional 5 to 15 minutes, or until it's thickened to your liking. If it's too thick, you can add another cup of water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010209	Cook Quinoa	Cook the quinoa according to package instructions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010206	Prepare Sweet Potatoes	Add the cubed sweet potato to a parchment lined baking sheet and drizzle with avocado oil. Sprinkle with salt and garlic powder.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010212	Add Chickpeas and Thicken	Add the chickpeas to the pan, then put the lid back on and continue to cook for a further 10 minutes. The tagine should be thick and the vegetables should be tender when it is done.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031700010218	Assemble Burger	Assemble your burger with a hamburger, brioche bun or pretzel bun and all your favorite toppings. A chipotle mayo is a great sauce to pair with this Black Bean & Quinoa burger.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010221	Finalize Stew	Open Instant Pot, Stir everything. Add more water to bring the stew to desired consistency. Mix well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010225	Saut Onions	Turn Instant Pot to Saute mode. After the 'hot' sign displays, add oil and onions. Mix well. Cook covered with a glass lid for 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010231	Make Dressing	Next, prep the dressing. Add the peanut butter or sunflower butter into a bowl, along with the amino acids, lemon juice, honey (or maple syrup), rice vinegar, minced garlic, minced ginger and chili flakes. Give this a good mix. Note that the dressing will almost look like it's separated, but don't worry, this is totally normal.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010001	Serve	Enjoy the soup as is or serve with rice, cauliflower rice, or a side of flatbread or rolls. Garnish with fresh parsley, if desired.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010014	Add Greens and Adjust Seasoning	Add chopped sturdy greens, stir, and cover. Cook for 3-4 minutes more to wilt. Taste and adjust flavor as needed, adding more salt and pepper if desired.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022400010094	Beat Egg Whites	Preheat oven to 350 F. Using a stand mixer or hand mixer, beat egg whites with the cream of tartar (if using) on high until it becomes foamy. Next, add 1/3 of the amount of sugar and beat on high until firm peaks form. When lifting the whisk, look for the tip to drop slightly. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010097	Egg Yolk Mixture	In a large bowl, add the egg yolks, the remaining 2/3 sugar, salt, water, honey, and vanilla. Beat on high until fluffy, pale yellow ribbons form when lifting the whisk. The ribbon should remain for 3 to 4 seconds. Add half the egg whites to the egg yolk mixture and fold gently.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010100	Bake the Pretzels	Bake at 400F for about 16 minutes, alternating the trays halfway through for even baking. For crisper pretzels, bake for 5 more minutes. Serve warm or at room temperature the same day. To store, freeze the pretzels in an airtight container for up to 1 month.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010102	Preheat Oven	Preheat the oven to 400F. Line two baking sheets with parchment paper or silicone baking mats. Spray with nonstick cooking spray or grease with butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010108	Mix Dry Ingredients	Add the semolina, baking powder and salt to a food processor or blender. Mix until incorporated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010099	Make the Dough	Combine the yeast, barley malt syrup/sugar, and 1/4 cup of the water. Whisk to combine. Let stand for 5 minutes or until frothy. Add the remaining water, flour, and salt, and stir to combine. Knead on medium speed for five minutes until the dough is elastic and smooth and doesnt stick to the sides of the bowl or your hands, adding more flour if needed. This will be a very dense dough, so be careful not to step away from your mixer in case it decides to jump on the counter.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022400010107	Rest the Dough	Let mixture sit for at least 10 minutes and up to 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010101	Shape the Pretzels	Divide dough into 10 equal pieces. Roll each piece against the counter or between your palms into about a 24-inch long log. The thinner the log, the crispier the pretzels. The thicker, the softer the pretzels. Shape the log into a letter U. Cross the arms placing one over the other, then twist them around each other once. Bring the ends down to the bottom of the U and gently press to stick. Place on two greased parchment-lined baking sheets. If you prefer softer spongier pretzels, allow the shaped pretzels to rise for 30 minutes before bathing in the lye.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022400010109	Add Olive Oil and Water	Slowly drizzle in olive oil while food processor is on low. With the food processor still on low, slowly drizzle in water just until the mixture turns from chunky to a smooth dough. Turn off as soon as dough consistency is achieved. Let mixture sit for half an hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010098	Prepare the Lye Bath	Place safety gloves and goggles on, and a face mask too if you prefer. In a well-vented area, place a plastic or glass container (do not use metal) on top of a few pieces of parchment paper to protect your counter from splashes. Carefully sprinkle the lye into the water and stir until dissolved. Dip each pretzel into the lye bath for about 30 seconds, then place on the baking sheets. Score two slices into the thickest part of each pretzel and sprinkle with salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022400010103	Roll and Spread	Roll out the dough so it is about 3mm (1/8 in) thick and 30 cm (12-inch) wide. Spread the room temperature butter on top. Make a mixture of sugar and cinnamon and sprinkle it over the dough.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022400010104	Prepare Dough	Crumble the yeast in a bowl and stir in a few tablespoons of milk. Melt the butter and pour the milk on it. Add the rest of the ingredients and knead the dough for approximately 10-15 minutes. Let the dough rise while covered at room temperature for a minimum of 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
