1824022500010004	Marinate the Chicken	Next, poke some holes in your chicken with a knife to let the marinade permeate more deeply. Set the chicken into a large bowl or into a sealable baggie. Pour the marinade over the chicken and rub it down. You can to completely cover the chicken with the marinade. Cover and refrigerate. Marinate the chicken at least 2 hours, though you'll get more flavor penetration if you plan ahead and refrigerate overnight. Discard marinade.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010005	Make the Dipping Sauce	Puree the salsa in a blender. Transfer to a medium bowl and add the mayonnaise, garlic powder, basil, salt, cayenne, and pepper and whisk well to combine. Cover and refrigerate for at least 2 hours before serving. Stir well before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010006	Make the Fritters	Pour oil into a small frying pan or deep skillet, so that it comes at least one inch up the sides of the pan. Heat the oil to 350 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010008	Serve	Use a slotted spoon to transfer the fritters to paper towels to drain. Serve immediately with the dipping sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010009	Fry the Fritters	Using spoons or a cookie scoop, drop 1-inch balls of batter into the oil. Fry, turning with a slotted spoon, until golden brown, about 2 minutes for smaller fritters, up to 4 minutes if made larger. Work in batches to avoid overcrowding the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010007	Prepare Fritter Batter	Combine the flour, sugar, baking powder, and egg in a large bowl and stir well. Add the buttermilk to create a thick paste. Stir in the conch, jalapeo, onion, red pepper, carrots, garlic, and seasoning, ensuring even distribution.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010014	Prepare Bajan Cornmeal (Cou-Cou)	While simmering, prepare the Bajan cornmeal. Add water, okra, onion and thyme to a large pan and bring to the boil. Strain the water, reserving the okra slices and liquid separately but discarding the onion and thyme. Whisk in the cornmeal with the reserved water to create a smooth mixture. Stir in the okra until fully incorporated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010011	Serve	Scoop the cornmeal mixture into serving bowls and top with a rolled fillet, spooning over the fish stew. Season to taste and garnish with the parsley and edible flowers, if using.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010013	Cook Fish	Rinse and pat dry the fish fillets. Season again with a little salt, pepper and garlic powder then roll each fillet up to form a cylinder. Place the rolls into the stew, cover the pan and simmer gently over a low heat for 12-15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010015	Begin Stew	Begin the stew by placing oil in a deep frying pan over medium heat. Add the onion, garlic, pepper, tomato, thyme, curry and garlic powders and fry to soften. Stir in 1 tbsp of the Bajan chopped seasoning along with the butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010001	Season and Brown the Beef	Pat the beef dry and sprinkle with salt and freshly ground black pepper. Heat a little oil in a Dutch oven over high heat. Once very hot add the beef and brown generously on all sides. Transfer the beef to a plate. (Do not discard the drippings and blackened bits in the pot, they are key to the flavor.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010012	Prepare Bajan Chopped Seasoning	Begin by making the Bajan chopped seasoning. Add onions, garlic, ginger, Scotch bonnet, thyme, mixed spice, and lime juice to a food processor. Blitz to form a rough paste. Transfer to a jar and add vinegar. Seal the jar and shake vigorously to incorporate. Season to taste and store in the fridge to infuse a few hours before using, up to 2 weeks or frozen.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022500010016	Prepare Callaloo	Peel outer membrane of each stalk of callaloo and remove outer old leaves. Place callaloo in a bowl and cover with cold water, place 1/2 tsp salt and set aside while preparing remaining vegetables. Discard water then rinse with water and drain. Chop callaloo	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022500010017	Cook Vegetables	Place oil in a large pot, add onion, garlic, spring onion, thyme, tomato, and scotch bonnet pepper on medium heat, saut until onion is translucent. Add callaloo and water, allow to simmer on low heat for 5-10 minutes or until tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010002	Shred Beef and Combine	Transfer the beef to a plate and shred it. Return the shredded beef to the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010005	Cook Beef with Vegetables	Return the roast to the pot along with the pieces of carrots and celery. Bring to a boil, reduce the heat to low, cover and simmer for 3-4 hours or until the beef is fork tender and falls apart easily. Discard the celery, carrots and bay leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010006	Cook Vegetables	Add the sliced vegetables to the pot and cook over medium heat for 15-20 minutes until caramelized. Add the garlic and spices and cook for another minute. Add the white wine and bring it to a rapid boil, deglazing the bottom of the pan (scraping up the browned bits on the bottom of the pan).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010004	Simmer with Tomatoes and Broth	Add the broth, crushed tomatoes, tomato paste and bay leaves. Simmer for 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010003	Add Final Ingredients	Stir in the olives, roasted red peppers, capers and pimientos. Simmer uncovered to thicken the sauce for 30 minutes. Stir in the parsley and add salt and pepper to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010008	Add Rice, Peas, and Corn	Stir in the rice, followed by pigeon peas and corn. Saut for another minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010009	Prepare Rice	Wash rice until water runs clear. Drain water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010010	Simmer with Coconut Milk	Pour in coconut milk, bouillon powder, and Creole spice with about 2 cups of water, bring to a boil, reduce heat, cover with a lid, and simmer until rice is cooked, about 18 minutes. Stir occasionally from the sides to prevent burns; add more water if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010007	Saut Vegetables	Heat a saucepan with oil. Then add onions, green onions, bell pepper, garlic, smoked paprika, thyme, scotch bonnet pepper, and saut for about 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010011	Simmer	Pour in coconut milk, bouillon powder, and Creole spice with about 2 cups of water, bring to a boil, reduce heat, cover with a lid, and simmer until rice is cooked, about 18 minutes. Stir occasionally from the sides to prevent burns; add more water if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010012	Add Rice, Peas, and Corn	Stir in the rice, followed by pigeon peas and corn. Saut for another minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010013	Saut Ingredients	Heat a saucepan with oil. Then add onions, green onions, bell pepper, garlic, smoked paprika, thyme, scotch bonnet pepper, and saut for about 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010014	Prepare Rice	Wash rice until water runs clear. Drain water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010016	To Make the Mofongo	Heat oil in a medium skillet over medium heat. Fry the plantains for 5-8 minutes, or golden brown on all sides. Transfer the plantains to a plate lined with a paper towel to remove excess grease.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010015	To Make the Garlic Mojo	Crush together garlic cloves and salt with a piln (mortar and pestle), until you obtain a smooth paste. Transfer into a medium bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010020	To Make the Garlic Mojo	Stir in fresh bitter orange juice, olive oil, cumin, oregano, and chopped cilantro.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010019	To Make the Mofongo	Serve with extra pork cracklings (chicharrn) and garlic mojo on the side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010022	Add Remaining Ingredients and Cook	Add minced garlic, wiri wiri peppers (puncture one or two peppers with a knife first for extra chile heat), brown sugar, grated ginger, nutmeg, orange peel, and the remaining 1/4 cup cassareep and 1 teaspoon chicken bouillon to the pot and stir well. Bring to a simmer, then reduce heat to medium-low and cook for 15 minutes; the stew's sauce should be brothy but with body. Season with salt, if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010059	Serve	Slice and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010061	Prepare Sauce	In a small whisk together soy sauce, garlic, brown sugar, sesame oil, chicken broth, and cornstarch.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010011	Marinate Chicken	In a mixing bowl, whisk together two tablespoons of olive oil, with the lime juice, cilantro, garlic, chili powder, cumin, salt, and pepper. You can also pulse in a food processor until it's combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010102	Blend Ingredients	When they're soft, add the chiles, the garlic, cumin, thyme, cloves and avocado pit to a blender. Add some water or stock and puree. You want this to be about as thick as melted ice cream or housepaint.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010169	Sprinkle and Bake	Sprinkle tops with Italian seasoning (or fresh herbs) and flaky sea salt. Transfer the pans to the oven and immediately reduce the temperature to 425F. Bake for 22 to 28 minutes, until the tops are golden and the undersides are crisp. Remove pans from the oven. With a metal spatula remove bread rounds from the pans and transfer to a cooling rack.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010079	Form and Cook Matzo Balls	Use a tablespoon or a small scoop to make 1 inch matzo balls. Drop the balls into the soup. Cover the pot and simmer for 25-30 minutes or until balls are puffed and vegetables are tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010087	Cook Bacon	Cook bacon in a large pot over medium-high heat until crisp, 5 to 7 minutes. Drain, leaving bacon and 2 tablespoons grease in the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010093	Garnish	Garnish the top with green onions, extra peanuts, cilantro and lime wedges. Serve immediately!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010101	Finish Soup	Add in the shrimp and fish sauce. Lastly, add the lime juice (if you add lime juice too early, the soup might turn bitter). Boil until the shrimps are cooked, dish out, and garnish with cilantro leaves. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010228	Combine Noodles and Dressing	At this point the noodles (and edamame) should be done. Drain and rinse the noodles with cold water. Add the noodles to the bowl and pour over the dressing. Toss to combine, either using salad hands or your actual hands (which I think get the veggies and noodles coated better in the dressing).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010243	Slice Green Chilies	Slice the green chilies.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010249	Marinate the Fish	Combine the fish with the sugar, chicken bouillon powder, pepper, fish sauce and oil as well as half of the garlic and red shallots. Let it marinate for a minimum of 20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010005	Add Greens and Adjust Seasoning	Add chopped greens to the pot, stir, and cover. Cook for 3-4 minutes more to wilt the greens. Taste and adjust seasoning as needed.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022600010018	To Make the Mofongo	Using a large piln (mortar and pestle) mash the plantains, garlic, and pork cracklins together, until the plantains are broken down. You might have to do this in small batches.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010023	Season and Cook Oxtail	Season oxtail all over with salt and 1/2 teaspoon chicken bouillon. Using the same pressure cooker, combine oxtails with 1/2 cup cassareep, 7 sprigs thyme, 8 whole cloves, 1 cinnamon stick, and 2 cups water. Bring to high pressure and cook for 30 minutes. Depressurize the cooker using the rapid release valve, then transfer cooked oxtails and their cooking liquid into the pot with the cow foot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010024	Season and Cook Beef Chuck	Season beef chuck all over with salt and 1/2 teaspoon chicken bouillon. Using the same pressure cooker, combine beef chuck with 1/2 cup cassareep, 7 sprigs thyme, 8 whole cloves, 1 cinnamon stick, and 3 cups water. Bring to high pressure and cook for 30 minutes. Depressurize the cooker using the rapid release valve, then transfer cooked beef chuck and its cooking liquid into the pot with the cow foot and oxtails.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010003	Season	Taste and season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010013	Add Cheese	Sprinkle on the shredded cheese.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010019	Roll Tortillas	Roll up tightly, like a burrito, and secure with toothpicks, if necessary.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010026	Season	Taste the soup and season with extra salt, pepper, and/or smoked paprika as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010008	Assemble Salad	In a large salad bowl, layer the chopped lettuce with beans, corn, tomatoes and chicken strips. Then drizzle the avocado dressing on top.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500000004	Step 2	Donec dictum lectus in ex accumsan sodales. Pellentesque habitant morbi tristique.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031500010172	Prepare the Dough	In a medium-large bowl, combine flour, salt, and instant yeast. Stir well. Add the warm water. Using a Danish Whisk, sturdy wooden spoon or a rubber spatula, mix until all of the flour is well incorporated. Cover the bowl with plastic wrap and refrigerate for at least 8 hours and up to 24 hours.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010080	Serve	Sprinkle with parsley, then serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010082	Garnish and serve	Serve in bowls with a drizzle of sesame oil and garnish with green onions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010094	Make Sauce	Make sauce by combining sauce ingredients in a bowl. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010227	Combine Vegetables	Add the chopped cabbage and carrots into a shallow bowl, along with the cilantro, green onion. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010242	Serve	Slice the bnh m in half to make two servings and enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010253	Make the bnh xo batter	In a small bowl, soak the dried mung beans in warm water until they are softened, about 30 minutes. Drain the beans and transfer them to a blender. Add the coconut milk and puree until very smooth. Transfer the mung bean puree to a large bowl and whisk in the white rice flour, cornstarch, scallions, water, salt, and turmeric, and season lightly with salt. Let the batter rest for at least 20 minutes or refrigerate overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010006	Add Potatoes and Broth	Add potatoes and season with a bit more salt and pepper. Stir and cook for 2 minutes more. Add vegetable broth and rosemary or thyme and increase heat to medium high. Bring to a rolling simmer.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010015	Saut Vegetables	Heat a large pot over medium heat. Once hot, add water (or oil), garlic, shallots/onion, carrots, and celery. Season with salt and pepper and saut for 4-5 minutes or until slightly tender and golden brown.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010016	Heat a large pot over medium heat. Once hot, add water (or oil), garlic, shallots/onion (optional), carrots, and celery. Season with a bit of salt and pepper and stir.	Saut for 4-5 minutes or until slightly tender and golden brown. Be careful not to burn the garlic (turn heat down if its cooking too quickly.)	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022600010021	To Make the Mofongo	Pack a serving into a small bowl and turn it over onto a plate for serving. Remove the bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010025	Season and Cook Cow Foot	Season cow foot all over with salt and 1/2 teaspoon chicken bouillon. In a stovetop pressure cooker or electric multicooker, combine cow foot with 1/2 cup cassareep, 7 sprigs thyme, 8 whole cloves, 1 cinnamon stick, and 4 cups water. Bring to high pressure and cook for 60 minutes. Depressurize the cooker using the rapid release valve, then transfer cow foot and cooking juices into a large pot or Dutch oven and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010026	Remove from Heat	Remove from heat, then skim any fat from the surface. Serve with bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010002	Combine Ingredients	In a medium bowl, combine drained tuna, mayonnaise, dill pickles or relish, celery, green onion, Dijon, and lemon juice. Gently toss them together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010018	Fill Tortillas	Place a large spoonful of mixture in a line along the edge of a tortilla.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010029	Roast the Duck	One hour before roasting, take the duck out of the fridge to bring it back to room temperature. Put all the stuffing ingredients into the cavity. Use toothpicks or skewers to seal the openings of the cavity. Preheat a fan-assisted oven, aka convection oven, at 200C/390F (or 220C/425F if using a conventional oven). Put the duck over the middle rack of the oven with the breast side facing up. Place a roasting tray at the bottom of the oven to collect any dripping fat during roasting. Leave to cook for 15 minutes. Then lower the temperature to 180C/350F (or 200C/390F if using a conventional oven). Use aluminium foil to cover the tip of the wings and the end of the legs. Continue cooking for a further 60 minutes or so. Check the doneness by inserting an instant-read thermometer into the thickest part of the duck. The temperature should be no lower than 74C/165F.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022600010027	Prepare the Duck	Pat dry the duck with kitchen paper then rub the salt over the skin and the cavity. Put the duck over a wire rack with a tray underneath to collect any drips. Leave to rest on the counter for 1 hour. Bring about 1 1/2 liters of water to a boil, then gently pour it over the entire duck skin (remember to flip over and do the other side). In a bowl, mix maltose with hot water and vinegar until completely dissolved. Brush a layer of the mixture over the duck skin. Leave to rest in the fridge for 1 hour then brush another layer. Keep the duck refrigerated uncovered for 24 to 48 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010028	Serve the Duck	Take the duck out of the oven and leave it to rest on the counter for 15 minutes. While waiting, prepare the sauce. Add sweet bean sauce and sugar to a pan. Add transfer to a small serving dish. Steam the pancakes for 3 minutes to warm up if they're cold. Slice the duck into pieces. When eating, spread a little sauce over a pancake, put the duck, scallions, and cucumber in the middle. Wrap into a cylinder and enjoy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010030	Garnish and Serve	Garnish with extra green onion and a small pinch of the ground Sichuan peppercorns, if using. Serve hot over steamed rice or by itself as main.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010032	Grind Sichuan Peppercorns	Meanwhile, grind the fried Sichuan peppercorns (you used when heating up the oil) in a coffee grinder or using mortar and pestle. (Optional)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010035	Add Broth and Seasonings	Spread tofu evenly on top of ground pork. Add chili oil, five-spice powder, and sugar. Pour in the broth and cook until brought to a simmer. Simmer, covered, over medium-low heat for 8 to 10 minutes, or until the sauce has reduced to half the original amount. Taste the tofu with some broth (be careful, it will be very hot!). Adjust seasoning by adding salt if needed. If the dish is too spicy, add another teaspoon of sugar to balance it out. Gently mix well with spatula.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010025	Serve	Serve warm, garnished with any extra toppings you would like, and enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010013	Form Crab Cakes	Beat the remaining egg and add to a shallow dish. Add the panko bread crumbs to another dish. Spoon about 1/3 cup of the mixture into your palm and flatten into a small disc, about 3 inches in diameter. Sprinkle the outsides of the crab cake patties with a tiny bit of cornstarch.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010018	Mix Crab and Seasonings	In a mixing bowl add the crab meat, bell peppers, one beaten egg, Old Bay seasoning, mayo, garlic, cilantro and salt and pepper. Gently stir just until blended.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
