1824031700010232	Top and Serve	Top with sesame seeds and chopped peanuts (or cashews if you're allergic to peanuts). This salad stores really well in the fridge (about 3 days) and tastes amazing as a cold salad for lunch or dinner.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010236	Prepare Cucumber	Peel and slice the cucumber into ribbons.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010248	Braise the Fish	Let the fish braise on a low-medium heat for 1 hour or until soft with the lid partially on. The sauce should be slightly thick and sticky when it's done. If you plan to add chili, you can put it in now.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010007	Serve	Enjoy as is or serve with rice, cauliflower rice, or a side of flatbread or rolls. Garnish with fresh parsley if desired.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022600010036	Cook Ground Meat and Doubanjiang	Add the ground meat and Doubanjiang. Cook over medium heat and chop the ground meat into small bits with a spatula, until pork is evenly coated with Doubanjiang and fully cooked through. Add green onion and stir fry for another minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010037	Thicken Sauce	Mix cornstarch water again until fully dissolved and swirl it into the skillet. Gently stir a few times with a spatula, until sauce thickens. Turn off heat and transfer everything to a bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010031	Prepare Cornstarch Mixture	Combine cornstarch with 1 tablespoon of water in a small bowl. Mix well and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010004	Serve	Use to top a salad, in sandwiches, or to add to pasta salads.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
