1824031200010024	Roast the Tomatoes	Heat oven to 450F. Quarter the tomatoes and arrange them cut-side-up on a baking sheet. Drizzle evenly with 2 tablespoons of the olive oil and season with a few pinches of salt and black pepper. Bake for 30 to 40 minutes or until softened, then transfer baking sheet to a wire rack.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010029	Serve	Divide the pasta between bowls and top with a sprinkling of black pepper, grated Parmesan, toasted pine nuts, and fresh baby basil leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010012	Refrigerate	For at least one hour, or up to 5 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010016	Cook	Heat olive oil in a large skillet over medium heat. Once hot, add the crab cakes and cook for about 3-4 minutes on one side, until golden brown on bottom. Gently flip to the other side and cook for another 3 minutes, or until golden. Remove to a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010020	Lobster Risotto	In a medium saucepan add the broth, water, a pinch of salt, and the lobster shells. Simmer for 15 minutes with the lid on. In a wide pot or pan on low heat, add the garlic, shallots, and approximately 1/2 tsp of salt and saute until soft and fragrant. Add arborio rice to combine. Toast rice for 3-4 minutes until it starts to become translucent. Add the wine and stir. Cook for 2-3 minutes before adding the first round of broth. Depending on the pan add broth until it just covers the risotto. Cook until rice absorbs the majority of the broth. Add more broth and repeat the steps. Once almost all the broth has been added, give it a taste. Rice should still be loose, yet al dente. If it is still hard add more broth 1/4 cup at a time and cook down. Once done turn off the heat. Add the parmesan, lobster meat, and 2 more tbsp of lobster herb butter. Mix to combine and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010027	Finalize	Remove from heat. Divide mussels and broth among four bowls. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010030	Bake the Cod	Bake in the oven for 13 to 15 minutes, or until the cod is opaque and flakes easily with a fork. Before serving, spoon the juices from the baking dish over the cod.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500000001	Step 3	Nunc nulla velit, feugiat vitae ex quis, lobortis porta leo. Donec dictum lectus in ex.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031600000002	Cook Mixture	Add milk-egg mixture back to saucepan and cook over medium for 3 minutes or until thick. Stirring constantly.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010081	Add Garlic and Chicken	Add the garlic to the pot and cook for 30 seconds. Then add the chicken, Italian seasoning, salt, pepper, and chicken broth. Bring to a simmer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010102	Make Shrimp Stock	In a pot, bring 3 cups of water to boil. Add the shrimp head and shell to make shrimp stock. Boil until the water turns slightly orange in color. Press the shrimp heads with a spatula to extract the juice from the heads.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010229	Prepare Vegetables	While the noodles cook, prep the veggies. Pro tip here, make sure the carrots and cabbage are similar in thickness and length (the thinner the better), they taste better in the salad like this. My other tip for shredding carrots is to use a box grated to get them really fine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010244	Marinate Chicken	Chop the chicken thigh meat into bite-sized pieces and place them in a large bowl. Mix the minced garlic, sesame oil, honey, hoisin sauce, and soy sauce, and pour it over the chicken. Refrigerate the chicken for 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010254	Make the filling and crepes	Heat 1 teaspoon of vegetable oil in a 10-inch nonstick skillet. Add a few slices of pork, a couple of shrimp, and a few slivers of white onion and cook for 30 seconds. Stir the batter and pour 2/3 cup of it into the pan, and swirl the pan to coat the bottom with a very thin layer of batter, letting it come up the side of the pan. Scatter 1/4 cup of the bean sprouts over the bnh xo and drizzle 2 teaspoons of vegetable oil around the edges. Cover the skillet and cook over moderately high heat until the bottom of the bnh xo is golden and crisp, about 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010010	Cook Lentils	Then add lentils and stir. Once simmering again, reduce heat to low and simmer uncovered for 15-20 minutes or until lentils and potatoes are tender.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022600010033	Cook Sichuan Peppercorns	Heat the oil and Sichuan peppercorns in a large nonstick skillet over medium-high heat. When the Sichuan peppercorns turn dark brown and crispy, scoop them out with a spatula and transfer into a bowl layered with paper towels to soak extra oil. Save to use for garnishing the dish (Optional).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010001	Drain Tuna	Drain the tuna well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010015	Bake	Place on baking sheet, bake for 5-7 minutes at 400, or until cheese is melted (times may vary).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010014	Coat with Egg and Bread Crumbs	Dip each patty lightly in the beaten egg, and then coat them lightly with panko bread crumbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
