1824031600010078	Prepare the Matzo Balls	Place the eggs in a bowl and beat well. Whisk in the fat and club soda. Add the matzo meal, baking powder, and salt, then stir until well combined. Cover the bowl and refrigerate for at least one hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010230	Thin Out Dressing	Next pour in the water and gently whisk to combine. Continue to whisk until the water is completely mixed into the dressing. If the peanut dressing is still too thick, continue to whisk in tiny amounts of water until it reaches a consistency you like. Once the dressing has become silky smooth and dark in color, it's done. Make sure to adjust for salt before using!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010245	Prepare Baguette	Slice open the baguette and scoop out some of the soft bread inside to create more room for the sandwich fillings. Spread mayonnaise onto both sides of the baguette, then sprinkle it with Maggi Seasoning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010011	Add Potatoes and Broth	Add potatoes, vegetable broth, rosemary, and thyme. Increase heat to medium-high and bring to a rolling simmer.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022600010034	Marinate Ground Meat	Combine ground meat, cooking wine, soy sauce, and ginger in a small bowl. Mix well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010038	Blend Pork Filling	Blend the pork jelly for a while. Then add pork chunks in a blender, add salt, sugar, pepper, light soy sauce and oyster sauce. Blend with pause for 10 seconds. Then add the ginger and green onion water in. Continue blending with pause for another minute. Add the pork jelly, chopped green onion and sesame oil in. Stir in one direction for 1 or 2 minutes. Cover and place in fridge.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010041	Prepare Ginger and Green Onion Water	Soak minced ginger, green onion and Sichuan peppercorn with 1/2 cup hot water for around 10 minutes to make ginger and green onion water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010042	Steaming Process	Place the assembled dumpling on lined steamer. Set up the steamer and steam for around 8 to 10 minutes after the water is boiling. Serve directly or with Chinese black vinegar and ginger shreds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010057	Cook Chicken	Add 1 tablespoon of oil to the pan and bring heat to medium-high. Use a slotted spoon to scoop half of the chicken (allowing excess marinade to drip off) into the hot pan, in a single layer. Cook chicken for 1-2 minutes on each side, flipping only once, until golden (chicken does not need to be completely cooked through).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010053	Repeat Cooking	Remove chicken to the bowl with the peanuts. Repeat with cooking remaining chicken. Return peanuts and chicken to the pan. Add dried chilies, ginger, bell peppers or other vegetables and green onion. Stir-fry for 1-2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010039	Prepare Pork Jelly	Make the pork jelly in the previous day (separate recipe).	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022600010040	Prepare Wrappers	Add pinch of salt in flour. Add flour and water in a mixing bowl and then knead the dough until smooth and stretchy. Cover with a wet cloth and reset for 1 hour. Shape the dough into a log and cut into small pieces. Then roll the wrapper out to form a large wrapper. Place the wrapper in your left hand. Place 1 tablespoon of the filling in the center of your wrapper. Begin to fold the edge counterclockwise. Repeat the process until the dumpling is completely sealed. Then slightly pull up the sealed peaks and remove the extra flour.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022600010046	Cooking the Aromatics	In a large pot, warm 2 teaspoons of the sesame oil over medium heat. Once shimmering, add in the white parts of the scallions, garlic, ginger, and mushrooms; stir constantly until the mushrooms have softened, about 4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010044	Final Touches	Remove from the heat and stir in the green parts of the green onions, the remaining teaspoon sesame oil, soy sauce, and Shaoxing wine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010045	Serving	Ladle soup into bowls with 5 wontons per serving. Drizzle with a bit of chili oil, if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010043	Adding Broth and Wontons	Pour in the chicken broth; bring to a boil. Then add in the baby bok choy and frozen wontons; reduce heat to a gentle bubble and cook for about 5 minutes until the bok choy is wilted and the wontons float to the top and are heated through (you can cut one open to check).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010048	Season and Combine	Add the soy sauce, five-spice powder, dash of white pepper (if using) and sesame oil and stir to distribute the seasonings. Add the scrambled eggs and stir to mix again. Garnish with remaining sliced scallions. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010050	Scramble Eggs	Heat a skillet with 1 tablespoon of the oil over medium-high heat. Once the pan is hot, add the beaten eggs and scramble them for about a minute. Transfer the eggs to a dish and turn off the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010047	Cook Onions and Vegetables	Drizzle the remaining 2 tablespoons of oil into a wok over high heat. Add the onions and cook them for about 1 to 2 minutes, stirring constantly. Add the mixed vegetables and white parts of the scallions and cook for 2 minutes. Season the vegetables with a pinch of salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010049	Beat Eggs	Crack the eggs into a small bowl and beat them together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010051	Add Rice	Add the cooked rice into the pan or wok and cook for several minutes, until the rice is heated through. If there are large clumps of rice, break them apart with the back of your spatula.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010054	Add Sauce and Cook	Add the sauce. Stir, and cook for a few minutes, or until chicken is cooked through and the sauce begin to slightly thicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010055	Marinate Chicken	In two separate bowls, make the chicken marinade and the sauce ingredients. Set the sauce aside. Add the chicken to the chicken marinade and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010056	Serve	Remove from heat and serve with hot cooked rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010052	Cook Peanuts	Add 1 tablespoon of oil to a wok or frying pan and heat to medium. Add red pepper flakes and peanuts and stir-fry until peanuts are golden (about 2 minutes). Remove peanuts and pepper flakes to a bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010059	Serve	Cut pork into thick slices to serve. Serve over steamed rice and/or vegetables with the extra glaze.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010058	Prepare Additional Glaze	If you like additional glaze, combine all of the extra glaze ingredients into a small saucepan. Bring to a boil; reduce heat and allow to simmer for about 5-8 minutes until the sauce has thickened (keep your eye on it as it can burn easily if the heat is too high). Remove from heat and allow to cool slightly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010061	Prepare For Grilling/Broiling	Preheat oven to grill/broil settings on medium heat (176C | 350F). Drain pork and discard the marinade. Line a baking pan with baking/parchment paper or aluminum foil. Place pork onto pan and grill/broil for 30 minutes on one side, basting two or three times with the reserved marinade. Rotate with tongs and baste again with the marinade twice again while grilling/broiling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010062	Marinate The Pork	Combine hoisin sauce, soy sauce, wine, honey, sugar, garlic, colouring (if using) and spice powder in a shallow bowl. Whisk well to combine. Pour half of the sauce into a jug and reserve for later. Add the pork into the bowl with the remaining sauce. Rotate to cover completely and marinate in the refrigerator for 1-3 hours, or cover and refrigerate overnight for best results.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022600010060	Cool The Pork	Remove from oven and allow to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010002	Fry the Rice	In a pan or pot with a lid, heat up the chicken fat or oil. Add the ginger, garlic, and shallot. Cook, stirring, until fragrant. Stir in the rice and fry gently until glossy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010005	Combine Ingredients	When the 10 minute rest is up, remove and discard the green onions. Remove the chicken and slice. Fluff up the rice and serve with thinly sliced cucumbers and green onion oil. Enjoy immediately!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
