1824022700010004	Prepare Onion Oil	While the rice is cooking, make the green onion oil: place the green onions in a deep heat proof bowl and set aside. In a small pot, heat 1/4 cup oil over medium heat until it reaches 275F. Remove the pot from the stove and very carefully pour over the green onions  they will sizzle and bubble up. Stir in salt to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010001	Prepare Chicken	Rub the chicken skin with the salt and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010003	Cook the Chicken	Add chicken stock, then place the chicken, skin side up, in the pan. Add the green onions on top. Bring to boil over medium high heat and when it starts to simmer, cover and turn the heat down to low. Cook for 17 minutes, turn off the heat, and let rest for 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010015	Slice and Serve	Using a sharp knife, slice chilled tiramisu into servings. Wipe knife clean between cuts.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
