1824031200010016	Add Sauce	Spread sauce on top of the pita.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010007	Begin the Mascarpone Cream	With a handheld or stand mixer fitted with a paddle or whisk attachment, beat the mascarpone and rum together on medium speed in a large bowl until smooth. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010013	Whip the Heavy Cream	With a handheld or stand mixer fitted with a whisk attachment, beat the heavy cream and vanilla extract together on medium-high speed until medium peaks form, about 3-4 minutes. Medium peaks are between soft/loose peaks and stiff peaks and are the perfect consistency for the tiramisu cream. Fold the whipped cream into the mascarpone mixture.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010014	Prepare a Double Boiler for the Egg Yolks	If you have a double boiler, use it in this step. If you dont, place a heat-proof bowl over a small pot of simmering water over medium-low heat. Dont let the water touch the bottom of the bowl.  Using a whisk or eggbeater (I simply use a whisk), whisk the egg yolks and 1/4 cup (50g) of granulated sugar together until light and foamy, about 5 minutes. Remove from the heat and immediately pour into the mascarpone mixture. Beat on medium speed until combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031200010022	Put it all Together	Add the broth, basil, and the roasted tomatoes (once they are ready) with their juices and stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010015	Make the Sauce	Combine the ingredients until smooth. Refrigerate, covered, until ready to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
