1824022700010006	Beat the Egg Whites	With a handheld or stand mixer fitted with a *clean* whisk attachment, beat the egg whites and salt together on medium-high speed until foamy, about 1 minute. Increase to high speed and slowly pour in the remaining 1/4 cup (50g) of sugar. Beat until stiff peaks form, about 4-5 minutes. (Do not over-beat as the egg whites will become dry.) Fold into the mascarpone cream.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010009	Add Cocoa Layer, then Chill	After a couple hours in the refrigerator, sift or strain a dense layer of cocoa powder all over the top. Wipe the rim of the baking dish. Cover with plastic wrap or aluminum foil, then refrigerate for at least 8-9 more hours and up to 1 day.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010008	Dip Remaining Ladyfingers	Dip remaining ladyfingers into remaining espresso mixture and arrange one-by-one on top of the mascarpone layer. Gently press each down so they are nice and compact. Using an offset spatula, spread remaining mascarpone mixture evenly on top. If youre using a large enough pan, it should all fit (but it will definitely tower high!). Refrigerate uncovered for 2-3 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031600000003	Add Pumpkin	Remove from heat, stir in pumpkin puree, salt, and pumpkin pie spice.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010084	Stir in soy sauce and simmer	Add the white pepper, dark soy sauce, regular soy sauce, and vinegar. Continue simmering for another 3 minutes or until the mushrooms have softened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010233	Cook Noodles	Start by cooking the noodles according to package instructions. To save on extra dishes, add the frozen edamame into the noodles to cook 1 minute before the noodles are done.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010234	Drain Carrots	Drain the pickled carrots.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010250	Garnish and Serve	Garnish with spring onions and serve immediately with hot rice!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010012	Serve	Enjoy as is or serve with rice, cauliflower rice, or a side of flatbread or rolls. Garnish with fresh parsley.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824022700010012	Prepare Baking Pan	You need a large 9x13 inch baking pan/dish with at least a 12-14 cup capacity. Set aside and have ready to go!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022800010039	Optional Cutting	If desired, cut in half or cut into 4 small triangular shapes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010010	Dip Half of the Ladyfingers	You will form 2 layers each of dipped ladyfingers and mascarpone cream. Lets begin with the 1st layer of ladyfingers. Whisk the espresso and Grand Marnier together in a shallow bowl. One at a time, quickly dip each side of the ladyfinger into the espresso mixture. You dont want to over-saturate the ladyfinger with liquid because then the ladyfingers will taste soggy. Just a quick dip on each side. Arrange the dipped ladyfingers in the baking pan to make one solid layer. If needed, cut some ladyfingers to fill in any empty spaces. Reserve remaining espresso mixture and ladyfingers for another layer.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010011	Spread Half of the Mascarpone Cream	Spread half of the mascarpone cream evenly over bottom layer of ladyfingers. An offset spatula helps spread it neatly and evenly.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022700010016	Preheat and Simmer	Heat oven to 325 degrees. In a saucepan, combine cream, vanilla bean and salt; cook over low heat just until hot. Let sit for a few minutes, then discard vanilla bean. (If using vanilla extract, add it now.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010019	Bake	Bake for 30 to 40 minutes, or until centers are barely set. Cool completely. Refrigerate for several hours and up to a couple of days.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010018	Prepare for Serving	When ready to serve, top each custard with about a teaspoon of sugar in a thin layer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010020	Mix Egg Yolks and Sugar	In a bowl, beat yolks and sugar together until light. Stir about a quarter of the vanilla cream into this mixture, then pour sugar-egg mixture into cream and stir. Pour into four 6-ounce ramekins and place ramekins in a baking dish; fill dish with boiling water halfway up the sides of the ramekins.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010017	Final Broil	Place ramekins in a broiler 2 to 3 inches from heat source. Turn on broiler. Cook until sugar melts and browns or even blackens a bit, about 5 minutes. Serve within 2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010021	Spread Peanut Butter	Using a spoon, scoop about a tablespoon of peanut butter and simply spread on one slice of bread. After the majority of the peanut butter is on the bread, turn the spoon over, and using the back of the spoon, spread the peanut butter to the corners.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010022	Optional Cutting	If desired, cut in half or cut into 4 small triangular shapes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010023	Combine Slices	Place the peanut butter bread and the jelly bread together, so the peanut butter and jelly are touching. Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022700010024	Spread Jelly	Using a different spoon (or clean the first one) scoop about a tablespoon of jelly or jam, and pour onto the other slice of bread, and spread to the edges using the back of the spoon, as you did with the peanut butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
