1824022900010016	Make Chocolate Curls	Melt chocolate. Pour the melted chocolate over the back of a baking pan and spread out with a spatula as thinly as possible. Refrigerate for 3 - 4 minutes until the centre is just set. Using something with a sharp, straight edge (I use a bench scraper, spatula or the back of a knife also works), hold it at a 45 degree angle and scrape along the tray away from you to create curls. Do a small test patch first. If the chocolate is too hard, the curls may break or flake (leave to soften slightly and try again). If the chocolate is too soft, the curls sag and won't roll (refrigerate more to harden). Carefully place curls on a plate and refrigerate until ready to use.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
