1824022900010019	Finish the Cake	Reserve 1 1/2 cups whipped cream for piping cream decorations. Spread the remaining cream over the top and side of the cake. Pipe dollops around the edge of top using a large star-tipped nozzle. Top each dollop with a maraschino cherry. Pile large chocolate curls in the middle (I stack in a tent shape like building a fire!). Use the smaller broken shavings to coat the base of the sides of the cake (using cold hands, scoop up shavings, press on side).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022900010010	Assemble Cake	Place one cake layer upside down on a serving platter (or cake decorating turn table, if you're a pro! :) ). Brush with cherry syrup: Brush the cake layer with 1/4 cup of the cherry syrup the cherries are soaking in. Spread with 1 cup of whipped cream, leaving a 1cm (1/2") border (the weight of the next cake layer gently pressed will push cream to edge). Top the cream with half the cherries (in a single layer), using a slotted spoon to drain well (but don't pat dry, want the cherries juicy!).	a525810e-5531-4f97-95a4-39a082f7416b	f	2
