1824022900010036	Cook Churros	Lightly oil the blade end of your scissors and set aside. Carefully pipe 5-6 inch long strips of dough into hot oil, cutting the ends with oiled scissors. Fry 4-5 churros at a time to avoid over-crowding your pot. Fry until golden browned, about 2 minutes each side. Transfer to paper towel lined plate for a few seconds, then roll in the cinnamon sugar. Repeat with remaining dough. Serve warm with melted chocolate or caramel sauce, fruit or ice cream.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824022900010031	Pipe Meringue	Pipe meringue into 3 to 3 1/2 inches wide nests onto the parchment paper using a Wilton 1M Tip. Indent the center with a spoon to allow room for cream. Bake at 225 F for 1h and 15 min then turn the oven off and without opening the door, let meringue in the hot oven another 30 min. Outsides will be dry and crisp to the tap and very pale cream-colored and insides will still be marshmallow soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824022900010037	Make The Best Churro Dough	Heat the butter in a medium-sized saucepan. Add in the water, sugar, vanilla, cinnamon and salt. Bring to a simmer occasionally. Add in the flour, stirring with a large wooden spoon until well blended and forms a ball. Take off heat and allow to cool for 10 minutes, or until just warm to the touch. While dough is cooling, heat oil over medium-high heat to 360F (180C). Once dough has cooled, add one egg, quickly beating until completely incorporated (it will look like it's not coming together, but keep beating!). Add in the second egg and repeat the process until a dough forms. Scoop dough into a strong double lined pastry bag with a large open star tip nozzle.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
