1824030200010005	Make the Cheesecake Filling	Beat the cream cheese, 1/4 cup of the sugar, and the salt on medium-low speed until combined, about 1 minute. Beat in the remaining 1 1/4 cup of sugar until combined, about 1 minute. Scrape down the sides of the bowl and the beater. Add the sour cream, lemon juice, and vanilla extract and beat on low speed until combined, 1 minute. Add the egg yolks and beat at medium-low speed until thoroughly combined, 1 minute. Scrape the bowl and beater well. Add the whole eggs two at a time, beating for 30 seconds after each addition.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
