1824030200010014	Process the Jam	Process the jam in a food processor until smooth, about 10 seconds (or, whisk vigorously until the jam is completely smooth). Place the jam in a small saucepan and bring to a simmer over medium-high heat. Simmer, stirring frequently, until the jam is dark and no longer frothy, about 3 minutes. Stir in the lemon juice, then pour over the strawberries and stir to combine. Allow to cool to room temperature, then cover with plastic wrap and refrigerate until cold, at least 2 hours or up to 12 hours (the strawberry topping is best served within 1 day of making it).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010015	Make the Fresh Strawberry Topping	In a large bowl, toss together the sliced strawberries and the sugar. Let sit for 30 minutes, stirring occasionally to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010017	Remove the Sides of the Springform Pan	Remove the sides of the springform pan and allow to sit at room temperature for 30 minutes before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010019	Make the Cheesecake Filling	Beat the cream cheese, 1/4 cup of the sugar, and the salt on medium-low speed until combined, about 1 minute. Beat in the remaining 1 cup of sugar until combined, about 1 minute. Scrape down the sides of the bowl and the beater. Add the sour cream, lemon juice, and vanilla extract and beat on low speed until combined, 1 minute. Add the egg yolks and beat at medium-low speed until thoroughly combined, 1 minute. Scrape the bowl and beater well. Add the whole eggs two at a time, beating for 30 seconds after each addition.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010016	Reduce Oven Temperature	Reduce oven temperature to 200 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010018	Remove the Cake	Remove the cake from the oven and increase the oven temperature to 500 degrees F (leave the rimmed baking sheet on the bottom rack).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010020	Prepare Dough	Mix flour, melted butter and icing sugar in a bowl until you get soft dough.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010025	Cool Tart	Take it out and let cool down completely before removing it from the tin.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010022	Shape Dough	Press this soft dough into the base of your cake tin and up the sides. Pierce the dough several times with a fork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010023	Bake Filling	Return to the oven and bake for a further 3540 minutes or until the filling is set.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010024	Prepare Filling	In a bowl, whisk caster sugar, egg, cream and lemon juice. Carefully pour into the cooled pastry case.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010027	Finish	Dust with icing sugar and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010026	Bake Crust	Bake it blind for 20 minutes at 375F/190C. Take it out & let it cool down. Reduce oven temperature to 300F/150C.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010028	Preheat Oven and Prepare Pan	Preheat the oven to 350F (175C). Line the bottom and sides of a 9-inch (23cm) springform pan with parchment paper and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010029	Cream Butter and Sugar	In a large mixing bowl using an electric mixer fitted with a whisk attachment, cream the butter and 1/2 cup (100g) of superfine sugar on medium-high speed until it is pale and fluffy for about 3 minutes. Add the vanilla and one egg yolk at a time and mix to combine after each egg yolk. Then add the melted chocolate and beat until creamy for about 2 minutes. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015021	The Crust	Prepare either pie crust recipe through step 5, including chilling for at least 2 hours. The pie crust recipe makes 2 crusts and you'll be using both crusts.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015023	Bake the Pie	Bake for 3238 minutes or until the top of the crust is golden brown. After 20 minutes of baking, be sure to cover the edges of the crust with aluminum foil or use a pie crust shield to prevent the edges from getting too brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012015	Make Dough	Add the cauliflower to a dry bowl, and then add the eggs, almond flour, cheese, salt and Italian seasoning. Mix well to combine into a dough.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010032	Serve and Store	Serve with whipped cream. Store in an airtight container at room temperature for up to 3 days.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010037	Whip Egg Whites	In another large mixing bowl, whisk the egg whites and salt with an electric mixer fitted with a whisk attachment on medium-high speed until foamy, about 1 minute. Then add the remaining 1/2 cup (100g) of superfine sugar and mix on high speed until stiff peaks form, about 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010036	Prepare Apricot Filling	Place a mesh strainer over a medium-sized heavy-bottomed saucepan or dutch oven, and press the apricot jam through the mesh strainer into the saucepan. Discard the fruit pulp. Add the rum and cook over medium heat for 2 minutes until hot, smooth, and combined. Then remove from the heat and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010007	Add Greens	top with greens if using, such as fresh herbs, micro greens, etc.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010031	Apply Apricot Filling	Cut a thin layer off the top of your cake to create a flat surface. Then flip the cake upside down and cut it in half horizontally. It's best to place the cake on a cake topper at this point. Spread about 2/3 of the jam all over the bottom cake layer. Place the top cake layer on top and evenly spread the remaining jam all over the top and sides of the cake. The cake should be completely covered in jam. Let dry uncovered at room temperature for 1 hour or until the jam is dry to the touch.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010017	Add Herbs and Toppings	Sprinkle on pinches of desired herbs and spices, and add any toppings you'd like.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010017	Serve	Warm with chipotle mayo sauce for dipping.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500000006	Step 6	Nunc nulla velit, feugiat vitae ex quis, lobortis porta leo lectus in ex.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031600000005	Beat Eggs and Temper	In a large bowl, beat eggs. Gradually add 1/2 the hot milk mixture to the large bowl of beaten eggs and whisk constantly.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010085	Thicken the soup	Stir in the cornstarch mixture and cook for another minute until the soup has thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010235	Prepare Cilantro	Pick the cilantro leaves off the stems.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010246	Make the Caramel	To make the caramel, heat up a claypot on low heat and add the oil and sugar in. Let it brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010017	Cook Bacon and Onion	While the bacon is cooking, finely dice the onion. Add the diced onion to the remaining bacon grease and saut until tender (about 5 minutes).	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030200010035	Apply Chocolate Glaze	All at once and in a circulating movement, pour the chocolate glaze on top of the cake and quickly spread with a long frosting spatula to level and let the glaze run down the sides of the cake to cover the cake completely. Work quickly and with just a few movements. Please use a cake turner for easier handling. Let the glaze dry for 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010009	Add Avocado	add avocado, salt & pepper and desired seasoning (such as my Put it on Everything Seasoning)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010020	Mix Ingredients	Toss all ingredients, except for tortillas, together in a large mixing bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010019	Butter Poached Lobster	In a medium saucepan add the water, stick of butter, and minced parsley. Heat the butter to 160F, keeping it in the 160F-180F range. Remove the lobster meat from the shells by cutting along the top and bottom of the tail. Cook the lobster meat for either 6-7 minutes if completely submerged or 2-3 minutes on each side. Rough chop when cooled.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010110	Adjust Dough Consistency	Gradually stir using a wooding spoon until no dry lumps remain. Adjust the consistency by adding more flour or water as needed; the dough is ready when it doesnt stick to the sides of the bowl or your fingers. Let it rest for about 5 minutes to hydrate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010108	Combine Flour and Salt	In a large bowl, combine arepa flour and salt until thoroughly combined. Make a well in the center and add the melted butter and water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010113	Refrigerate Leftovers	Refrigerate leftovers either plastic wrapped or stored in an airtight container for up to 3 days. You can also freeze cooked empanadas plastic wrapped in a resealable freezer bag or airtight container for up to 3 months. To reheat, unwrap as many empanadas as you want and warm through in a 300F oven or toaster oven for about 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010117	For the Beef Filling	Heat 2 tablespoons of oil in a large skillet over medium heat. Saute the beef, cooking until browned, about 10 minutes. Remove the beef with a slotted spoon and set aside. Reserve 2 tablespoons of drippings. With the remaining 1 tablespoon olive oil and 2 tablespoons of drippings, saut the yellow onion until translucent, 10-15 minutes. Then add the bell peppers, peas, garlic and seasonings. After a few minutes, deglaze the pan with  cup of beef broth, then add 1-2 tablespoons of tomato paste (to preference). Once the tomato paste has dissolved, mix in the beef and potatoes. Remove from heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010118	Combine Ingredients	Combine chicken stock, chicken breast, onion, bay leaves, potatoes, and guascas in a large saucepot or Dutch oven. Add more water if necessary to cover solids by 1-inch. Bring to a boil over high heat. Reduce to a simmer and cook until chicken breast is cooked through, about 10 minutes. Transfer chicken breast to plate and set aside until cooled to room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010122	Prepare Aji	While soup is cooking, make the aji: Combine onion, cilantro, and chile pepper in small serving bowl and add water until just covered. Season generously with salt and stir to combine. Set aside. Discard chicken skin and bones. Shred meat into bite-size pieces and set aside in serving bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010001	Mixing Ingredients	Mix together the chopped tomatoes, garlic clove, olive oil, salt and pepper. Keep in the fridge until needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010010	Add the Beaten Eggs	Return the heat to medium and add the beaten eggs. Add a generous pinch of salt. Shake the pan so the eggs coat everything in the pan. Let this cook until you see the edges of the tortilla begin to set, then put the pan under the broiler.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010086	Drizzle in eggs and season	Stirring the soup in a circular motion, drizzle in the eggs in a thin stream to create egg ribbons. Taste the soup for seasoning and adjust with salt, pepper and vinegar for a more vinegary taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010099	Add Ingredients	Turn the heat to high and add the lemongrass, galangal, kaffir lime leaves, bird's eye chilies, mushroom, nam prik pao and nam prik pao oil to the shrimp stock. Bring it to boil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010238	Pickle Carrots	Mix the sugar, rice wine vinegar, and salt with the hot water until the sugar and salt have dissolved. Pour the mixture over the carrots and let it sit to pickle for 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010251	Cook Garlic and Shallots	Add the remaining garlic and red shallots to cook for 20 seconds, then pour in the coconut water and turn the heat up to high.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010252	Make the dipping sauce	In a large mortar, pound the chopped garlic with the chili. Add the sugar and mash the ingredients to a paste, adding a few drops of the rice vinegar as needed to moisten the mixture. Pound until the sugar is completely dissolved. Stir in the remaining rice vinegar along with the fish sauce and the water and transfer the dipping sauce to a bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010018	Combine Ingredients	Add the drained pasta to the skillet, stir to combine, and remove from the heat. Top the pasta with Parmesan, salt, pepper, crushed red pepper, and crumbled bacon. Stir to combine. Taste and adjust the salt and pepper to your liking.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030200010034	Bake the Cake	Transfer the batter to the prepared pan, spread evenly, and bake for about 50-60 minutes or until a toothpick inserted into the center comes out clean. Remove from the oven and let cool completely.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010006	Add Toppings	add toppings if using, such as egg, crumbled cheese or shiitake bacon, etc.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010024	Prepare Mussels	Rinse and scrub mussels under cold water. Using your fingers or paring knife, remove beards (strings that hang from the mussel shells), and discard. Discard any broken mussels. If any mussels are open and resist being closed, discard them.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010032	Preheat Oven	Preheat your oven to 400F (200C). Place the cod in a baking dish.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010036	Make the Soup	Stir in the clams and let them heat through, about 5 minutes. Remove bay leaf.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010045	Prepare Scallops	Pat the scallops dry on both sides with a paper towel. Season the scallops on both sides with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010109	Fry Arepas	Heat oil in a large cast-iron or non-stick skillet over medium-high heat. Fry the arepas in batches, flipping once, until golden brown in batches, for 5-8 minutes on each side. Drain on a paper towel.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010111	Cool and Serve	Transfer the arepas to a wire rack and let them cool. Split them and stuff them with the desired filling; shredded chicken, pork, guacamole, butter, maple syrup, or enjoy them as they are.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010115	For the Dough	In a medium saucepan over medium heat, add the water and butter, heating until butter has fully melted. Meanwhile, in a large bowl, whisk together flour, salt, and paprika and make a well in the center. Pour a little of the warm butter mixture in and mix with your fingertips to make a wet paste. Pour in remaining liquid, and work the dough with your hands until you get a wet, oily dough. Wrap the dough in plastic and refrigerate for at least 2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010116	To Assemble	Tear off golf-ball sized pieces of the chilled dough and roll into balls. On a lightly floured work surface, use a rolling pin to roll out the balls into 1/4-inch thick, 5-inch diameter circles. Once your dough has been rolled out, place 2 heaping tablespoons of filling in the center of each dough circle. Add  teaspoon scallions to each circle, and sprinkle lightly with cheese, if using. Brush a small amount of egg wash lightly over one half edges border. Fold over the dough to create a half-moon shape and press edges firmly to seal. Crimp edges with the back of a fork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010120	Season and Serve	Season soup to taste with salt and pepper. Serve immediately, passing picked chicken, chopped capers, sour cream, and aji table-side for diners to add to their bowl. Serve avocado slices on the side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010002	Serving	To serve, toast 20 slices of baguette. Spoon a little tomato topping on to each piece of toast. Tear 5-6 slices of jamn serrano into pieces and put one piece on each slice of bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010014	Prepare Spicy Sauce	Meanwhile, add the olive oil to a skillet and heat over medium-low heat. Add the garlic, tomato paste, smoked paprika, cayenne pepper and salt. Stir well and cook for 1 to 2 minutes until fragrant. Add the water and apple cider vinegar, whisk everything until well combined and simmer for 4 to 5 minutes until sauce thickens. Remove from heat and transfer to a bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010088	Gather Ingredients	Gather all ingredients.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010237	Mince Garlic	Mince the garlic.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010019	Cook Pasta	Bring a pot of water to a boil for the pasta. Once boiling, add the pasta and continue to boil until the pasta is tender (7-10 minutes). Reserve about a half cup of the starchy pasta water before draining the pasta in a colander.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030200010033	Make Chocolate Glaze	To make the chocolate glaze, place a large heavy-bottomed saucepan or dutch oven over low heat and fill 2-inch (5cm) high with water. Place a large and waterproof glass bowl on top to completely close the saucepan and make sure that the bowl doesn't touch the water. Place the chocolate and butter in the bowl and slowly melt for about 5 minutes. Stir often with a rubber spatula and remove until the butter is completely melted and you see a few small pieces of chocolate in the glaze. Then remove the bowl from the heat and let rest for 5 minutes until completely melted and smooth. Stir occasionally.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010030	Fold in Egg Whites	Carefully fold the whipped egg whites in 3 additions into the chocolate mixture. Fold only in one direction and with the same repeating movement. Don't overwork, or the cake will turn out flat. Then add the cake flour in 2 additions and fold just to incorporate, and no lumps remain. Take care not to overwork the batter. Otherwise, the batter will deflate, and the cake won't rise as high as necessary. The batter should be light, fluffy, and silky.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015001	Gelatin Mixture	In a very small saucepan sprinkle gelatin over water and let stand about 1 minute to soften. Heat gelatin mixture over low heat until gelatin is dissolved and remove pan from heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015002	Unmolding	Dip ramekins, one at a time, into a bowl of hot water 3 seconds. Run a thin knife around edge of each ramekin and invert ramekin onto center of a small plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015003	Cream Mixture	In a large saucepan bring cream, half and half, and sugar just to a boil over moderately high heat, stirring. Remove pan from heat and stir in gelatin mixture and vanilla. Divide cream mixture among eight 1/2-cup ramekins and cool to room temperature. Chill ramekins, covered, at least 4 hours or overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015005	Prepare Filling	In a large bowl, gently toss together the raspberries, sugar, cornstarch, and lemon juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015006	Assemble Pie	Place one pie crust onto the bottom of the pie plate. Spoon the raspberry filling mixture evenly into the pie and dot with butter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015004	Preheat Oven	Preheat oven to 425F and position a rack on the lowest rung. Butter a 9" pie plate and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015007	Add Top Crust	Cut a few cute shapes out of the 2nd crust and place on top of the pie. Seal and crimp as desired. Make sure to seal well. This will prevent the filling from leaking out. Place on baking sheet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200015008	Bake Pie	Bake at 425F on the lowest rack for 10 minutes, then lower the temperature to 350F and bake for another 40-45 minutes until the crust is golden and the filling is bubbling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015011	Make Potatoes	Place chopped potatoes in a large saucepan, cover with cold water and bring to boil. Cook until potatoes are tender (12-15 minutes), don't overcook potatoes. Drain and mash potatoes in the same pot. Add warm cream and 1/2 tsp salt (or to taste) then mash until smooth. Lastly, mash in the parmesan cheese and beaten egg.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015010	Make the Filling	Preheat oven to 400F with a rack in the center. Heat a large skillet over medium heat. Add 1 Tbsp olive oil and ground beef. Breaking up the beef with a spatula then season with 1 tsp salt and 1/2 tsp black pepper and cook until meat is just cooked through and no longer pink (5 minutes). Add onions and saut for 3 minutes to soften then add minced garlic and stir another minute. Sprinkle with 2 Tbsp flour and stir for 1 minute. Youll see a film form on the bottom of your pan. Stir in red wine, scraping the bottom to deglaze the pan for a minute. Add beef broth, 1 Tbsp tomato paste, and 1 Tbsp Worcestershire. Add 1 1/2 cups of frozen veggies and bring to a light boil. Season with another 1/2 tsp salt and 1/4 tsp pepper or add to taste. Reduce heat to a simmer, cover and cook 10 minutes until sauce is slightly thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015009	Assemble Shepherd's Pie	Transfer meat and veggie mixture to a deep pie dish, or 11x7 or 9x9 casserole dish. Scoop mashed potatoes over the top then spread evenly, making sure to seal the potatoes to the edge of the dish so the filling doesnt bubble up. Drizzle 2 Tbsp melted butter over the top. Place a sheet of foil under the casserole to catch any drips and bake at 400F on the center rack for 25-30 minutes or until potatoes start to turn golden. Cool 15 minutes before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015013	Saut the Steak	Melt 2 tablespoons of the butter in a large saut pan over medium-high heat. Add the steak in a single layer, seasoned with a few generous pinches of salt and pepper, and let it cook undisturbed for about 3 minutes to get a good sear. Flip the steak, and cook on the other side until browned, another 2-3 minutes. Then remove steak from pan with a slotted spoon, transfer to a clean plate, and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015012	Saut the Veggies	Add the remaining 2 tablespoons butter to the saut pan. Once it has melted, add the onions and saut for about 3 minutes. Add mushrooms and saut for an additional 5-7 minutes, stirring occasionally, or until the mushrooms are cooked and the onions are soft. Add the garlic and saut for 1 minute, stirring occasionally. Then add the white wine and deglaze the pan by using your cooking spoon to scrape the brown bits off the bottom of the pan. Let the mixture cook down for an additional 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015014	Finish the Sauce	While the wine cooks down, whisk together the beef stock, Worcestershire sauce and flour until smooth in a separate bowl. Pour the beef stock mixture into the saut pan, stir to combine, then let the mixture simmer for 5 minutes, stirring occasionally. Stir in the Greek yogurt (or sour cream) and cooked steak until combined. Taste and season with additional salt and pepper if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015015	Cook the Noodles	Cook egg noodles in a large stockpot of generously-salted water until they are al dente, according to package instructions, then drain.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015016	Serve	Serve warm over egg noodles, garnished with a sprinkle of parsley and an extra twist of black pepper, if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015017	Preheat Oven	Preheat the oven to 375F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015019	Bake	Place the sheet pan in the preheated oven. Roast until the salmon reaches 120F and the asparagus is tender, 8-12 minutes. Remove the sheet pan from the oven and allow the salmon to rest for 5 minutes before serving. Top the asparagus with fresh lemon juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015018	Prepare Asparagus	Lay the asparagus on a large baking sheet. Drizzle with olive oil and rub to cover the asparagus in the oil. Sprinkle with salt and pepper and spread to an even layer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015020	Prepare Mustard and Maple Syrup Mixture	In a small bowl, mix the Dijon mustard and maple syrup to combine. Nestle the salmon fillets in between the asparagus. Brush the top of the salmon with the prepared mustard and syrup. Sprinkle the brushed salmon with the everything bagel seasoning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015024	Preheat Oven	Preheat oven to 425F (218C).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015027	Cook Chicken and Vegetables	In a large pot, combine chicken, carrots, and celery. Add enough water to cover the chicken and vegetables, then place over medium-high heat. Bring to a boil, then allow to boil for 10 minutes. Remove from heat, drain, and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010011	Prepare Bread	toast or grill bread	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010023	Saut the Onion and Garlic	Meanwhile, heat the remaining 1 tablespoon of olive oil in a large stockpot over medium-high heat. Add the onion and saut for 5 minutes, stirring occasionally. Add the garlic, smoked paprika and crushed red pepper flakes and saut for 2 more minutes, stirring frequently.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010028	Combine Pasta and Pesto	Drain the spaghetti, reserving 1 cup of the pasta cooking water. Place the spaghetti back into the pan you cooked it in, add in the pesto and a good splash of the pasta cooking water. Toss the spaghetti in the sauce over a low heat until the sauce coats the pasta.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010025	Add Mussels	Add mussels and cover.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010107	Form Dough Patties	Grab 3 tablespoons of the dough and form a ball, gently press the dough between your palms to flatten, forming about a -inch thick patty. Pay attention to the edges, so you don't leave cracks. If using cheese, make a little well in the center of the dough ball before flattening. Place flattened dough on greased parchment paper and repeat the process for the remaining dough.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010112	Preheat Oven	Preheat the oven to 400F. Line a large baking sheet with parchment paper or a silicone baking mat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010114	Bake Empanadas	Place empanadas onto the prepared baking sheet. Lightly beat together the egg and water. Brush the empanadas gently with the egg wash. Bake empanadas until golden brown, about 20 minutes. Serve warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010119	Cook Potatoes	Continue to simmer potatoes until russets and papas Criollas are completely tender and falling apart, about 45 minutes longer, adding more water as necessary. Discard onion and bay leaves. Using whisk, mash potato pieces against side of pot and stir vigorously to thicken soup. The soup should be thick, with large chunks of potatoes still remaining.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010121	Add Corn and Thicken Soup	Add corn cobs and continue to cook, stirring occasionally, until corn is cooked and soup is thickened to the consistency of thick heavy cream, about 15 minutes longer. Remove from heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010003	Prepare Fruits	Dice the apple, orange, and lemon into small pieces. Make sure to leave the peels on and toss them into the pitcher along with the orange juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010091	Serve	Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010092	Cook Noodles	Cook noodles according to package instructions, just until tender. Rinse under cold water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010098	Simmer Stock	Simmer and let the stock reduce to 2 1/2 cups. Drain the shrimp stock and discard the shrimp heads and shells.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010241	Prepare Carrot	Peel the carrot and chop it into matchstick pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010020	Mix in flour and baking soda	Measure the flour over a scale or by fluffing it up with a fork, then shaking it over the measuring cup and leveling the cup. Add it and the baking soda to the mixture and use a rubber spatula to mix until no traces of dry flour can be seen.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030300015022	Assemble the Pie	After the pie dough has chilled, roll out one of the discs of chilled dough into a 9-inch pie dish. Spoon the chicken and vegetable mixture into the crust. Scatter the frozen peas on top. Pour/spread the gravy evenly over top. Roll out second half of pie crust dough just as you did the first. Cover the pie with the second crust and trim the extra overhang off the sides. Crimp the pie crust with a fork to seal the edges. With a small sharp knife, slice a few small slits in the top crust to allow steam to escape. Brush crust and edges with egg wash.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015028	Add Spices and Tomato Paste	Add the chili powder, cumin, dried oregano, garlic powder, salt, pepper, tomato paste and water. Stir to combine and continue cooking over medium-low heat until the sauce has thickened, about 3-5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015030	Serve Tacos	Serve warm over tortillas with lettuce, tomatoes, cheese and red onions, or your other desired toppings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010010	Final Seasoning	finish with another pinch of salt & pepper and/or a squeeze of fresh lemon or a drizzle of avocado or olive oil	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010026	Steam Mussels	Steam until all mussels are open, about 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010031	Apply Compound Butter	Spread the compound butter mixture on top of each filet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010125	Cook the Beef	Once ready to cook, heat oil in a wok over medium high heat until wisps of smoke are visible. Remove the beef from the marinade using a slotted spoon, reserving any remaining marinade. Add the beef to the hot wok and sear until deeply browned, about 1 minute. Remove the beef using a slotted spoon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010004	Mix Ingredients	Pour the wine, brandy and any sweetener into the pitcher. Then stir everything together until it's all combined. Refrigerate for at least 4 hours, or overnight. The longer it sits, the more time the flavors can meld together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010009	Broil to Brown the Top	Cook it under the broiler for 5 minutes, or until the top browns. If you prefer to finish the tortilla on the stovetop instead of the broiler, slide the tortilla out of the pan onto a plate. Then invert the pan over the plate, and flip the whole thing, pan and plate so that the tortilla falls back into the pan, less-cooked side down.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010015	Bake Potatoes	Place the potatoes on a baking sheet and drizzle them with the olive oil, salt and paprika then transfer the baking sheet to the oven and bake for 30 to 35 minutes until golden and crispy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010021	Chilling The Mixture	Transfer the mixture to an 8x8-inch baking tray and spread it out so that it is even. Let the mixture cool, then cover it with plastic wrap and refrigerate at least 2 hours or overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010090	Warm Half-And-Half	Warm half-and-half in a small saucepan until it bubbles; remove from the heat just before it boils. Mix into chowder.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010096	Scramble Eggs	Push everything to the side of the pan. Add a little more oil and add the beaten eggs. Scramble the eggs, breaking them into small pieces with a spatula as they cook.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010255	Plate and Serve	Slide the bnh xo onto a plate. Serve with lettuce leaves, mint, and the Sweet and Spicy Vietnamese Dipping Sauce. Repeat with the remaining ingredients, serving the bnh xo as soon as they are cooked.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010021	Preheat the oven and prepare the sugar topping	Preheat the oven to 350F and line two greased cookie sheets with parchment paper. Stir together  cup granulated sugar and 1 teaspoon pumpkin pie spice. If using the sugar topping, roll the cookie dough balls in the sugar, coating all over.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030300015025	Make the Gravy	In a large skillet over medium heat, combine the butter, onions, and garlic. Stirring occasionally, cook until the onions are translucent and the butter is lightly browning. Whisk in the flour, salt, black pepper, thyme, chicken broth, and half-and-half. Cook and whisk until no flour lumps remain, then simmer over medium-low heat until thick.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015029	Cook Ground Beef	Heat the olive oil in skillet over medium high heat. Add the ground beef and cook until browned, about 5-7 minutes. Drain any fat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015031	Preheat Oven And Prepare Dish	Preheat the oven to 350 degrees F. Butter a 2-quart casserole dish.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015032	Bake Macaroni And Cheese	Transfer the macaroni and cheese to the prepared baking dish and top with the buttered breadcrumbs. Bake until the dish bubbles around the edges, about 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015033	Prepare Topping	In a small bowl, stir the breadcrumbs with the butter until the crumbs are moistened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015034	Cook Macaroni	Bring 4 quarts of water to a boil in a large saucepan. Add the salt and macaroni. Bring the water back to a boil and cook the macaroni until tender, about 12 minutes. Drain well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015035	Make Cheese Sauce	Meanwhile, melt the butter in a 1-quart saucepan. Using a wire whisk, stir in the flour and salt, stirring and cooking over medium heat until the roux bubbles and the flour turns pale brown, about 3 minutes. Slowly whisk in 1 cup of the milk and then whisk in the remaining 1 cup milk. Continue to cook, stirring constantly, until the sauce thickens. Add the cheese and stir until it melts. Add the drained macaroni to the cheese sauce and mix thoroughly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015037	Prepare Turkey	Take the giblets out of the turkey and wash the turkey inside and out. Remove any excess fat and leftover pinfeathers and pat the outside dry. Place the turkey in a large roasting pan. Liberally salt and pepper the inside of the turkey cavity. Stuff the cavity with the thyme, lemon, onion, quartered, and the garlic. Brush the outside of the turkey with the butter and sprinkle with salt and pepper. Tie the legs together with string and tuck the wing tips under the body of the turkey.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015036	Roast Turkey	Roast the turkey for 2 1/2 hours, basting from time to time with pan juices, until the juices run clear when you cut between the leg and the thigh. Remove the turkey to a cutting board and cover with foil; let it rest for 20 minutes. Slice the turkey and serve hot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015038	Preheat Oven	Preheat the oven to 350 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015039	Preheat Oven and Mix Ingredients	Heat oven to 350F. In large bowl, mix Meatloaf ingredients well. Press mixture in ungreased 8x4-inch loaf pan. Bake 40 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015040	Add Topping and Finish Baking	Remove from oven. Spread 1/4 cup ketchup evenly over top. Bake an additional 15 to 20 minutes or until meat thermometer inserted in center of loaf reads 160F. Let stand 10 minutes before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015041	Brown the Beef	Heat the oil in a large pot or Dutch oven to medium heat. Season the beef with salt and pepper, then sear the beef in batches to brown them, a few minutes per side. Set the beef aside onto a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015042	Soak the Peppers	Soak the softened peppers in very hot water for 20 minutes in a heat proof bowl, or until they are nice and soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015046	Add Garlic and Spices	Add the garlic and stir. Cook another minute. Pour in the reserved chili sauce and the seasonings, and stir. Cook for 5 minutes, stirring a bit, to let the flavor develop.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015044	Process Soaked Peppers	Add the softened peppers to a food processor with 1/2 cup of the soaking water (or use fresh water) and a bit of salt to taste. Process until smooth. Strain if desired. Set aside for now.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015045	Make Chili Sauce	Remove the stems and seeds from the dried guajillo and ancho peppers, then lightly toast in a dry pan about a minute or 2 per side. This will help to release the oils.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015047	Combine and Simmer	Stir in the remaining beef broth (or tomato sauce) and reserved beef. Bring to a boil. If you'd prefer a soupier chili, add in 4 cups of beef broth. If you are using the optional additions/beans, add them in now. Reduce the heat, cover and simmer for about 2 hours, or until the beef is very tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015043	Cook Jalapenos and Onion	Add the jalapenos and onion. Cook them for 6-7 minutes to soften.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015048	Preheat And Cook Rice	Preheat the broiler. Cook the rice as the label directs. Meanwhile, toss the cauliflower with 2 tablespoons vegetable oil and a generous pinch each of salt and pepper; spread on a rimmed baking sheet. Broil, stirring occasionally, until lightly charred and tender, about 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015049	Toast Peanuts	Heat the remaining 1 tablespoon vegetable oil in a large nonstick skillet over high heat. Add the peanuts and cook, stirring, until lightly toasted, about 1 minute. Remove to a small bowl with a slotted spoon and season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015050	Finish And Serve	Fluff the rice with a fork; top each serving with the stir-fry, toasted peanuts and cilantro.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015051	Cook Vegetables	Add the snow peas, bell pepper and ginger to the skillet. Cook, stirring occasionally, until crisp-tender, 1 to 2 minutes. Add the scallions (white and green parts) and cauliflower; toss. Add the chili sauce and soy sauce and continue to cook, stirring often, until the vegetables are glazed, about 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015056	Combine and Simmer	Add the roasted vegetables, cabbage, 1/4 cup red wine vinegar, and 1/4 cup packed light brown sugar to the pot and stir to combine. Simmer until the cabbage is tender and everything is bright red, about 15 minutes. Discard the bay leaves. Taste and season with more kosher salt as needed. Top the servings with the dill, sour cream, and horseradish mixture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015053	Cook Onion and Tomato Paste	Reduce the heat to medium. Add the onion and cook, scraping up the brown bits from the bottom of the pot with a wooden spoon, until golden brown and translucent, about 5 minutes. Add 1 (6-ounce) can tomato paste and cook, stirring occasionally, until the tomato paste is slightly darkened, 2 to 4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015063	Boil Water for Pierogi	Bring a large pot of heavily salted water to a boil over high.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015122	Serve	Serve in individual bowls. Garnish with chopped parsley and optional crushed red pepper (red pepper flakes) and serve immediately with fresh French bread on the side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015064	Combine Potatoes, Onions, and Cheese	Transfer the cooked potatoes to a colander to drain, then transfer to the medium bowl with the onions. Add the cheese, stir to combine, season generously with salt and pepper, then let cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015057	Simmer Beef	Return the beef and any accumulated juices to the pot. Add 2 (32-ounce) cartons low-sodium vegetable or chicken broth and 2 dried bay leaves. Scrape the bottom of the pot to loosen any browned bits, increase heat to high, and bring to a boil. Reduce the heat to maintain a simmer. Simmer until the beef is tender, about 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015052	Prepare Beef	Arrange a rack in the middle of the oven and heat the oven to 400F. Halve and thinly slice 1 large yellow onion. Trim off any large pieces of fat from 1 pound boneless beef chuck roast, then cut into rough 1-inch pieces. Season the beef with 1 teaspoon of the kosher salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015054	Brown Beef	Heat 1 tablespoon of the olive oil in a large pot or Dutch oven over medium-high heat until shimmering. Add the beef in a single layer and sear until browned all over, 2 to 3 minutes per side. Transfer to a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015059	Cook Onions	While potatoes cook, melt butter over medium-high, add onions, season with salt and pepper, and cook, stirring occasionally, until golden-brown and softened, about 12 minutes. Set aside about 1 cup of onions for garnish and add the rest to a medium bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015062	Prepare the Dough	Prepare the dough: Add the flour and salt to a large bowl; whisk to combine. In a small saucepan, heat  cup water and the butter over medium-high until butter is melted, about 3 minutes. Pour the buttery liquid into the flour gradually, stirring it in as you add it. (The dough will be quite crumbly and flaky at this point, like a biscuit dough.) Stir in the egg until combined then move the dough to a lightly floured surface and knead until smooth, 5 to 7 minutes. Cover the dough with a dampened towel or plastic wrap and let rest at room temperature for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031200010008	Add Nuts or Seeds	add nuts or seeds if using	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010021	Pure	Using a handheld immersion blender, pure the soup until it reaches your desired texture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010027	Make Pesto	While the pasta is cooking, make the pesto by adding basil leaves, garlic, pine nuts, Parmesan cheese, black pepper, and Maldon salt to a food processor and pulse for about 10 seconds to break up the garlic and pine nuts. Then pour in the olive oil in a steady stream and check for consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010022	Add Wine	Add the wine and bring to a boil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010123	Cook the Onion	Turn the heat down to medium and add the onion. Sear until slightly softened, tossing into the marinade left in the wok. Add the tomatoes and toss, cooking until soft. Add the steak and any remaining marinade back to the wok.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010005	Serve	Serve this in individual glasses over ice. Then top with sparkling water if you'd like!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010020	Making Aioli	Meanwhile, make the aioli by pureeing the mayonnaise, garlic, lemon juice, and smoked pimentn in a blender or mini food processor. Transfer to a small bowl and refrigerate until ready to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010089	Cook Potatoes and Onion	Add potatoes and onion to the pot; cook, stirring occasionally, for 5 minutes. Add corn, water, salt, and pepper; bring to a boil. Reduce the heat to low, cover, and simmer, stirring frequently, until potatoes are tender, about 20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010097	Stir Fry	Heat 1 tablespoons of oil in a large saucepan or wok over medium-high heat. Add the shrimp, chicken or tofu, garlic and bell pepper. The shrimp will cook quickly, about 1-2 minutes on each side, or until pink. If using chicken, cook until just cooked through, about 3-4 minutes, flipping only once.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010259	Simmer the Broth	Add in water until it just covers the meat. Bring to a boil, and scoop away any impurities that you see. Add pork hocks, 1 onion, 1 daikon, and 2 stalks of lemongrass. Simmer for 2-3 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010270	Saut Chicken Breast	Once the marinating time for the chicken breast is over, place a saut pan over medium heat. Heat 1 tablespoon red annatto oil, then add  of the pounded Vietnamese pearl onions and cook for a few seconds until fragrant. Add the chicken breasts and saut until the outside is no longer pink. Add  cup water into the pan and braise for about 10 minutes until the meat firms up and absorbs the seasonings. Transfer the meat along with any cooking juice to a clean bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010264	Boil Chicken Bones	Bring a large pot with water to a boil, then add the chicken bones and parboil for 1-2 minutes. Discard the liquid and give the bones a quick rinse. Clean the pot. Add 5 cups of water to the pot, bring to a simmer then add the chicken bones, ginger and 1 teaspoon salt. Let it come to a boil, then skim off the foam and return to a simmer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010024	Chill the dough	Leave the dough uncovered and set it in the fridge for at least half an hour but up to a full hour.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030300015055	Prepare Cabbage and Toppings	Prepare the cabbage and toppings while the vegetables are roasting: Cut the core from 1/2 small red cabbage, then thinly slice (about 3 cups). Coarsely chop the leaves and tender stems from 1/2 medium bunch fresh dill. Dice 1/2 medium English cucumber if desired. Add 1 tablespoon prepared horseradish and 1/2 teaspoon kosher salt to 1 (8-ounce) container sour cream and stir to combine if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015058	Roast Vegetables	Meanwhile, peel and cut 1 1/4 pounds loose red beets into 3/4-inch pieces (about 3 1/2 cups). Peel and dice 3 medium carrots (about 1 1/2 cups). Peel and dice 1 large russet potato (about 1 1/2 cups). Place on a rimmed baking sheet. Drizzle with the remaining 1 tablespoon olive oil and season with the remaining 1 teaspoon kosher salt. Toss to combine and spread into an even layer. Roast until crisp-tender and browned in spots, about 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015060	Prepare the Filling	Peel and cube potatoes, add to a large pot, sprinkle with salt and cover with cold water. Bring to a boil and simmer until tender. Peel the potatoes and cut into cubes. Add them to a large pot, sprinkle with salt and cover with cold water by about 2 inches. Bring to a boil over high and continue to cook at a simmer until potatoes are tender, about 25 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015061	Assemble the Pierogi	Working with one disk at a time, spoon a scant tablespoon of filling onto the middle of it. Fold the dough in half to enclose the filling, bringing the edges together to form a crescent shape. Pinch the edges together, then work your way down on both sides, pinching the dough over the filling and pushing in the filling as needed, making sure the potato mixture does not break the seal. If needed, you can dip your fingertip into water and moisten the dough as needed to help the two sides adhere together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015066	Seal and Transfer to Baking Sheet	To form a rustic pattern on the curved seal, pinch the rounded rim underneath using your pointer finger and middle finger and press an indentation on top with your thumb, working your way along the rounded rim. Transfer to the prepared baking sheet. (If youve gotten some filling on your fingers, dip your fingertips into the bowl of water then dry them off on the towel.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015067	Repeat	Repeat with remaining disks, then repeat the entire process with the remaining portion of dough. Youll want to work fairly quickly, as the pierogi can be harder to seal if they start to dry out. (If cooking the pierogi at a later point, transfer them on the baking sheet to the freezer until frozen solid, then transfer the pierogi to a resealable bag and freeze.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010012	Prepare Pita	Brush on a little olive oil on the pita.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010030	Cook Pasta	Add the dried spaghetti to a large pan of salted boiling water and cook for 10-13 minutes to your liking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010023	Cooking Preparation	In a large stockpot set over medium heat, melt the butter. Once it's hot, add shallots, garlic, and salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010037	Make the Soup	Bring the soup to a gentle boil, then reduce to a simmer, so that its just gently bubbling. Simmer for 20 minutes, partially covered. Stir occasionally as it cooks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010040	Serve	Ladle soup into serving bowls and garnish with roughly chopped parsley, freshly cracked pepper, and chopped bacon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010124	Marinate the Beef	Season the beef with salt and pepper. In a bowl, whisk together the soy sauce, vinegar, aji amarillo paste, lime juice, grated garlic, and 2 tablespoons of parsley. Once mixed, add the sirloin and massage into the beef until well coated. Marinate while preparing the other ingredients, or up to 8 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010006	Fry the Potato Slices in Batches	Pour the olive oil into a cast-iron or hard anodized aluminum pan and heat it over medium-high heat. When it is hot enough to sizzle the potatoes as soon as they hit the oil, test this with an end piece. Start frying them in one layer. Work in batches, fry until they are lightly browned, not crispy. When they are done, let the potatoes dry on a paper towel and salt them well. Keep frying until they are all cooked.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010013	Boil Potatoes	Place the potatoes in a large saucepan and cover with enough cold water to cover by 1 inch along with  teaspoon of salt. Bring to a boil over high heat and cook the potatoes for 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010018	Forming Croquetas	When ready to cook the croquetas, lightly beat the eggs in a shallow dish. Mix the breadcrumbs and  teaspoon salt in another dish. Scoop up tablespoons of the cooled filling and form them into balls. Dip each ball into the egg and then the breadcrumbs. Place the completed croquetas on a wire rack or baking sheet and refrigerate for 20 minutes. The croquetas must be chilled before frying otherwise they may fall apart in the oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010100	Prepare Shrimp	Peel the shell and head off the shrimp, keep the tails on. Save the shell and shrimp head. Devein the shrimp and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010258	Make the Sate Chili	Combine 1/4 cup of vegetable oil and 2 tsp of annatto seeds in a small sauce pan. Cook for 1-2 minutes until the oil turns red. Discard the seeds and add the rest of the ingredients for the sate chili to the pan. Cook for 1-2 more minutes and remove from the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010267	Marinate Chicken	Toss the chicken breast strips with  teaspoon turmeric powder, 2 teaspoons fish sauce,  teaspoon black pepper and  tablespoon red annatto oil. Set aside to marinate for 20-30 minutes. Toss the chopped thighs and drumsticks with the remaining turmeric powder, 4 teaspoons fish sauce,  teaspoon black pepper and 1 tablespoon red annatto oil. Set aside to marinate for 45-60 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010025	Prepare the butter	Set the butter in a small frying pan over medium-low heat. Once the butter has melted, raise the heat to medium. Cook, stirring often, as the butter sputters and the milk solids separate. With a rubber spatula, scrape the edges of the pan to ensure even browning. Once the milk solids turn brown and the butter is almost done foaming, immediately remove it from the heat into a heat-safe bowl.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031200010031	Preheat Oven and Prepare Baking Dish	Preheat oven to 425F. Spray a 13-inch by 9-inch baking dish with nonstick cooking spray.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015065	Prepare the Wrappers	Cut the dough into two even pieces. (Youll want to leave one piece under the towel to stay moist while you work with the other piece.) Youll also want a small bowl of flour, a small bowl of water and a towel handy for keeping your hands clean. Dust some flour onto a baking sheet (for holding the pierogi) and your work surface, then roll out one portion of dough until -inch thick. Using a 3-inch cookie cutter or inverted glass, punch 12 to 15 disks of dough. (Save and refrigerate the scraps to boil as a rustic pasta, in soup or another use.)	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015068	Cook Pierogi	To cook the pierogi, add a single layer of pierogi to the pot of boiling water. Let them cook until they rise to the surface, about 2 minutes, then cook another 2 to 3 minutes until puffy. (With frozen dumplings, you will need to increase the cooking time by a couple of minutes.) Use a slotted spoon to transfer cooked dumplings to a colander to drain, then boil remaining dumplings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010034	Add Toppings and Bake Uncovered	Spread mozzarella over the top and sprinkle with breadcrumbs and Parmesan cheese. Bake uncovered for 10-15 more minutes (or until cheese is melted, top is golden brown, pasta is tender, and chicken is cooked through).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010035	Uncover and Stir	Uncover and give the pasta a good stir. At this point the pasta will still be firm and there will still be quite a bit of liquid in the dish. That's fine!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010040	Combine with Other Ingredients	Stir shredded cheese, red onions, green onions, chopped pickles, and ranch dressing into the buffalo chicken mixture. Taste, add a pinch of salt and pepper if you want, and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010046	Prepare Dressing	Now get started on your dressing by whisking\ntogether all ingredients (except for the olive oil)\nin a medium-sized bowl with a fork or whisk.\nOnce mixed, slowly whisk in the olive oil last,\nuntil dressing is creamy and well combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010029	Add Lemon Slices	Lay the lemon slices both on top and under the cod filets.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010126	Add Fries and Serve	Add the fries to the wok and toss to coat in sauce. Once vegetables are softened and fries are warm, remove from the heat. Serve over rice. Top with parsley and a squeeze of lime.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010007	Saut the Onions, Arrange the Fried Potato Slices on Top	When the potatoes are all done, pour off all but a tablespoon of the oil and saut the onions. When the onions are just starting to crisp, turn off the heat. Arrange the onions so they are evenly covering the bottom of the pan. Arrange the potatoes on top of the onions in a scalloped pattern.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010105	Add Chicken	Stir in the chicken. Continue simmering, stirring periodically, until chicken is cooked through, about 10 to 12 minutes more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010256	Assemble the Bowls	Now it's time to assemble your bowls of soup! Grab a handful of cooked noodles and put them in a bowl. Top it with some of the beef slices, a piece of the pork hock, cilantro, green onions, bean sprouts, cha lua, and a small teaspoon of shrimp paste (optional). Add some soup over these yummy ingredients and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010268	Prepare Chicken	If using a whole chicken, separate into chicken bones, boneless breasts and bone-in thighs and drumsticks. Slice the breasts into strips and use the poultry shears to cut thighs and drumsticks into smaller pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010274	Cook Catfish	Uncover, turn the heat back to high then add the catfish and bring back to a boil. Reduce the heat and simmer uncovered for another 10 minutes or so, until the fish is tender. Periodically, skim off any scum or impurities.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010023	Whisk in sugars and egg yolk	Pour in both sugars and whisk for about 30-45 seconds, until the sugar and butter start to become cohesive. Add the egg yolk and whisk for a full 60 seconds. Add the pumpkin butter and whisk to combine.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030300015069	(alt) Pan Fried Method	If you want to pan-fry your pierogi, working in batches, melt 1 to 2 tablespoons of butter in a large skillet over medium-high until crackling. Add a few boiled pierogi in a single layer to avoid overcrowding, and cook until crisp and golden, 1 to 2 minutes per side. Repeat with remaining pierogi, adding butter as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015070	Serve	Serve hot. Top with any browned butter from the pan, warmed reserved onions, sour cream and herbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015071	Preheat Oven	Preheat oven to 180C/350F (160C fan), though you can use your slow cooker or stove instead (oven easiest! Note 4).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015073	Season Beef	Toss the beef with half the salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015072	Add Potato	The beef should be pretty tender but not quite "fall-apart". Stir in carrot and potatoes. Return to oven, covered, for another 30 minutes. Beef should now be "fall-apart" - if not, return to the oven for 10 minutes at a time.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015074	Serve	Ladle goulash into bowls and sprinkle with parsley. Eat as is, with optional bread for dunking! (Pictured with cheese bread)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015076	Slow Cook	Add beef stock, stir, bring to simmer. Cover with a lid and transfer to the oven for 1 1/2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015075	Add Vegetables	Add garlic, capsicum and tomato. Stir for 3 minutes - the tomato will mostly breakdown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015077	Add Paprika, Caraway and Bay Leaf	Stir for 30 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015078	Cook Beef	Add the beef and stir until the outside changes from red to brown, about 2 minutes. It won't go golden brown, it's not supposed to.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015079	Cook Onion	Heat the oil and melt the butter in a large oven-proof dutch oven over high heat. Cook onion for 6 minutes until the edges are light golden.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015080	Prepare Baking Soda Mixture	Mix the cold water and baking soda together until it dissolves a little bit.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015082	Serve	Once cooked, serve with hot with fresh lapinja bread, chopped raw onion and ajvar spread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015083	Combine Meat Mixture	Place the beef mince in a large mixing bowl along with the garlic, parsley, sweet paprika, salt and pepper. Mix by hand until roughly combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015084	Mix Baking Soda into Meat	Add the baking soda mixture into the meat mix and massage together for a good 5 minutes until it's all combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015085	Shape Sausages	Take a small handful of the mixture and first roll it into a ball, then into a small sausage shape. Pat each end to flatten and pop it on the plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015151	Make Presentable	Gently lift the skillet away and re-arrange any stubborn apples that have gotten jostled out of place. Scrape any remaining caramel sauce from the pan and drizzle over the tarte.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015081	Cook Sausages	Fire up your grill or heat the vegetable oil in a large cast iron skillet or frying pan on medium heat. Cook the cevapi for a few minutes per side until browned. Tip: Slice one in half to test if they're cooked in the middle. A slight pink is okay for beef sausages.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015086	Prepare Cooking Pot	Coat the bottom of the cooking pot with lard. Chop leftover and bottom cabbage leaves and spread them on the bottom of the pot to prevent burning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015088	Cooking	Reduce heat and cook for at least 2-2.5 hours, adding more water if necessary.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015090	Assemble Rolls in Pot	Arrange the cabbage rolls tightly next to each other in the pot. Add dried meat if using and cover with additional cabbage leaves. Add water to cover the rolls and bring to a boil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015087	Make Roux	In a small saucepan, melt lard and whisk in flour until golden. Turn off heat and stir in sweet and hot paprika powder. Add to the sarma and simmer for about 10 minutes. Serve with homemade bread or mashed potatoes.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015089	Prepare Cabbage Leaves	Carefully separate the fermented cabbage leaves. Depending on how small or big cabbage rolls you want to make, you will need about 15-20 cabbage leaves + some extra shredded leaves to cover the bottom of the cooking pot. If the cabbage is very sour and/or salty, wash the leaves briefly under cold water. After that, if you notice that cabbage leaves have pronounced hardy veins, remove them with a sharp knife. Repeat this step with all the leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015092	Add the chicken broth, place chicken on onions, cover and cook	Add the chicken broth, again scraping up the browned bits from the bottom of the pan, and then nestle the chicken pieces into the pan, on top of the onions. Cover and cook on a low simmer for 20 to 25 minutes (depending on the size of your chicken pieces). When the chicken is cooked through to 165F (use a digital thermometer), remove the pan from the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015091	Prepare Meat Stuffing	Mince the onion and garlic and add to a bowl with ground meat, rice, eggs, bread crumbs, salt, black pepper, and sweet and hot paprika powder. Mix everything well using your hand. Take a piece of the meat stuffing, place it on the bottom part of the cabbage leaf, and wrap it tightly in a roll. Repeat this with the rest of the stuffing and cabbage leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015094	Slice the onions	Slice the onions lengthwise (top to root).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015095	Add the paprika and black pepper	Add the paprika and black pepper to the onions and stir to combine. Let cook for a minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015097	Remove the chicken, stir in sour cream	When the chicken is done to your taste, remove the chicken from the pan. Allow the pan to cool for a minute and then slowly stir in the sour cream and add salt to taste. If the sour cream cools the sauce too much, turn the heat back on just enough to warm it through. Add the chicken back to the pan and coat with the sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015093	Salt the chicken pieces	Sprinkle the chicken well with salt and set aside at room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015099	Saut the onions	Add the sliced onions to the saut pan and cook them, stirring occasionally, scraping up the browned bits from the chicken, until lightly browned, about 7 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015096	Serve	Serve with dumplings, rice, egg noodles or potatoes. If cooking gluten-free, serve with rice, potatoes or gluten-free noodles or dumplings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015152	Start Caramel Sauce	Melt the butter in the skillet over medium to medium-high heat, then stir in the sugar. It will be grainy and clumpy at first, then start to dissolve into a syrupy liquid.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015149	Cool Tarte Tatin	Set the tarte on a cooling rack and cool for 10-20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015145	Bake Tarte Tatin	Bake the tarte Tatin for 20 to 25 minutes, until the crust is golden brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015098	Brown the chicken pieces	Heat a large saut pan over medium-high heat and melt the butter. When the butter is hot, pat the chicken pieces dry with paper towels and place them skin-side down in the pan. Let the chicken pieces cook 4 to 5 minutes on one side, until well browned, then turn them over and let them cook 2 to 3 minutes on the other side. Remove the chicken from the pan to a bowl, set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015101	Cook Sausage	Add white kielbasa (uncut, whole links) as well and continue cooking for 30-40 minutes, until the stock becomes meaty in aroma and flavour (you'll have to test that empirically).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015102	Cook Bacon and Onion	Chop bacon and onion into small cubes. Using a frying pan, fry up the bacon first. There is no need to add any additional frying fat, bacon will release plenty of its own. Once the bacon fat has rendered, add the onion pieces and continue frying until both ingredients turn golden.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015103	Add Carrots and Parsley Root	Peel carrots and parsley roots, drop them whole into the stock.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015100	Prepare Stock	Get a cooking pot. Pour in the stock and start heating it up (on a medium heat).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015106	Serve	Have a taste. Does it need any more salt or a pinch of pepper? If so, add some to taste. Garnish with fresh marjoram or chopped parsley and serve with boiled egg halves.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015107	Combine Ingredients	Move the contents of the frying pan into the pot with cooking stock. If your 'zakwas' starter was fermented without spices (that is: bay leaves, all-spice berries and peppercorns), it's a good moment to add them directly into the soup. I place them inside a mesh spice bag/stock sachet, so that I don't have to struggle fishing them out later.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015105	Add Sour Rye Flour Starter	Now it's time to add 'zakwas' starter. Add 1/3 cup (80ml) of zakwas for a mild urek, up to 2 cups (or more; roughly 500ml) for a more sour result. If you're not sure how much you should add, just pour it over gradually, tasting along the way.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015109	Thicken Soup	There are two ways to do it: Mix the contents of the jar/bottle, so that the liquid part blends with the floury part, or Start by adding the liquid only, topping with the meaty floury part later on - spoonful by spoonful, until you reach the desired thickness. That's how I do it.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015104	Remove Spices	The next step would be to remove the spices. If you used the spice bag, just take it out. Otherwise, you can fish them out manually with a spoon, or get rid of them using a sieve - and return the soup into the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015110	Add Marjoram and Garlic	Add 1 tablespoon of dried marjoram and one garlic clove (crushed or roughly chopped), cook for another 4-5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015111	Prepare Eggs	If you haven't boiled the eggs already, now is a good moment to do so. Once cooked, allow them to cool down.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015108	Add Whipping Cream	Adding cream is optional, but it balances the flavours very nicely. Place 3 tablespoons of whipping cream into a cup or a small bowl. Add in a tablespoon of urek, mix well with a fork. And another spoonful of soup and mix again. Repeat with 2 more tablespoons of urek. Pour the mixture into the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015113	Add Cornmeal	Pour in the cornmeal 1/4 cup at a time, stirring it in before each addition. This ensures the mamaliga will be free of clumps.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015114	Cook Mamaliga	Once all the cornmeal has been stirred in, turn heat down to medium-low and cover with a lid. Simmer for 20 minutes, stirring frequently to prevent the bottom from sticking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015112	Simmer Water	Bring water to just before it starts to simmer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015117	Preheat Oven	Preheat the oven to 250 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015120	Cook Mushrooms	Mash 1 tablespoon of butter and the flour together and stir into the stew. Add the frozen onions. In a medium sauce pan, cook the remaining butter and mushrooms over medium-low heat for 5 to 10 minutes, until browned. Add to the stew. Bring the stew to a simmer and cook for another 10 minutes. Season to taste. Serve hot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015118	Brown Chicken	Lay the chicken out on paper towels and pat dry. Sprinkle the chicken on both sides with salt and pepper. When the bacon is removed, brown the chicken pieces in batches in a single layer for about 5 minutes, until evenly browned. Remove the chicken to the plate with the bacon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015115	Cook Vegetables	Add the carrots, onions, 2 teaspoons salt, and 1 teaspoon pepper to the pan and cook over medium heat for 10 to 12 minutes, until the onions are lightly browned. Add the garlic and cook for 1 more minute. Add the Cognac and put the bacon, chicken, and any juices that collected on the plate into the pot. Add the wine, chicken stock, and thyme and bring to a simmer. Cover the pot with a tight fitting lid and place in the oven for 30 to 40 minutes, until the chicken is just not pink. Remove from the oven and place on top of the stove.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015116	Cook Bacon	Heat the olive oil in a large Dutch oven. Add the bacon and cook over medium heat for 8 to 10 minutes, until lightly browned. Remove the bacon to a plate with a slotted spoon and continue to brown until all the chicken is done. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300015126	Prepare Seafood Mix	Prepare and clean 2 1/2 lb seafood mix as necessary.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015119	Simmer Stew	Add the red wine, chicken stock, and thyme and bring to a simmer. Cover the pot with a tight fitting lid and place in the oven for 30 to 40 minutes, until the chicken is just not pink. Remove from the oven and place on top of the stove.	a525810e-5531-4f97-95a4-39a082f7416b	t	1
1824030300015123	Cook the Stew	In a large pot, heat 3 Tbsp extra virgin olive oil on medium heat. Add 6 cloves garlic (minced) and all the prepared vegetables (the onion, shallot, fennel, celery, and carrot). Saut on low heat until lightly golden brown, about 20 minutes. Add the seasonings: 1 1/2 Tbsp tomato paste, 2 tsp Diamond Crystal kosher salt, 1 tsp basil, 2 Tbsp parsley, and freshly ground black pepper. Mix well. Now, add all the liquids: 1 can diced tomatoes with juice, 2 cups clam juice, the juice from 1 jar oysters, and the saffron-infused sherry. Bring it to a boil, then lower the heat and simmer for 15 minutes. Add all the seafood. When the soup starts to boil, skim off the scum and foam from the soup. Simmer for 15 minutes. Skimming is very important to have a clear soup with a refined taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015121	Prepare Saffron Mixture	In a small bowl, combine 1/2 tsp saffron and 1/4 cup dry sherry. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015124	Gather Ingredients	Gather all the ingredients.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015125	Prepare Vegetables and Fish	Dice 1 onion and mince 1 shallot. Thinly slice the fennel so you have 1 cup fennel bulb. Mince 1 rib celery and dice 1 carrot. Next, cut 1 lb white fish into bite-sized pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010049	Bake	Bake for about 40 minutes until phyllo is golden.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015127	Cook Vegetables	Heat 1/4 cup olive oil in a medium saucepan over medium heat until shimmering, about 1 minute. Add the bell peppers, onion and 1 teaspoon salt and cook, stirring often, until the onions are translucent and the bell peppers have softened slightly, about 10 minutes. Add the eggplant, the remaining 2 tablespoons olive oil and 1 teaspoon salt. Cook, stirring often, until the eggplant is very soft, about 8 minutes. Add the zucchini and continue to cook, stirring often, until beginning to soften, about 5 minutes. Add the garlic, tomato paste and red pepper flakes, if using. Cook, stirring often, until the zucchini has softened, about 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015128	Simmer Ratatouille	Stir in the tomatoes, bring to a simmer and then reduce the heat to low and cover the pot. Simmer, stirring occasionally, until the ratatouille has reached a thick stew-like consistency, about 10 minutes. Stir in the parsley and basil with salt and pepper to taste. Spoon into a bowl and sprinkle with more fresh parsley and basil before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015129	Season and Brown the Duck	Preheat your oven to 325F (160C). Season the duck with salt and pepper and brown the whole duck in a large cast-iron skillet on all sides, about 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015131	Prepare Orange Sauce	Boil the vinegar, orange juice, and honey in a small saucepan. Pour in the chicken stock little by little, stirring constantly. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015133	Finalize Orange Sauce	Bring it to a simmer in the saucepan, add in cornstarch, then swirl in the butter one tablespoon at a time until thickened. Adjust seasoning to your liking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015130	Serve	To serve, carve the duck, slice duck breasts, and arrange on a serving platter with roasted veggies and garnished with fresh thyme, rosemary, and bay leaves. Transfer the orange sauce to a serving vessel. Serve the roasted duck  l'orange immediately. Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015132	Finish Roasting Duck	When the duck is done after 90 minutes, remove it from the oven and cover it with foil. Increase the oven temperature to 450F (230C) and arrange the marinated orange slices around the duck, sprinkle with orange zest. Return the duck to the oven and roast for 10  15 minutes, until the skin is crisped up.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015135	Blanch Orange Slices	Blanch the orange slices in boiling water for 2 minutes, then transfer to a salad bowl. Pour Grand Marnier over the orange slices and marinate while the duck is roasting.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015134	Arrange Vegetables and Roast	Arrange garlic heads, onion, carrots, herbs in the bottom of a baking pan and arrange browned duck on top. Roast duck in the oven for 90 minutes, turning it upside down every 30 minutes to roast the meat evenly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015136	Marinate the Onion Slices	Place onion slices in a small bowl and sprinkle with 3 tablespoons of the vinaigrette. (The onions soaking in the vinaigrette will help take some of the bite out of them.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015139	Drizzle Everything with the Remaining Vinaigrette	Drizzle everything with the remaining vinaigrette. Sprinkle with capers if using. Serve immediately. Should be served slightly warm or at room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015140	Make the Vinaigrette	In a jar, place the oil, lemon juice or vinegar, shallots, herbs, and mustard. Cover with a lid and shake until well blended. Add salt and pepper to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015138	Cook the Potatoes	Cook potatoes in a large pot, cover with 2 inches of water. Add 1 tablespoon of salt. Heat on high to bring to a boil. Lower the heat to maintain a simmer. Place for 10 to 12 minutes or until the potatoes are fork tender. Drain. While the potatoes are still warm, cut them into halves or quarters, depending on the size of the potatoes. Place them in a bowl and dress them with about 1/4 cup of the vinaigrette.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015141	Arrange the Salad on a Serving Platter	Arrange a bed of lettuce on the lettuce. If using tuna steaks, cut them into 1/2-inch thick slices. Mound tuna in the center of lettuce. Sprinkle the tomatoes and onions around a bed of tuna. Arrange the potatoes and green beans in mounds at the edge of the lettuce. Arrange hard boiled eggs, olives, and anchovies (if using) in mounds on the lettuce bed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015137	Boil the Green Beans	While the potatoes are still cooking, fill a medium sized pot halfway with water, and add 2 teaspoons of salt. Bring to a boil on high heat. Add the green beans to the boiling water. Cook until tender but firm to the bite, about 3 to 5 minutes (more or less, depending on the toughness of the beans). Drain and either rinse with cold water to stop the cooking, or shock for half a minute in ice water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015143	Bchamel Sauce	Melt butter in a medium saucepan over medium heat. Whisk in flour and cook, stirring constantly, for about 3 minutes. Gradually add milk, stirring well until the mixture is smooth. Cook, stirring, until sauce is thickened. Season with a little bit of salt and pepper. Remove from heat and whisk in mustard and nutmeg. Set aside while you make the sandwiches, or make the sauce up to 1 week in advance.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015144	Assemble Sandwiches	Preheat oven to 425 F. Line a baking tray with parchment paper and set aside. Spread each bread slice with a layer of bchamel, spreading it all the way to the edges. Place 4 slices of bread, bchamel side up, on prepared baking sheet. Top each with a piece of ham, a handful of gruyere, and a sprinkle of parmesan cheese. Place remaining slices of bread on top, bchamel side up, then top with remaining gruyere and parmesan cheese.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015142	Bake	Bake at 425 degrees F for about 5-6 minutes, until cheese is melted, and then turn the oven to broil and broil until the cheese on top is lightly golden, 2-4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015147	Add Apples to Sauce	When the sugar and butter are bubbling, add the apples and sprinkle with salt. No need to be fancy with how you arrange the apples now.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015146	Invert Tarte Tatin	Run a knife around the edge of the pie crust to separate it from the pan. Shake the skillet a few times to loosen the apples in the caramel sauce. Place the pie plate over the top of the skillet. Using oven mitts, grip the plate and the skillet and swiftly turn them both over so the pie plate is on the bottom and the skillet is on top.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015153	Caramelize Apples	Cook the apples, stirring every few minutes, until the sauce darkens to a deep amber caramel color. This should take 12 to 15 minutes. Be sure to turn the apples as you stir them so they are coated with the caramel sauce. A good indication of when the caramel sauce is done is if a drip holds its shape on a cool plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015148	Preheat Oven	Heat the oven to 375F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010033	Combine Ingredients	In the prepared baking dish (or in a separate large bowl), stir together uncooked pasta, marinara sauce, water, salt, pepper, and raw chicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010022	Bake the cookies	Bake the cookies for 10-12 minutes, until lightly golden on the edges and cracked all over.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030300015154	Top with Pie Crust	Remove the pan of apples from the heat. With a fork and a spatula, turn the apples so their rounded surfaces are against the bottom of the pan and arrange them in concentric circles. Remove the pie crust from the refrigerator and drape it over the hot apples. Be careful not to touch the hot caramel sauce! Tuck the edges of the pie crust into the pan and prick with a fork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015150	Serve Warm	Serve the tarte Tatin while it's still warm, topped with ice cream or a dollop of crme frache. Leftover tarte can be kept refrigerated for several days (and make an excellent breakfast).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015155	Prepare Apples	Peel and core the apples. Peel the apples, slice them into quarters, and remove the core. Roll out the pie crust to a little larger than 10 inches on a piece of wax paper and keep chilled in the refrigerator while you cook the apples.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015158	Serve	Place a dried slice of bread into each plate or bowl large enough to hold it, then pour over with the soup.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015156	Add Flour	When nearly sauted, sprinkle with flour, and stir a couple of times to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015159	Cook with Liquid	Pour in the water or the consomm, then cook for 25 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015157	Saut Onions	Finely slice the onions and then saut them in butter until they are softened but translucent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015163	Deglaze Pot	Add the white wine to deglaze the pot, scraping any brown bits from the bottom.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015161	Preheat Oven	Preheat your oven to 325F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015164	Garnish and Serve	Garnish with parsley and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015162	Finish the Cassoulet	Return the protein to the pot and add beans, herbs, water and seasoning. Bring to a simmer then cover and transfer to the oven to bake for 2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015160	Saute Veggies	Add onion, carrot, and leeks to the pot in the residual sausage fat and cook until tender, about 4 minutes. Then add the shallots and garlic and saute for an additional minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015165	Cook the Chicken	Add the chicken breasts to the Dutch oven next, season with salt and pepper, and cook until the chicken is no longer pink and cooked through. Remove and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015166	Brown the Sausage	In a dutch oven or heavy bottomed sauce pan, brown the sausages whole. I prefer a smaller bite so I dice them up in pieces. Remove once browned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015170	Pre-Bake Crust	Preheat oven to 450F. Line tart shell with aluminum foil and fill to top with pie weights or dried beans. Bake until crust is set, about 10 minutes. Remove foil and weights and bake shell for about 8 minutes longer, until crust is golden and crisp. Transfer crust to a rack to cool slightly, about 10 minutes. Reduce oven temperature to 375F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015169	Prepare Filling	Meanwhile, cook bacon in a large skillet over medium heat, stirring occasionally, until browned and crisp, about 8 minutes. Transfer bacon to a paper towel-lined plate to drain. Crumble bacon into pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015168	Roll Out Dough	Roll out dough on a lightly floured work surface with a lightly floured rolling pin into a 11-inch round about 1/8 inch thick. Ease dough into a 9-inch fluted tart pan with a removable bottom. Trim overhang so it is flush with rim of tart pan. Refrigerate crust until firm, about 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015167	Make the Crust	Whisk flour with salt in a medium bowl. Using your fingertips, blend in butter and shortening until they resemble small peas. Sprinkle water on top and mix until dough begins to come together; add another tablespoon or 2 of ice water as needed. Turn dough out onto a work surface and gently knead 2 or 3 times, just until it comes together. Divide dough in half and pat each half into a 1-inch-thick disk, wrap in plastic and refrigerate until firm, about 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300015171	Make the Filling	Whisk eggs with heavy cream, salt, pepper, and nutmeg in a medium bowl until well blended. Scatter half of the cheese in an even layer on bottom of crust and top with bacon. Pour custard on top, then top with remaining cheese. Bake quiche on middle rack of oven until custard is set and quiche is nicely browned on top, about 35 minutes. Transfer quiche to a rack and let cool for 15 minutes. Unmold quiche and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012001	Refrigerate	Refrigerate until ready to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012002	Prepare Dressing	Whisk together the lemon juice, olive oil, garlic, cumin, chili powder, and turmeric in a small bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012003	Combine and Dress	Drizzle over the mixture and toss.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012004	Combine Salad Ingredients	Mix together the beans, quinoa, corn, bell pepper, mango, onion, cilantro, and jalapeo in a mixing bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012006	Make Pesto	Combine the basil and garlic in a food processor and pulse until coarsely chopped. Slowly add the olive oil in a constant stream while the food processor is on. Stop the machine and scrape down the sides of the food processor with a rubber spatula. Add the lemon juice and Parmesan cheese. Pulse until blended. Season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012007	Combine and Serve	Combine the zucchini noodles and pesto. Toss until zucchini noodles are well coated. Top with tomatoes, if using. Serve at room temperature or chilled.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012005	Prepare Zucchini	Use a julienne peeler or mandoline to slice the zucchini into noodles. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012008	Optional Cooking	If you want to cook the zucchini noodles, you can. Just add the zucchini pesto noodles to a skillet and saut them up over medium heat. It only takes a few minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012009	Cook Soup	Add the vegetable broth, butternut squash, apple, nutmeg, cinnamon, thyme, rosemary, salt, pepper, and nutmeg, if using. Place the lid securely on the Instant Pot and move the knob to seal. Cook on high pressure for 10 minutes and do a quick release of the pressure.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012011	Serve	Ladle the soup into bowls and serve warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012012	Blend Soup	Use an Immersion blender in the Instant Pot to puree the soup until smooth. If you don't have an immersion blender, you can let the soup cool a little and carefully transfer the soup to a regular blender and blend until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012010	Saut Ingredients	On your Instant Pot, select Saut. Add the olive oil and saut the onion, carrot, celery, and garlic until soft, about 3 to 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012014	Drain Cauliflower	Allow to cool, and then pour the cauliflower into a large, clean dish towel. Pull the edges of the towel together, and squeeze the cauliflower to drain out excess liquid. Twist the towel and squeeze until you've removed about 1 cup of liquid or more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012013	Microwave Cauliflower	Add riced cauliflower (about 8 cups) to a large microwave-safe bowl. Microwave for about 5 minutes, until the cauliflower is hot all the way through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012017	Preheat Oven	Preheat the oven to 425F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012018	Marinade Preparation	Whisk oyster sauce, sherry, sesame oil, soy sauce, sugar, and cornstarch together in a bowl; stir until sugar has dissolved.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012019	Cook Broccoli	Heat vegetable oil in a wok or large skillet over medium-high heat. Add ginger and garlic; let sizzle for about 1 minute to flavor oil, then remove and discard. Stir in broccoli. Toss and stir until bright green and almost tender, 5 to 7 minutes. Remove broccoli from the wok and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012021	Marinate Beef	Place steak in a shallow bowl. Pour oyster sauce mixture over meat and stir to coat; cover and marinate in the refrigerator for at least 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012020	Cook Beef	Add a little more oil to the wok, if needed, then add beef with marinade. Stir and toss until sauce thickens and turns shiny and meat is no longer pink, about 5 minutes. Return broccoli to the wok; stir until heated through, about 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012023	Preheat and Prepare Oven	While the loaf is proofing, pre-heat the oven to 480 F (250 C) with a cast iron skillet on the middle rack or a Dutch oven/combo cooker on the lower middle rack. If using a skillet, place a baking tray on the bottom rack of the oven.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012024	Combine Dry Ingredients	In a large bowl, mix together the buckwheat flour, potato starch, brown rice flour and salt, until evenly combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012026	Prepare Psyllium Gel	In a separate bowl, mix together the psyllium husk and 240 g (1 cup) water. After about 15  30 seconds, a gel will form.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012027	Mix Yeast and Sugar with Water	In a small bowl, mix together the yeast, sugar and 150 g (1/2 cup + 2 tbsp) warm water. Set aside for 10  15 minutes, or until the mixture starts frothing.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012025	Cool the Loaf	Transfer the loaf onto a wire cooling rack to cool completely.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012028	First Proofing	Transfer the bread to a lightly oiled surface and knead it gently, forming it into a smooth ball. Place the dough into a lightly oiled bowl, seam side down, cover with a damp tea towel and allow to rise in a warm place for about 1 hour or until doubled in size.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012030	Add Wet Ingredients to Dry	Add the yeast mixture, psyllium gel and apple cider vinegar to the dry ingredients. Knead the dough until smooth and it starts coming away from the bowl, about 5  10 minutes. You can knead by hand or using a stand mixer with a dough hook.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012031	Second Proofing	Place the dough into a 7 inch round proofing basket that youve dusted with some brown rice flour with the seams facing upwards. Cover with a damp tea towel and proof in a warm place for about 1 hour or until doubled in size.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010008	Make Filling	Whiz the carrot mixture in a food processor to a puree. Add the eggs and sour cream, and whiz to combine. Pour into pastry shell and bake for 40 minutes or until filling is set. Cool completely.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010007	Prepare Salsa Verde	For the salsa verde, finely chop reserved carrot tops, then combine with all remaining ingredients in a bowl and season.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030300012022	Score and Bake	Once the dough has doubled in size, turn it out of the bread basket onto a piece of baking paper and score the top with a pattern of choice. Take the hot cast iron skillet or Dutch oven/combo cooker out of the oven and then transfer the bread along with the baking paper into it. Bake at 480 F (250 C) with steam for 20 minutes. Then reduce the oven temperature to 450 F (230 C), and bake for a further 40 - 50 minutes in a steam-free environment. The final loaf should be of a deep, dark brown color. If the loaf starts browning too quickly, cover with a piece of aluminium foil, shiny side up, and continue baking until done.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030300012029	Shape the Loaf	Once risen, turn the dough out onto a lightly floured surface, and knead it gently while forming it into a tight ball. Flip it seam side down onto a part of the work surface that isnt covered in flour and rotate in place to seal the seams.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010003	Season and Cook Flathead	Season the flathead on both sides with salt, then sprinkle with the spice mix, reserving 2 tsp to serve. Heat 1 tbsp oil in a large frypan over high heat until shimmering. In 2 batches, cook flathead, skin-side down, for 3-4 minutes until crisp, then turn and cook for a further 2-3 minutes until cooked through. Repeat with remaining fillets and oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010001	Cook Onion and Spices	Heat 1 tbsp oil in a large frypan over medium heat. Cook onion, stirring, for 2-3 minutes until soft and translucent. Add the garlic and cumin, and cook for 30 seconds or until fragrant. Add lemon juice, chickpeas and 1/2 cup (125ml) water. Season. Bring to a gentle simmer, then stir in broad beans and tomato. Remove from heat, set aside and keep warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010002	Serve	Divide the broad bean mixture among serving plates and top with a flathead. Sprinkle with reserved spice mix to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010010	Prepare Carrots	Reserve 2 baby carrots to garnish. Cut off tops from remaining baby carrots and wash and reserve, then chop flesh into 3cm pieces. Place in a microwave bowl with regular carrots, then cover with plastic wrap and microwave on high for 10 minutes or until slightly tender. Drain liquid, then place carrots on a baking tray. Drizzle with 2 tbs oil, scatter with caraway seeds and season. Roast for 40 minutes or until caramelised and tender. Cool. Reduce oven to 160C.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010012	Cook Eggs in Sauce	Use your large spoon to make small wells in the sauce and crack the eggs into each well. Cook the eggs for 5 to 8 minutes, or until the eggs are done to your liking. You can also cover the pan with a lid to expedite the eggs cooking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010016	Cook Bell Pepper and Onion	Heat olive oil in a large saut pan on medium heat. Add the chopped bell pepper and onion and cook for 5 minutes or until the onion becomes translucent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010051	Prepare Feta	Grate half of the feta and crumble the rest.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010055	Serve	Serve with your favorite Mediterranean food like falafel or gyros.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010060	Prepare Grape Leaves	Take grape leaves out of the jar, and rinse well. Remove stems. Set torn leaves aside to line the pan later.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010066	Add Spices and Beans	Add the minced garlic, paprika, salt, pepper, chili flakes, bay leaf and rinsed beans. Stir and cook until fragrant, about 1-2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010036	Transfer and Bake	Transfer the mixture to the prepared baking dish. Cover tightly with aluminum foil. Bake the covered dish for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010004	Prepare Spice Mix	Place the pepper, fennel seeds, sumac, and lime peel in a spice grinder and grind to a fine powder.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010006	Prepare Pastry	Grease a 18cm x 25cm fluted tart pan. Lightly dust a work surface with flour. Roll out pastry until 3mm thick, then use to line pan. Freeze for 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010009	Garnish and Serve	Using a vegetable peeler, thinly slice reserved 2 baby carrots and place in a bowl of iced water. Drain just before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010005	Bake Pastry	Preheat oven to 200C. Line pastry with baking paper and fill with pastry weights or rice. Bake for 25 minutes or until just dry. Remove the weights and paper, and bake for a further 10 minutes or until golden and dry. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010011	Serve	To serve, spread tart with labneh and scatter with dukkah, snow pea tendrils, salsa verde and thinly shaved carrots.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010015	Add Garlic and Spices	Add garlic and spices and cook an additional minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010014	Garnish and Serve	Garnish with chopped cilantro and parsley before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010013	Add Tomatoes and Simmer	Pour the can of tomatoes and juice into the pan and break down the tomatoes using a large spoon. Season with salt and pepper and bring the sauce to a simmer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010017	Brown Beef	Add the ground beef and cook until the beef is browned, breaking it up with a spatula as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010018	Prepare Peppers	Cut the bell peppers in half lengthwise and remove seeds and membrane. Drizzle with a little olive oil and rub both the inside and outside to coat them. Arrange them upside down in two baking pans or one half sheet pan and pre-bake for about 15 minutes, while you're making the stuffing.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010021	Cook Aromatics	In a large skillet over medium high heat, drizzle two tablespoons of olive oil and saute the garlic and onions for one minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010019	Preheat Oven	Preheat your oven to 350F (175C).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010020	Garnish and Serve	Top with fresh parsley and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010023	Combine Ingredients	Drain off any excess liquid from the beef and stir in the diced tomatoes, rice, spinach, Italian seasoning, salt, and pepper. Stir for a minute or two, or until the spinach is wilted.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030400010022	Stuff Peppers	Remove the bell peppers from the oven and use tongs to flip them over. Fill the peppers with the beef mixture and top with a sprinkle of cheese. Place them back in the oven and bake for 20 minutes, or until the peppers are soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010025	Frying Eggplant	Warm olive oil in a skillet over high heat. Fry eggplant until browned, 2 to 3 minutes per side. Drain on paper towels; set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010024	Preparation of Eggplant	Lay eggplant slices on paper towels; sprinkle lightly with salt. Let sit for 30 minutes to draw out moisture, then pat dry with paper towels.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010026	Cooking Ground Beef Mixture	Melt 1 tablespoon butter in a large skillet over medium heat. Stir in ground beef, onions, and garlic; season with salt and black pepper. Cook and stir until beef is browned, 8 to 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010027	Add Herbs	Add parsley, fines herbs, cinnamon, and 1/4 teaspoon nutmeg. Pour in tomato sauce and wine; mix well. Simmer for 20 minutes. Allow to cool, then stir in beaten egg.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010028	Scald Milk	Scald milk in a saucepan over medium heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010029	Make White Sauce	melt 1/2 cup butter in a large skillet over medium heat. Whisk flour into butter until smooth. Lower heat; gradually pour in scalded milk, whisking constantly until it thickens. Season bchamel sauce with salt and white pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010030	Preheat Oven	Preheat the oven to 350 degrees F (175 degrees C). Grease a 9x13-inch baking dish.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010031	Arrange in Pan	Arrange a single layer of eggplant in the prepared baking dish. Cover eggplant with meat sauce, then sprinkle 1/2 cup Parmesan cheese on top. Cover with remaining eggplant and sprinkle another 1/2 cup cheese on top. Pour bchamel sauce on top and sprinkle with remaining 1/4 teaspoon nutmeg. Cover with remaining cheese.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010032	Bake and Serve	Bake in the preheated oven until bubbly and browned, about 1 hour. Serve hot and enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010033	Prepare the Cucumber for Tzatziki Sauce	Spread cucumber slices out on a paper towel. Sprinkle generously with salt on both sides and allow to rest for 5 minutes. Wrap cucumber slices in paper towels, squeeze excess liquid out, and transfer to a food processor or blender. Add remaining sauce ingredients to blender and pulse until smooth and creamy. Chill until ready to use.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010034	Garnish and Serve	Garnish with chopped oregano and serve immediately with prepared tzatziki sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010035	Marinate the Steak	Chop steak into 1-inch pieces and set aside. Combine oil, garlic, oregano, salt, pepper, and lemon juice and stir to combine. Combine steak and marinade in a large zip lock bag, press as much as the air out as you can, and seal. Chill for 1 hour or up to 24 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010036	Cook the Kebabs	When ready to cook your kebabs, thread the steak pieces onto skewers and discard marinade. Grill over medium-high heat for 10-12 minutes, rotating throughout to ensure even cooking. Alternatively, you can bake them in a large baking dish arranged in a single layer at 400 degrees for 30-40 minutes until cooked through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010037	Heat Pan	Heat a medium pan with one tablespoon olive oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010042	Add Spinach Mixture	Spread the spinach mixture evenly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010040	Saut Spinach With Onion	Saut spinach with onion for a few minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010038	Add Spinach	Add the spinach (make sure you have squeezed out the water).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010041	Preheat Oven	Preheat oven at 350 degrees Fahrenheit (180 Celsius).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010044	Cool and Cut	Remove from oven and let the pita cool. Cut in pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010046	Add Herbs, Nutmeg, and Sugar	Add the herbs, nutmeg and sugar and saut for 2-3 minutes more. Set aside and let it cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010043	Cover With Phyllo Sheets	Cover with 6 more phyllo sheets brushing each one with olive oil. Cut the phyllo hanging over the pan or roll in.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010039	Saut Onions	Saut the onions until soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010048	Mix Egg and Feta	In a small bowl beat the egg and add the feta.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010045	Score The Top	Score the top with a knife (do not cut all the way through, just through the top phyllo sheets) for about 10-12 pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010047	Combine Egg Mixture With Spinach	Add the egg mixture to the spinach and add the other tablespoon of olive oil. Mix so that all the ingredients are blended.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010054	Remove Water From Yogurt/Sour Cream (Optional)	Place a fine mesh strainer on top of a smaller bowl to catch the water as it drains. Put a coffee filter on top of the strainer. Mix 1 cup Greek yogurt and 1/4 cup sour cream together. Carefully scoop it onto the coffee filter/strainer and place it in the fridge overnight or for at least 4 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010061	Prepare Cooking Pot	Line a large pan with grape leaves. Put dolmas on top, close to each other. Add water to barely cover dolmas. Add a pinch of salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010064	Cook Onion	Add butter and vegetable oil to a medium pan over medium high heat. When butter is melted add onion and cook, stirring, until translucent and just starting to brown, about 3 minutes. Let cool slightly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010032	Garnish and Serve	Garnish with fresh herbs, if desired. Serve!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010038	Assemble Wraps	Place about one cup of the chicken mixture onto each tortilla, spreading it over the top of the romaine lettuce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010037	Prepare Chicken Mixture	Shred rotisserie chicken in a mixing bowl. In a separate small bowl, stir the melted butter, buffalo sauce, garlic powder, and a pinch of cracked black pepper together until well combined. Drizzle the buffalo sauce mixture over the chicken, then toss the chicken to coat it completely in the buffalo mixture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010047	Assemble Salad	Assemble the rest of your salad ingredients\n(leafy greens, chopped fresh herbs, crumbled\nfeta, shredded chicken) and set aside. Once\ncarrots and pumpkin seeds are done cooking, set\naside for a minute to let cool, then add all\ningredients together to a large bowl and toss, or\nserve separately in two large bowls (or 4 small\nside servings).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010028	Make Compound Butter	In a small bowl, mix together the butter, olive oil, minced garlic, parsley, paprika, salt, and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010129	Prepare Corn Pudding	In a blender, combine the corn, condensed milk, evaporated milk, oil, egg, baking powder, salt, pepper and cayenne; blend until most of the kernels are liquified. Stir in the mozzarella with a spatula.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010008	Slice the Potatoes	Slice the potatoes (peeled or unpeeled) into disks between 1/4 and 1/8 inch wide. It helps to use a mandoline for this purpose.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010012	Preheat Oven	Preheat the oven to 375F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010103	Cook Chicken and Potatoes	Bring to simmer. Cook until potatoes and carrots are barely tender, stirring periodically, about 12 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010261	Finish the Broth	After 15 minutes of simmering, add the sate chili to the broth and stir. Taste the soup and see if it has enough flavor. If not, add more fish sauce until it tastes just right. Turn off the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010271	Dry Roast Shallots	Place a skillet over medium heat and dry roast the shallots until lightly charred and yield to the touch. Add the shallots to the stock pot, then cover and simmer for about 1 hour or up to 1.5 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010273	Saut Aromatics	In a 4 quart or medium-sized pot, heat up a tablespoon of oil over medium heat. Add minced garlic, sliced Thai chilis and lemongrass. Saut for about 10-20 seconds, just until the garlic begins to change color.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010027	Add spices and let cool	Add the pumpkin spice, salt, and vanilla to the butter and gently stir. Let the butter cool for about 5 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030500010052	Prepare Phyllo	Brush a pan that is about 10 X 15 inches with olive oil. Place a sheet of phyllo in the pan and brush with olive oil. Repeat with 5 more phyllo sheets.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010050	Serve	Enjoy at room temperature or if you want the phyllo crunchy, warm in the oven before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010053	Assemble the Tzatziki	When you're ready to make the sauce: squeeze out all excess water from cucumber by pushing it out while in the colander. Then get some thick paper towels, put cucumber in them and ring it out. Put yogurt & sour cream mixture in a clean, dry mixing bowl. Add all ingredients except cucumber. Once combined, stir in the cucumber and chill in the refrigerator for at least one hour to let flavors blend.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010056	Mix Water from Cucumber	De-seed and grate your cucumber. Put it in a colander over a bowl and sprinkle with salt. Let it sit on the counter for at least 2 hours, occasionally pushing out the excess water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010059	Combine Ingredients	In a large bowl, combine beef, cooked onion, rice, chopped herbs, cumin, salt, and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010058	Cook Dolmas	Place an inverted plate or a smaller lid on top of the dolmas to prevent them from floating and unwrapping. Bring to a boil, then immediately reduce heat to a gentle simmer for 60-75 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010062	Cook Rice	To partially cook rice, add rice and 2/3 cups of water to a small pan. Bring to a boil and let simmer 3-4 minutes. Transfer to a sieve and rinse.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010057	Rest and Serve	Remove from heat and let stand for 15-30 minutes. Serve dolmas with homemade Tzatziki sauce and enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010063	Assemble Dolmas	On a clean working surface, place a grape leaf shiny side down. Put about 2 tablespoons of the beef/rice mixture in the middle of the leaf, closer to the stem. Fold the bottom part of the leaf, covering the filling. Then fold two sides over and roll the leaf up. Repeat with all the remaining leaves and filling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010065	Saut Vegetables	To a medium-large soup pot add the olive oil and heat to medium-high. Once the pot is warm, turn to medium heat. Add the diced onion, diced celery and diced carrots. Cook stirring occasionally for 8-10 minutes until the veggies are softened and have developed some colour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010068	Garnish and Serve	Serve the soup garnished with crumbled feta cheese and fresh parsley if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010067	Simmer Soup	Add in the tomato paste, vegetable stock paste and water, stirring to make sure everything is combined. Bring the soup to a simmer over high heat and then turn to medium-low. Keep the soup at a simmer with the lid most of the way on, leaving a bit of room for the steam to escape and cook for 30 minutes. Stir a couple of times during cooking. Taste and adjust seasoning with more salt and pepper if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010071	Roast	Roast in the center rack of the oven for about 3 3/4 to 4 1/2 hours or until the meat is tender and falls apart easily at the touch of a fork. You can check partway through and add more broth or water, if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010072	Serve	Pull the meat apart using two forks to shred. Serve the lamb in bowls over the vegetables!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010074	Preheat The Oven	Preheat the oven to 375F and position a rack in the middle.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010069	Brown	Uncover the meat and vegetables and fold excess parchment paper into the inside of the pan. If using, add the feta cheese at this point. Raise the heat to 425F and return the pan to the oven (uncovered) for a few more minutes until the lamb and vegetables gain some color (about 15 to 20 minutes).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010076	Let Rest	Once ready, allow the lamb klefitiko to sit for about 20 to 30 minutes before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010075	Prepare The Roasting Pan	Line a large roasting pan with two large pieces of parchment paper, making a cross shape to have long pieces of parchment overhang on all sides of the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010083	Layer Phyllo and Butter	Brush a 9x13-inch pan with melted butter and place one layer of phyllo at the bottom. Brush the phyllo with the melted butter, and then add another layer of phyllo, and brush with more butter. Continue this process until you have layered 7 sheets of phyllo.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010073	Season And Marinate The Lamb	Place the boneless leg of lamb in a large bowl. Using a sharp knife, make a few slits in the boneless leg of lamb. Rub the lamb all over with 2 tablespoons dried oregano and  tablespoon each dried thyme and dried parsley. Season well with kosher salt and black pepper on all sides. Then rub with the mustard and the majority of the garlic (reserving 1 tablespoon of the garlic for the vegetables). Its important to push some of the garlic and seasoning into the slits youve cut earlier for best flavor. Transfer the lamb to a large bowl and add the lemon juice, red wine vinegar, white wine and about  cup of extra virgin olive oil, turning the lamb in the bowl to make sure it is well coated. Set the lamb aside for a few minutes while working on the vegetables. (But if you do have the time, cover the bowl and refrigerate for a couple hours or up to one night).	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030500010070	Assemble The Vegetables And Lamb In The Pan	Spread the potatoes, bell peppers, tomatoes, and onions in the bottom of the pan over the parchment. Season with salt, pepper, and the remaining oregano, thyme, and parsley. Drizzle with a little olive oil. Add the lamb on top of the vegetables and pour the broth in from the side of the pan. Fold the parchment to cover the lamb and vegetables.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030500010078	Assemble Pita	To assemble, fill warm pita bread with chicken, tomato, cucumber, lettuce, pickled red onion, and feta cheese. Top with tzatziki sauce. Fold the pita over like a sandwich and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010079	Preheat Grill	Preheat the grill to a medium-high heat. You can also use a grill pan. Brush the grill or grill pan with olive oil to make sure the chicken doesnt stick.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010080	Grill Chicken	Use tongs to remove the chicken from the marinade, place on the hot grill. Discard remaining marinade. Grill the chicken for 3 to 5 minutes on each side, until golden brown and cooked through, time will depend on how thick the chicken is. Transfer the grilled chicken to a cutting board and let rest for 5 minutes. Use a sharp knife to cut the chicken into bite-size pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010081	Refrigerate	Place in the refrigerator and let marinate for 30 minutes or up to 4 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010082	Make the Baklava	Preheat oven to 350 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010085	Cut and Bake	Using a sharp knife, trim any ragged pieces of phyllo dough that has crept up the sides of the pan. Cut the baklava into 12 even squares, and then cut into triangles (you should have 24 triangles). Place the pan in the oven and bake until golden brown, about 50 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010077	Marinate Chicken	Place the chicken in a Ziploc bag or medium bowl. Set aside. In a medium bowl, combine the Greek Yogurt, garlic, olive oil, lemon zest, fresh lemon juice, red wine vinegar, oregano, paprika, salt, and pepper. Whisk until smooth. Pour the marinade over the chicken and stir to coat. If you are using a bag, add the marinade to the bag and seal it tight, removing as much air as possible. Move the chicken around, making sure it is well coated. Seal the bag tightly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010090	Prepare Vegetables	Rinse and prepare all of the vegetables accordingly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010039	Warm Tortillas	Warm tortillas for 20 seconds in the microwave. Place tortillas on a flat surface. Divide romaine lettuce between the tortillas, forming a line of romaine down the center of each tortilla.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010041	Finalize and Serve	Top with microgreens (if using), and roll the tortillas up burrito style to form two wraps. Cut each wrap in half and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010034	Make the Soup	Stir in the chicken bouillon and add the bay leaf. Add the juice from the canned clams to the soup, but don't add the clams yet. Stir in the additional (8 oz.) clam juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010041	Make the Soup	Add the chicken broth in small splashes, stirring continuously, and wiping the pan "clean" again as you do so. Add the half and half in the same manner.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010046	Finish and Serve	Return the scallops to the pan. Spoon the sauce over the top. Garnish with herbs and lemon wedges, then serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010127	Cook Onion and Spices	Add the onion and cook, occasionally stirring, until softened and translucent, about 5 minutes. Season with another pinch of salt. Add the garlic, paprika and cumin, and cook, constantly stirring, until fragrant, about 1 minute. Stir in the olives and raisins; season with salt and pepper to taste. Add 1/2 cup of water and scrape up any bits from the bottom of the skillet. Bring to a simmer and taste again. Adjust seasoning with salt and pepper as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010132	Serve	To serve, serve over rice, sprinkle with cilantro or scallions and a squeeze of lime.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010011	Remove the Pan and Set it to Cool	Cut into wedges to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010017	Dry Potatoes	Drain the potatoes and add back to the saucepan. Place the saucepan over medium heat and sprinkle  teaspoon of salt over them. Cook the potatoes for 5 minutes while stirring constantly until potatoes fluff up and dry.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010104	Combine Ingredients	Stir in the full-fat can light coconut milk, potatoes, carrots, fish sauce, peanut butter, and salt. If needed, use a whisk to blend everything together until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010260	Season the Broth	Add 2 tsp of salt, 2 tbsp of fish sauce, 1 tbsp of sugar, and 1 can of chicken broth to the soup. Simmer the soup for another 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010263	Season Broth	The broth should also be ready by now. Season the broth with 1-2 teaspoons fish sauce or to taste. The broth for mi Quang is usually heavily-seasoned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010276	Serve	Serve with a generous topping of fried shallots and chopped paddy herb (ngo om).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032000010026	Make the pumpkin butter	About an hour before making the cookie dough, make the pumpkin butter by combining 425g or 1 can of pumpkin puree, two tablespoons of honey, 2 teaspoons of pumpkin pie spice, 100g or  cup of brown sugar, and 2 teaspoons of apple cider vinegar or red wine vinegar in a pot. Cook on medium heat, stirring often, for about 30-45 minutes until the mixture has reduced and is shiny and thick. Store in a mason jar for 1 week in the fridge or in the freezer for up to 5 months.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030500010086	Process Walnuts	Place the walnuts, cinnamon and cloves in a food processor and process until the walnuts are finely ground.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010093	Add Toppings	Evenly place on the capers, olives, and feta cheese.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010043	Prepare the Dressing	In a small bowl whisk together the olive oil, vinegar, garlic, honey, mustard, salt, and pepper. Drizzle the dressing over the salad and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010052	Combine and Serve	Toss the almonds and pepitas into the salad, reserving a few to sprinkle on top. Season to taste and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010056	Preheat Oven and Prepare Baking Sheet	Preheat the oven to 350F and line a baking sheet with parchment paper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010035	Prep Work	Cook the bacon in a 4.5-quart soup pot slowly over low heat. While the bacon cooks, measure out remaining ingredients. Once the bacon is cooked, set aside on a paper towel lined plate. Chop once cooled and reserve 2 tablespoons of bacon drippings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010042	Add Garlic and Lemon Juice	Add the garlic and cook for 30 seconds. Stir in the lemon juice and herbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010128	Preheat Oven	Heat oven to 350 degrees.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010016	Season and Garnish	Season the potatoes with salt and garnish with parsley if preferred. Serve them drizzled with sauce and mayonnaise.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010106	Saut Spices and Curry Paste	Measure spices into a bowl, open the coconut milk, chop the veggies, etc. In a Dutch oven or similar large, deep skillet, heat the oil over medium heat. Once it is hot and shimmering, add curry paste, onion, garlic, ginger, cumin, coriander, and cinnamon. Cook, stirring constantly, until the paste darkens and the spices smell ultra fragrant, 2 to 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010262	Cook with Spices	Add 3 cloves of garlic, 2 tbsp Bun Bo Hue powder, 1 tbsp of shrimp paste and 1 tablespoon of oil to a soup pan. Cook for 30 seconds until fragrant. Add in the beef shank and beef chuck, and cook until the beef is brown on all sides.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010265	Saut Thighs and Drumsticks	Heat the remaining red annatto oil and saut the remaining pounded Vietnamese pearl onions until fragrant. Add the chopped thighs and drumsticks and saut until the outside is no longer pink. Then add  cup water into the pan and braise for about 20 minutes until the meat firms up and absorbs the seasonings. Transfer the meat along with half of the cooking juice to a clean bowl. Pour the remaining cooking juice into the stock pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010272	Add Main Ingredients	Add 6 cups of water, tomatoes and pineapples. Turn the heat to high and bring to a boil. Lower the heat to medium-low, cover and allow it to simmer for 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032100000007	Preheat the oven	Preheat the oven to 350F (175C) and line two greased cookie sheets with parchment paper.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	t	1
1824032100000003	Chill the dough	Leave the dough uncovered and set it in the fridge for at least 30 minutes, but up to a full hour.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	f	1
1824030500010084	Make the Syrup	Combine the water, sugar, honey, cinnamon stick and orange peel in a small saucepan and bring to a boil over medium-high heat. Reduce the heat to low and simmer for 15 minutes. Remove from the heat and let cool to room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010089	Melt Butter	Melt the butter in a small saucepan over very low heat, keeping it warm throughout the process so it doesn't start to solidify.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010087	Add Nut Mixture	Gently spread one-quarter of the nut mixture evenly over the top of the phyllo. Repeat the process of layering phyllo sheets and brushing with melted butter, but this time use only 5 sheets of phyllo. Gently spread another one-quarter of the nut mixture over the top of the phyllo. Repeat this twice more, layering and buttering 5 sheets of phyllo and topping with one-quarter of the nut mixture. Finish off with 7 layers of buttered phyllo. Brush the top sheet with melted butter, as well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010091	Season and Serve	Sprinkle the oregano, salt, and pepper over top, and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010092	Combine Vegetables	Add the tomatoes, cucumbers, peppers, and red onions to a large platter or bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010042	Assemble the Salad	Place the lettuce in a large bowl or on a large platter. Arrange the chicken, bacon, hard boiled eggs, tomatoes, avocado slices, and crumbled cheese in lines over the greens. Garnish with chives and season with salt and pepper, to taste	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010039	Make the Soup	Peel and dice the potatoes and add them to the soup. Bring back to a very gentle bubble and let the potatoes cook through for 20-25 minutes, until fork tender. Reduce heat to low.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010038	Make the Soup	Add the flour and cook for 2 minutes stirring continuously, until the raw flour smell is gone.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010131	Bake the Dish	Spread the beef mixture into an even layer and spread the corn mixture on top, spreading it out to cover the beef mixture evenly. Bake until the top is golden brown and feels firm to the touch, 45 to 55 minutes. Let rest for at least 10 minutes before serving in shallow bowls.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010019	Frying Croquetas	Pour enough vegetable oil into a large stockpot to reach a depth of 1 inch and heat over medium high heat. Working in batches, fry the croquetas in the oil, turning them on all sides, until golden brown and crispy, about 2 minutes. Drain on paper towels. Serve immediately with the smoked pimentn aioli.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010107	Finish and Serve	Remove from the heat. Zest the lime directly into the pot, then squeeze in the juice. Serve over cooked rice with a generous sprinkle of chopped peanuts and cilantro.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010257	Prepare the Meat	Clean the meat. Put the pork leg, beef shank, and beef chuck into a big soup pan and add water until it just covers the meat. Bring it to a boil. Once the water boils, remove it from the heat and pour out the water. Take out all the meat and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032100000004	Coat the dough in sugar	Stir together  cup granulated sugar and 1 teaspoon pumpkin pie spice. Use a cookie scoop to portion the dough into 2 tablespoons per cookie. Roll the dough between your palms, then place it face down into the sugar and swirl it around to coat. Place the coated dough balls on the prepared cookie sheets.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	t	1
1824030500010088	Finish and Serve	As soon as the baklava comes out of the oven, remove the cinnamon stick and orange peel from the syrup and slowly pour it over the hot baklava, making sure to get it into all of the cracks and crevices, as well as on the top surface. Allow the baklava to sit for at least 4 hours before serving so the syrup has a chance to soak in. (The baklava is actually best when left to sit overnight before serving.) Baklava can be stored at room temperature, covered very loosely with a paper towel or foil until ready to serve. Leftovers should be stored in airtight container at room temperature or in the refrigerator for up to 2 weeks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010094	Dress the Salad	Drizzle on the olive oil and red wine vinegar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010097	Making Palak Paneer	Heat 1 tablespoon butter and half tablespoon oil to the same pan. Once they melt, add cumin, cardamom, cinnamon, cloves & cumin seeds. When the spices begin to sizzle, add onions and fry till they turn transparent to golden. Next saute ginger garlic paste for 1 to 2 minutes or until you begin to smell it nice. Then add tomatoes with salt. Saute until they break down and turn mushy. Add garam masala & saute until the masala smells good. This may take 2 mins. Add water and cook covered until onions are completely soft. There should be some water left in the pan. Lower the flame, add kasuri methi and pureed spinach. Mix well and cook until it begins to bubble for about 2 to 3 mins. If the curry is too thick you may add a few tbsps of hot water. Avoid overcooking. Add paneer & mix well. Turn off and remove to a serving bowl. Optionally garnish with cream.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010095	Preparation	Pluck only the young & tender spinach leaves and discard the stems. Add them to a large pot of water. Rinse them well few times & drain to a colander. Allow the water to drain completely otherwise it will let out moisture while cooking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010096	Cooking Spinach	Heat half tablespoon oil in a pan. Saute green chilies, cashews and spinach for 3 to 4 mins until the leaves wilt off thoroughly & raw smell of spinach has gone away. Cool this completely. Blend this along with water to a smooth puree.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010099	Serve	Serve palak paneer with naan, roti, or basmati rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010100	Simmer Lamb	Add the lamb and 400ml of water and gently simmer for 1 hr, stirring occasionally.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010102	Fry Spices and Onion	In the same pan, fry the bay, cinnamon, cloves and onion until the onion is soft and translucent. Add the garlic and ginger and fry for a further 2mins. Add the paste and fry for another 2 mins.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010101	Add Yoghurt	Discard the bay and cinnamon and stir through the yoghurt, cooking for a further 10 mins.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010103	Prepare Paste	Combine all paste ingredients with a pinch of salt. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010104	Brown Lamb	Heat oil in a large pan and brown the lamb in batches. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010105	Garnish and Serve	Sprinkle with freshly chopped coriander before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010106	Making the Dal	Drain the kidney beans and lentils then place them in a saucepan and pour over the water. Bring them up to a gentle simmer and leave them to cook, uncovered, for about 90 minutes, until the lentils and kidney beans are really soft. NOTE: You'll want to give them a stir occasionally, to ensure they're not sticking. If it starts to look a little dry then add in a splash of water. After 90 minutes, turn the heat down to very low and give them a gentle mash with a potato masher or the back of a fork to break up some of the lentils and kidney beans. In a second saucepan add in the ghee and butter and heat over a medium heat. Once the butter has melted, add the finely diced onion and stir often, until the onion has softened (about 5-7 minutes). Add in the ginger, chilli powder, garam masala, cumin, salt, and tomato puree (paste) and cook for 1 minute stirring continuously. Add in the passata, the cooked lentils and beans, sugar, and water and stir everything together until fully combined. Bring it to a gentle simmer, then turn down the heat, and let it cook gently for 50 minutes to an hour, stirring occasionally. **If you're making ahead then stop at this stage, cool, cover and refrigerate until you're ready to serve.** Stir in the extra tablespoon of butter and the double cream and heat through for a further 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010107	Prepare the Pulses	Rinse the lentils and kidney beans under cold water a few times then place them in a bowl. Cover with cold water, enough to completely cover, and add an extra 2-3cms (about an inch) of water and leave to soak overnight (for at least 12 hours).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010108	To Serve	Add to a bowl and top with a drizzle of cream and a sprinkle of freshly chopped coriander.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010109	Final Touches	Add butter, kasuri methi, 1/2 a tablespoon of garlic paste and 1/4 cup of chopped coriander leaves and stir to combine. Simmer for 1-2 minutes or until butter has melted through. Once it melts, add lemon juice and the remaining coriander leaves, stir to combine. Serve hot with chopped onion, lemon wedges and hot toasted pav!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010110	Saute Vegetables	Add vegetable oil and butter to a pan and heat on a medium flame. Once hot, add cumin seeds and let it splutter. Add capsicum and saute for 5 minutes or until slightly softened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010111	Combine and Mash	Add mashed potato, carrots, beetroot and green peas. Stir to combine. Add 1 cup of water and mix well. Allow it to come to a boil and mash using a potato masher. Allow the bhaji to reduce and cook on a medium flame.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010112	Cook Onions and Tomatoes	Add chopped onion and allow to fry on medium flame for 6-7 minutes. Add chopped tomatoes, 2 teaspoons pav bhaji masala and 1 teaspoon of salt. Stir to combine, cover and cook on low heat for 8-10 minutes or until softened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010113	Adjust Consistency and Seasoning	Once the water gets absorbed, add another cup of water along with half a teaspoon of salt and repeat the mashing process. Ensure all the vegetables are fully cooked and mashed together. Taste and adjust the salt accordingly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010114	Add Spices and Vegetables	Add chili powder, coriander powder, turmeric powder, 2 teaspoons of pav bhaji masala, 1 1/2 tablespoons of garlic paste, green chilli paste and 1/2 a teaspoon of salt. Stir and mix until combined. Cook on medium heat for 3-4 minutes or until the oil separates.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010117	Curdle Milk	The curdled milk is the cottage cheese, allow the milk to rest in the whey water for a few minutes. Spread a muslin cloth/cheese cloth (Make sure its big enough to get tied up) and drain the curdled milk.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010116	Cook in Syrup	In a pressure cooker (wide enough) boil sugar and water. When bubbles starts to form, add Cardamom powder, clove and paneer balls (one by one) slowly. Cover the cooker and pressure cook for 1 whistle.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010098	Serve	Serve palak paneer with naan, roti, or basmati rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010118	Mix Curd and Lemon Juice	To begin making the Bengali Rasgulla, first mix curd and lemon juice together in a bowl. Bring the milk to a roaring boil; when it starts to foam and rise, reduce the flame to medium and add curd-lemon juice mix and give it a stir. The milk will begin to curdle and get separated from the whey. When all the milk is curdled and only a clear whey remains, turn off the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030500010121	Simmer	After a whistle, reduce the flame to low and let it simmer for another 5 minutes. Turn off the heat and allow the pressure come down.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010045	Roast Carrots	Preheat your oven to 400 F. Line a baking pan with parchment paper and spread the thinly sliced carrots on the pan evenly. Coat with avocado oil, sea salt and pepper and roast for 30 minutes, flipping halfway through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010033	Make the Soup	Add reserved bacon drippings and butter to the pot over medium heat and use a silicone spatula to "clean" the bottom and sides of the pot. Add the diced onions and celery. Toss to coat and soften for 5-6 minutes. Add the garlic, hot sauce, Worcestershire sauce, and seasonings. Cook for 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010130	Prepare the Pino	Heat a medium, oven-safe skillet over medium-high. Add the oil and ground beef, season with a large pinch of salt, and cook, occasionally stirring, until ground beef is deeply brown, 8 to 10 minutes. Use a sturdy wooden spoon or whisk to break up the meat as it cooks. Drain off any excess fat and return to heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010022	Cooking The Mixture	Heat the oil and butter in a medium saucepan over medium heat until butter is melted. Add the flour and cook 1-2 minutes while whisking frequently. Gradually add the milk while whisking and continue to cook another 2-3 minutes. The mixture should be smooth. Switch to a wooden spoon and stir in the ham, cheese and nutmeg. Cook another 1-2 minutes while stirring- the mixture will pull away from the sides of the pan. Taste the mixture and add salt if desired- the ham and cheese are salty so you probably won't need to add any additional salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010108	Adding Vegetables	Add in the garlic, stir together then the second tablespoon of coconut oil, then add the broccoli, red bell pepper, green bell pepper, carrots and zucchini. Add the sea salt, black pepper, coconut sugar, and liquid aminos on top and stir everything together. Reduce heat to medium and cook down, stirring, until carrots are tender crisp, about 10-15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010115	Mix Lime Juice and Fish Sauce	Add lime juice and fish sauce and stir with pestle using a circular motion until well combined and palm sugar is fully dissolved, about 15 seconds. Add green papaya. Holding a large spoon in your non-dominant hand while holding the pestle in your dominant hand, pound down the sides of the mortar (not the center) while simultaneously using the spoon to move the ingredients back and forth in the mortar until ingredients are well combined and green papaya has begun to absorb the dressing, about 30 seconds. Take care not to over-pound the green papaya or it will lose its crisp texture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010121	Cook Pineapple and Red Pepper	Add 1 tablespoon oil to the pan and add the pineapple and red pepper. Cook, stirring constantly, until the liquid has evaporated and the pineapple is caramelized on the edges, about 3 to 5 minutes. Then add the green onion and garlic. Cook until fragrant while stirring constantly, about 30 seconds. Transfer the contents of the pan to your bowl of eggs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010266	Assemble the Dish	Prepare the noodles according to package instructions. Divide noodles into serving bowls. Top the noodles with cooked chicken breasts, thighs and drumsticks pieces. Also divide the cooking juice into serving bowls. Add some lettuce, micro greens and fresh herbs to the bowls. Sprinkle chopped scallions and roasted peanuts on top. Pour broth into serving bowls. Add as much broth as desired, but generally the broth should not fully cover the noodles. Serve with rice crackers and if desired, a small bowl of fish sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010269	Prepare Annatto Oil	Place a small pot over medium heat and add the oil. Place the annatto seeds in a heat-proofed bowl and once the oil is hot, pour it over the seeds. The oil should turn reddish and you can discard the seeds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010277	Final Touches	Add bean sprouts and taro stem (bac ha), then turn off the heat. The remaining residual heat will cook the taro stems and bean sprouts.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824032100000002	Prepare the butter	Set the butter in a small frying pan over medium-low heat. Once the butter has melted, raise the heat to medium. Cook, stirring often, as the butter sputters and the milk solids separate. With a rubber spatula, scrape the edges of the pan to ensure even browning. Once the milk solids turn brown and the butter is almost done foaming, immediately remove it from the heat into a heat-safe bowl.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	t	1
1824032100000001	Make the pumpkin butter	About an hour before making the cookie dough, make the pumpkin butter by combining 425g or 1 can of pumpkin puree, two tablespoons of honey, 2 teaspoons of pumpkin pie spice, 100g or  cup of brown sugar, and 2 teaspoons of apple cider vinegar or red wine vinegar. Cook on medium heat, stirring often, for about 30-45 minutes until the mixture has reduced and is shiny and thick. Store in a mason jar for 1 week in the fridge or in the freezer for up to 5 months.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	t	1
1824030500010120	Drain Excess Water	Now on a flat plate, first place the sack, then a tawa or plate and finally some heavy weight. This helps to squeeze all excess water. Let it sit for 1 hour without any disturbance, until you see a lot of whey is released.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010044	Cook Pumpkin Seeds	While carrots are roasting, get started on your pumpkin seeds. Add to a small, stovetop pan and turn heat on low. Add a bit of avocado oil, salt and pepper to coat and cook on low heat, stirring intermittently until pumpkin seeds turn golden brown, about 10-15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010048	Toss it all together	In a large bowl, add the green apples, celery, grapes, walnuts, parsley, salt, and mayo dressing. Stir it all together until everything is evenly coated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010043	Cook Scallops	Heat the oil in a heavy skillet over high heat until it's just smoking. Add the scallops in a single layer and cook for 2-3 minutes per side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010047	Serve	Once salmon is cooked to your liking, spoon dill sauce on top. Garnish with lemon wedge if desired and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010134	Optional Drizzle	Drizzle with a little olive oil if you like.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010023	Mix the Pasta	Take as much stock from the pot of meat as you need and mix it with an equal amount of stock from the cabbage. Bring to a boil. Break angel hair pasta pieces in quarters. Add pasta to pot and cook until al dente.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010025	Prepare the Cabbage	Chop the cabbage into eighths. Remove 2 cups of broth from the stew and put into a large stockpot. Place the cabbage in the pot with 2 cups broth and 2 cups water and boil with the sausages until cabbage is soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010039	Slice Octopus	Separate the octopus legs, and thinly slice them. Position them over the potato slices or directly on your serving plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010110	Cooking the Aromatics	In a pan over medium high heat, heat 1 tablespoon of the coconut oil. Add in the curry paste to fry it, stirring into the coconut oil, for about 1 minute. Add in the chopped onion and cook until onion is slightly translucent, about 8 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010112	Add Palm Sugar and Tomatoes	Add palm sugar and continue to pound lightly while also working the pestle in a circular motion while applying gentle pressure to help dissolve the palm sugar, about 30 seconds. Add long beans and pound until slightly broken down, 15 to 30 seconds. Add tomatoes and pound gently just until the tomatoes release their juices, about 15 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010122	Cook Pork with Garlic and Chilis	Add oil to a large pan over medium heat. Add the garlic and chili's stir quickly, then add the ground pork. Turn the heat up to medium high.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010134	Thicken the Sauce (Optional)	Combine the cornstarch and 4 tablespoons of water in a small bowl. Stir to completely dissolve the cornstarch. Add half of the slurry to the sauce. Stir immediately to thicken the sauce. You can adjust the thickness of the sauce by slowly adding a bit more water or cornstarch slurry, if needed. The sauce shouldn't be too thick, but should coat the back of a spoon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010140	Ready Ingredients for Cooking	Place the remaining noodle ingredients in bowls and line them up in the order they'll be added to the pan: garlic, gai lan, eggs, noodles and sugar, then the sauce. When ready to cook, put 1 cup of hot tap water near the stove, and drain and discard any liquid in the bowl with the meat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
