1824031600010037	Shock Octopus	Keep the skin on the octopus while you cook it. 'Shock' it first by dipping it a few times in boiling water. Boil your water and dip the octopus into the water for 10-20 seconds, and then remove it. Repeat the process twice more until the legs of the octopus curl up.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010109	Finishing Touches	Add in the thai basil on top, and stir in the sambal oelek (or Sriracha) if using. Serve with rice, naan bread and a lime wedge. Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
