1824030500010115	Tie Curdled Milk	Now bring the edges of the cloth together and immerse it (up and down process) in a bowl filled with ice cubes and cold water. Slightly rub the bag so that it releases the lemon juice flavor and bring the curdled milk together to a ball. Squeeze water well and tie the bag.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010125	Making Pani (Spiced Water)	In a blender add all the ingredients mentioned above for the pani. Add water and grind to a fine chutney. Remove the green chutney in a large bowl. Rinse the mixer jar with 1/2 cup water first and then add this water in the bowl. Then add 1/2 to 3/4 cup more water. Mix well. Check the seasoning. Add more salt or jeera powder or chaat masala or jaggery if required. If you want a thin pani, you could add some water. Keep on checking the seasoning, as per your taste. Add the boondi to the pani. You can chill the pani in the fridge or add some ice cubes to it.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010124	Making Pani Puri Stuffing	Boil the potatoes till they are cooked completely. Peel them and then chop them. Finely chop the onion if using it. In a small bowl, mix the potatoes, onions, coriander leaves, cumin powder, chaat masala powder, and black salt or regular salt. Mix well and keep aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010123	Assembling Pani Puri	Crack the top of the puri with a spoon. Add 2 to 3 teaspoons of the boiled potato-onion filling in the poori. Stir the green pani first and then add it in the poori. Optionally you can add some sweet chutney in the puri. Serve the pani puri immediately otherwise the prepared puri with stuffing and water will become soggy. You can also make individual portions with the puris, potato-onion mixture and the pani. Let the individual assemble the pani puri for himself/herself as per his/her taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010130	Saut Spices	Heat oil in a pan over medium heat. Once the oil is hot, add bay leaf, black cardamoms, and cloves to the oil. Saut them for few seconds or until they are fragrant. Now add red onions, and saut for 5 minutes or till they turn golden brown.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010128	Make Samosa Dough	Add flour, carom seeds, and salt to a bowl and mix together. Add ghee and mix with your fingers to get breadcrumbs texture. Add three-quarters of the water and mix together with your hands, adding more water, until you get a firm (not sticky) dough. Put to one side, cover with a piece of clingfilm/plastic-wrap (or a wax wrap) and rest for 30 minutes. You can make the filling while the dough is resting.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030600010133	Add Remaining Ingredients	Add tomato puree, salt, slit green chilies and red chili powder. Mix well and cook covered for 5 minutes. Add amchur powder, dried fenugreek leaves, anardana, sugar, and tamarind paste. Remove tea bags and add the black tea to the masala (sauce).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010126	Prepare Potato and Pea Filling	Place the peeled and chopped potatoes into a pan and cover with cold water. Bring to the boil and simmer for 10-11 minutes, so theyre just tender (a knife should slide into them with just a bit of resistance). Drain and put to one side. Heat the oil (or ghee) in a large frying pan, over a medium heat. Add the cumin seeds and fry for one minute, stirring often, until they start to sizzle. Add the ground cumin, ground coriander, garam masala, asafoetida, ginger, and chilli. Fry for one minute, until fragrant.  Add the peas, and cook for a minute, then add in the potatoes. Gently crush the potatoes, with the back of a spoon to break them up slightly. Sprinkle over the chopped coriander, salt, and lemon juice, and fold everything together, until combined (be sure to fold, so the mixture doesnt go mushy). Put to one side.\n	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030600010131	Prepare Black Tea	Steep 2 black tea bags in 1/2 cup hot water for at least 4 minutes. Keep the tea aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010127	Make Samosas	Divide dough into 6 balls and roll each into a circle. Cut each circle in half, form cones, fill with potato mixture, and seal edges with water. Repeat, until you have used up all the dough and filling  making 12 samosas. Cover half of the samosas with a damp towel and preheat your oven to a very low temperature (to keep the samosas warm). Place a tray in the oven to heat. Heat the oil in a large heavy-based pan or Dutch oven, over a medium heat until hot. The oil should reach no further than halfway up the pan (or it might bubble over). You want to be able to add a tiny blob of dough or tiny chunk of bread into the oil, and it should bubble very very slowly (if you have a temperature probe this should be about 160-165C/320-329F). We dont want the oil too hot. Carefully add 6 samosas to the pan, one at a time. Cook for about 10-12 minutes, turning a few times, until golden brown. Drain on kitchen paper and place on the warmed tray in the oven, then cook the second batch. Once the second batch is cooked, drain and arrange all of the samosa on a serving plate. Serve with your favourite dipping sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030600010129	Combine with Chickpeas	Mix well, and cook for 5 minutes. Remove tea bags and add the black tea to the masala (sauce). After that, add kasuri methi, sliced ginger, and cooked chickpeas. Mix everything well. At this point, you can add more water if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010132	Soak Chickpeas	Rinse chickpeas 3-4 times and soak them in enough water for 8-10 hours or overnight. After 8-10 hours, drain out the excess water and rinse them again with fresh running water and set aside. If using dried chickpeas then follow this step, or else skip the soaking part.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010134	Pressure Cook Chickpeas	Add rinsed chickpeas to a pressure cooker along with salt and water. Close the cooker with the lid and pressure cook chickpeas on medium heat for 6-7 whistles or until chickpeas are softened. Let the pressure cool off completely before opening the lid.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010135	Garnish and Serve	Garnish with julienned ginger and chopped cilantro. Serve with bhature, kulcha, or puri, along with sliced onions, pickle, and lemon wedges.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010137	Thicken Sauce	Mix together cornstarch and water, then stir into the sauce. Cook for 5 to 10 minutes, or until thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
