1824032000010040	Fry the Samosa	Your samosa is now ready. Repeat with remaining dough. Always remember to keep the filled samosa covered with moist cloth while roll and fill the others. Now heat oil in a kadai on low heat. To check if oil is ready, drop a small piece of dough into the oil. It should take few seconds to come up to the surface. That means the oil is ready. Drop the shaped samosas into the oil. Fry on low heat. After around 10-12 minutes, the samosa will become firm and light brown in color. At this point, increase the heat to medium and fry until it gets nicely browned. Dont overcrowd the kadai/wok, fry 4-5 samosas at a time. And each batch will take around 20 minutes since we fry on low heat so be patient.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
