1824031700010127	Add Remaining Sauces and Cook Pork	Continue stirring the pork and once it's halfway cooked add the remaining soy sauce and oyster sauce. Continue stirring until pork is cooked. Taste and see if additional sauce is needed. If you like it to have some sweetness you can add a little bit of sugar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
