1824030600010151	Add Toppings and Bake	Spread about 1/4 cup + 2 tablespoons of the sauce over the dough, leaving a 1/2-inch border around the edges. Slide the baking sheet into the oven and bake for 7 minutes, until the crust is golden brown and the cheese is melted and bubbling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
