1824030600010162	Preheat Oven and Prepare Bacon	Preheat the oven to 400 (200 C) degrees and line a large tray with paper towels. Arrange the bacon on a rimmed baking sheet. Bake for 15-20 minutes, flipping the pieces halfway through, until the bacon is deeply colored and crisp. Transfer to the tray to absorb excess fat. Chop the bacon into small pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010164	Combine Egg Mixture and Pasta	Whisk 1/2 cup of the hot water into the egg yolk mixture  this tempers the eggs so they won't scramble. Immediately dump the hot pasta into the bowl, then toss it all together quickly and thoroughly, using tongs or two spoons. You can add more water if the sauce seems dry. Sprinkle the bacon and parsley over the pasta and toss to combine. Serve right away, with additional grated cheese on the side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010053	Chop Broccoli	Chop the broccoli florets into 1/4-inch pieces and any remaining stems into 1/4-inch dice. Peel any woody or coarse parts from the stem first.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031300010048	Bake Salmon	Place salmon on a foil lined baking tray. Drizzle top with olive oil, salt and pepper. Bake for 12-16 minutes depending on the thickness of salmon filet. Once internal temperature reaches about 135 degrees, remove from oven and let rest until 145 degrees internally (the safe cooking point of salmon).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010139	Fry Onions and Season	Rinse and drain the onions, then fry them in the reserved bacon fat. When they start to soften, add the cayenne pepper and cumin. Continue to fry the onions until golden brown, then remove the pan from the heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010030	Achieve Tenderness	When you have achieved the desired tenderness, take your octopus out of the water, and place on a cutting board.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010117	Cook Cashews and Rice	Reduce the heat to medium and add the remaining 2 teaspoons oil to the pan. Pour in the cashews and cook until fragrant, stirring constantly, about 30 seconds. Add the rice to the pan and stir to combine. Cook until the rice is hot, stirring occasionally, about 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010135	Make the Sauce	Combine the coconut milk, sugar, and salt in a saucepan. Cook over medium heat or medium-low heat until the mixture is hot and the sugar is melted. Do not bring the coconut sauce to a boil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800000002	Mix Egg Yolks and Sugar	In a bowl, beat yolks and sugar together until light. Stir about a quarter of the vanilla cream into this mixture, then pour sugar-egg mixture into cream and stir. Pour into four 6-ounce ramekins and place ramekins in a baking dish; fill dish with boiling water halfway up the sides of the ramekins.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	f	1
1824032000010030	Prep the cookies	Preheat the oven and line a baking sheet with parchment paper. Use a medium cookie scoop to portion out the dough onto the baking sheet.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030600010146	Combine and Cook	Add turmeric powder, red chili powder, coriander powder and amchur (mango powder). Cover the pan and let the masala cook for 2-3 minutes and then add the potatoes and cauliflower to it and mix. Add chopped coriander leaves and give a good mix.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010153	Make the Sauce	In a medium bowl, stir together the tomatoes, garlic, salt, sugar, pepper, and oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010160	Season with Salt	I typically salt after the first round of broth. I add approximately 1/2 tsp of salt (Mortons) but depending on the sodium level of your broth this could be more or less. Start with a pinch and taste. Add more if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010055	Prepare and Bake Almonds and Pepitas	Place the almonds and pepitas on the baking sheet, toss with the tamari, maple syrup, and smoked paprika and spread into a thin layer. Bake 10 to 14 minutes or until golden brown. Remove from the oven and let cool for 5 minutes (they'll get crispier as they sit).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010051	Cook Shallots, Garlic, and Shrimp	Heat the oil in a large skillet over medium heat. Add the shallots and cook, stirring frequently, for about 1 minute. Add the garlic, red pepper flakes, shrimp, and 1/4 teaspoon each salt and pepper. Cook, stirring occasionally, until the shrimp are pink and just cooked through, about 3 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010059	Add Fish and Shellfish	Stir in cod or halibut, shrimp and scallops. Reduce heat and simmer until cod or halibut, shrimp and scallops are just cooked through and clams and mussels have opened completely, about 3-4 minutes. Discard any unopened clams.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010140	Preheat Oven and Prepare Onion Mixture	Heat the oven to 375F. Line a baking sheet with parchment paper. In a medium bowl, combine the onion, lime juice, and salt. Stir vigorously until the onions have softened somewhat. Set aside for about 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010031	Slice Potato	Thinly slice the potato, if you are using one, and lay the slices out on your serving plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010044	Preheat Oven and Toast Almonds	Preheat the oven to 300F/150C. Spread the ground almonds onto a baking sheet and toast for 8-10 minutes until just beginning to color and smell nutty. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010118	Cook Eggs	Heat a large wok, cast iron skillet or non-stick frying pan over medium-high heat and place an empty serving bowl nearby. Once the pan is hot enough that a drop of water sizzles on contact, add 1 teaspoon oil. Pour in the eggs and cook, stirring frequently, until the eggs are scrambled and lightly set, about 30 seconds to 1 minute. Transfer the eggs to the empty bowl. Wipe out the pan if necessary with a paper towel (be careful, its hot!).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010128	Prepare Garlic and Chilis	In a mortar and pestle, pound peeled garlic cloves and Thai chili's until a chunky paste forms. Or you can chop them with a knife.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010132	Steam the Rice	Transfer the rice to a heatproof bowl, add about 2" of water to your steamer (not into the rice), place the heatproof rice bowl on the steaming rack in the steamer, and cover the steamer. Turn to medium-high heat to bring the water to a boil. When the steam starts to come out of the pot, turn to medium heat. Steam for 20 to 25 minutes, until the rice is cooked through, with no hard raw bits in the middle. Remove the pot from the stove. Let sit, covered, while you prepare the other ingredients.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800000005	Final Broil	Place ramekins in a broiler 2 to 3 inches from heat source. Turn on broiler. Cook until sugar melts and browns or even blackens a bit, about 5 minutes. Serve within 2 hours.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	f	1
1824032000010028	Mix the wet ingredients	In a large mixing bowl, mix together butter, light brown sugar, egg, and vanilla extract.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010039	Start Samosa Filling	Boil potatoes until soft. Peel the skin and them mash the potatoes. Set aside. Heat 2 tablespoons of oil in a pan on medium heat. Once the oil is hot, add the cumin seeds, fennel seeds and crushed coriander seeds. Let the seeds sizzle for few seconds and then add the chopped ginger, green chili and hing. Cook for 1 minute.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030600010150	Prepare the Dough	On a lightly floured surface, using your hands, stretch and press one ball of dough into an 12-inch round. Transfer the dough to the cornmeal-dusted baking sheet, and gently stretch it out again so that it maintains its shape.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010149	Preheat the Oven	Preheat the oven to 500F and set an oven rack in the bottom position. Dust a 13x18-inch baking sheet with half of the cornmeal.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010155	Warm Broth	Warm the broth separately on the stove.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010157	Melt Butter and Cook Vegetables	In a wide pan on low-medium heat melt butter. Once melted add onions, garlic, mushrooms, thyme, and a 1/2 tsp of salt. Sweat and cook down for 3-4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010165	Layering the Ingredients	Start by layering slices of tomatoes on a serving platter. Tuck slices of cheese between each tomato so both are visible then tuck whole basil leaves between the cheese and tomatoes. Arrange the slices so you can see every layer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010166	Seasoning the Salad	Season generously with salt and pepper, drizzle all over with extra virgin olive oil and drizzle with 2 tablespoon balsamic glaze or add it to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010167	Deglaze with Wine	Add the tomatoes and deglaze with the wine. Cook for 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010172	Add Tomato Paste	Mix in the tomato paste and cook for two minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010173	Sear Veal Shanks	Add the veal shanks, turn the heat down to medium, and sear them until they are golden brown on all sides, about 4 to 6 minutes per side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010168	Heat Olive Oil	Heat the olive oil in a Dutch oven over medium-high heat and heat until it begins to smoke lightly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010170	Dredge Veal Shanks	Dredge the veal shanks on all sides in the flour and set them aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010175	Saut Vegetables	Remove the veal shanks and add the onions, carrots, celery, and garlic to the pot and saut for 3 to 4 minutes or until lightly browned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010169	Cook in Oven	Add the veal shanks back into the pot, submerge them, place a cover over the pot, and cook in the oven for 2 to 2 1/2 hours in the oven at 325 or until they are very tender and easily remove from the bone.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010176	Preheat Oven	Preheat the oven to 325.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010171	Add Stock and Seasonings	Place in the beef stock, bay leaves, parsley, thyme, salt, and pepper. Be sure to try the liquid to make sure it's well seasoned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010174	Season Flour	Add the flour to a bowl or plate and season it very well with salt and pepper, about 1 tablespoon of salt and 1/2 teaspoon of pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010178	Assemble Salad	Combine toasted bread, tomatoes, and dressing in a large bowl. Add basil leaves. Toss everything to coat and season with salt and pepper. Let rest 30 minutes before serving, tossing occasionally until the dressing is absorbed by the bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010180	Prepare Tomatoes	Place chopped tomatoes in a colander set over a bowl and season with 2 teaspoons kosher salt. Toss to coat. Set aside at room temperature to drain, tossing occasionally. Drain for a minimum of 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010181	Preheat Oven and Toast Bread	Preheat oven to 350F (180C) and adjust rack to center position. In a large bowl, toss bread cubes with 2 tablespoons (30ml) olive oil. Transfer to a rimmed baking sheet. Bake about 15 minutes, until crisp and firm but not browned. Remove from oven and let cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010179	Combine Ingredients	Remove colander with tomatoes from bowl with tomato juice. Place colander with tomatoes in sink. Add shallot, garlic, mustard, and vinegar to bowl with tomato juice. Whisking constantly, drizzle in remaining 1/2 cup (120ml) olive oil. Season dressing to taste with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010184	Saut Vegetables	Heat the oil in a large pot over medium heat. Add the onion, carrots, celery, salt, and several grinds of black pepper, and cook, stirring occasionally, for 8 minutes, until the vegetables begin to soften.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010183	Cook Pasta	Stir in the pasta and cook, uncovered, for 10 more minutes, until the pasta is cooked through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010182	Add Remaining Ingredients	Add the garlic, tomatoes, beans, green beans, broth, bay leaves, oregano, and thyme. Cover and simmer for 20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010185	Season and Serve	Season to taste and serve with parsley, red pepper flakes, and parmesan, if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010186	Adjust Pesto Consistency	Place the pesto into a large bowl and add more extra virgin olive oil to thin it out if it's overly thick.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010189	Combine Pasta and Pesto	Drain the pasta and mix with the pesto. Add pasta water, 1-2 tablespoons at a time to get the perfect creamy consistency. Serve with more grated cheese. Enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010187	Pulse Garlic and Pine Nuts	Add the garlic and pine nuts into a large food processor and pulse until a rough paste is formed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010188	Add Basil and Olive Oil	Add the basil and extra virgin olive oil and pulse again until a rough paste is formed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010191	Cook Pasta	Bring a large pot of salted water to boil. Cook the pasta to al dente, saving 1 cup of reserved pasta water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010190	Add Cheeses and Season	Add the Pecorino and Parmesan and pulse again. Taste test and season with salt to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010193	Saut Onion	Add the olive oil to a large frying pan and heat over a medium heat, then add in the finely diced onion and cook for 4-5 minutes until the onion starts to soften.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010194	Cook Ravioli and Red Bell Pepper	Now add in the ravioli and the sliced red bell pepper and cook for another minute, stirring a few times.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010197	Add Roasted Tomatoes, Stock, and Cream	Add in the roasted tomatoes, chicken stock, and cream. Stir everything together and bring up to a simmer. Allow to simmer for 5-6 minutes, until the centre of the ravioli is piping hot (you can open one up to check this).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010195	Garnish and Serve	Sprinkle with fresh parsley and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010054	Mix Salad Ingredients	In the bottom of a large bowl, whisk together the olive oil, mayo, apple cider vinegar, mustard, maple syrup, garlic, and salt. Add the broccoli, onions, and cranberries and toss to coat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010052	Add Wine and Butter	Transfer the shrimp to a plate. Add the wine to the skillet and simmer until reduced by half, 3 to 4 minutes. Add the butter, lemon juice and lemon zest, 1/2 cup of the reserved cooking water, and 1/2 teaspoon salt; stir until the butter is melted.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010196	Add Herbs and Seasonings	Add in the Italian herbs, chilli flakes, black pepper, and salt, give it a stir then add in the tomato puree and wine, stir again, and cook for another minute to reduce the wine down slightly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010198	Add Spinach and Parmesan	Add in the spinach and parmesan and cook for a minute to allow the cheese to melt and the spinach to wilt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010057	Cook Noodles	Bring a large pot of salted water to a boil. Cook the noodles until al dente, according to package directions. Drain and rinse briefly with cool water to remove the excess starch and stop the cooking, then transfer to a large serving bowl. Add the broccoli cole slaw and carrots.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010053	Cook Pasta	Bring a large pot of salted water to a boil. Add the pasta and cook to al dente according to the package instructions. Reserve 1 cup of the cooking water, then drain.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010141	Mash Plantains and Mix	Drain the water from the pot with the plantains. Mash the plantains with a potato masher or a fork until broken up. Add the fried onions, bacon, queso fresco, peanuts, and cilantro and mix well to combine. Season with salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010033	Drizzle Olive Oil	Drizzle the octopus with a high quality extra virgin olive oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010123	Cook Thai Style Fried Egg	In a small skillet over medium high heat, add oil to cover the bottom of the pan. Let oil get hot and carefully add an egg to the pan. It does splatter, so be careful. Cook until edges get crispy and spoon oil on top of egg to cook the white part, but leave the yolk runny.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010131	Combine Rice and Sauce	Carefully remove the bowl of sticky rice from the steamer with your oven mitts on. Pour 1 cup of the sauce into the bowl. Stir to mix well until the sauce is fully absorbed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010143	Add Eggs	Push greens to one side of the pan, adjust enough oil to lightly coat the other side and add the eggs. Use the spatula to scramble the eggs, stirring and scraping until cooked through and just dry, about 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800000004	Preheat and Simmer	Heat oven to 325 degrees. In a saucepan, combine cream, vanilla bean and salt; cook over low heat just until hot. Let sit for a few minutes, then discard vanilla bean. (If using vanilla extract, add it now.)	643986b5-d98a-4e8a-b904-464fbf2ed2d3	f	1
1824032000010034	Stir in any (optional) add-ins	Stir in raisins, chocolate chips, chopped nuts, or M&Ms, if desired.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030600010192	Add Garlic	Add in the minced garlic and cook for another 30 seconds stirring continuously.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010199	Make the Risotto	Add rice to heated oil in a large sauce pan, stir for one or two minutes. Add the white wine while stirring. Add the chicken stock a little at a time, continuously stirring, until all the stock has been used and the rice is cooked, yet still al dente. Remove from heat and set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010203	Add Egg and Refrigerate	Add an egg to the risotto and mix well, then refrigerate for a few hours, or overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010201	Bread the Arancini	Roll the arancini in flour, then beaten egg, and finally breadcrumbs. Set aside until all of the rice has been used.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010200	Form the Arancini	Place some rice in your hand, flatten it and add the filling, then shape into a ball. If you'd like to make conical shapes, flatten the bottom of the ball, and make the top more pointed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010202	Fry or Bake	Heat oil in a deep fryer, pot or wok until it is very hot. Add the arancini, and cook quickly, turning often so they don't brown too much on one side. If serving immediately, fry for a few minutes, so the cheese will melt in the center. Remove from oil and place on paper towel lined plate or tray. If you'd like to serve them at a later time, remove them quickly after just browning; then, just before serving, place them on a baking sheet and re-heat in the oven at 400F for 10 to 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010205	Asparagus Tempura	Serve on platter with horseradish cream sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010206	Horseradish Cream Sauce	In a medium bowl, combine all ingredients and whisk together until smooth and well combined. Let mixture sit in refrigerator for 1-2 hours or overnight. Store leftovers in refrigerator in an airtight container for up to 2 weeks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010204	Asparagus Tempura	In a large heavy saucepan, add enough canola oil to fill just over a third full. Clip a frying thermometer onto the pan and heat the oil over medium heat until oil reaches 375 degrees.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010207	Asparagus Tempura	Dip the asparagus stalks into the batter, one or two at a time, then add to the hot oil and fry 3 or 4 stalks at a time for about 70 seconds, until golden brown, turning with tongs to promote even browning. Remove from oil and place on a wire rack placed over a baking sheet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010208	Asparagus Tempura	While the oil is heating, in a medium bowl, whisk together the flour, baking powder and baking soda. Add the club soda and the olive oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010212	Prepare the Base Batter	Combine all-purpose flour, kosher salt, sugar, and baking powder. Mix all together. Peel and grate nagaimo into the bowl. Add dashi and mix until combined. Let the batter rest for at least one hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010211	Prepare the Ingredients	Discard the core of the cabbage and cut into thin slices. Mince the red ginger. Cut the pork belly into pieces and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010210	Prepare the Okonomiyaki Batter	Take out the batter from the refrigerator. Add large eggs and tempura scraps, and two-thirds of the pickled red ginger to the bowl. Mix until combined. Add the minced cabbage to the batter, one-third of it at a time. Mix well before each addition. Check the consistency of the batter. Make sure the cabbage is coated well in the batter. You do not need to use all the minced cabbage if it is overpowering the batter.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030900010019	Assemble the Dorayaki	Working in pairs, scoop some red bean paste onto the centre of the first pancake using a metal spoon or cookie scoop. Spread the paste with the back of the metal spoon, leaving the edges clean. Cover with the second pancake. Press the edges together to seal. Immediately keep each filled pancake in the airtight container to prevent drying.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010051	Cooking Part 1	Place a large skillet over medium-high heat. Once skillet is hot add half vegetable oil and swirl to coat. Add half beef and onion mixture and cook for 4 to 6 minutes, stirring beef as needed until cooked through. Transfer beef to a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010045	Beef Preparation	Place beef and thinly sliced onion into a mixing bowl and toss together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010049	Garnish and Serve	Top bulgogi with remaining green onion and sesame seeds and serve with rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010050	Marinade Application	Pour marinade over beef and onion mixture and mix together until all beef is well and evenly coated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010052	Soak Mushrooms and Noodles	Soak shiitake mushrooms and dangmyeon noodles for at least 30 minutes or until mushrooms are soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010055	Cook Noodles	Cook noodles for 2-3 minutes, drain, and run under water to prevent overcooking. Toss with 1 tbsp. of sesame oil to prevent sticking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010056	Garnish	Garnish with toasted sesame seeds. Can be served room temperature or warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010053	Blanch Spinach	Blanch spinach for 1 minute, squeeze all the water out, and give it a rough chop. Julienne onions, carrots, bell peppers, and shiitake mushrooms (with stem removed).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010054	Combine Sauce and Vegetables	Combine all sauce ingredients and pour on top of vegetables and noodles. Mix together. If the noodles are long, cut with scissors.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010057	Saut Vegetables	Saut onions, carrots, bell peppers, and mushrooms all separately. Add to the noodles.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010061	Prepare Anchovy Broth	Remove the heads and innards from the dried anchovies and put it inside a dashi bag with the dried kelp. Boil in water and strain it out after simmering for 15-20 minutes uncovered, then discard the pack.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010060	Simmer Ingredients	Simmer in water for 15-20 minutes uncovered, then discard the pack.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010063	Add Hardboiled Eggs	Cook for another 2-3 minutes then add the hardboiled eggs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010064	Rinse Fish Cakes	Rinse the fish cakes under cold water to remove any excess oil, then add them when the sauce has thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010062	Boil and Add Rice Cakes	Bring to a gentle boil. Add the rice cakes and continue cooking, stirring occasionally, until the sauce has thickened from the starch. This will take roughly 10 minutes depending on the rice cakes you are using.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010059	Cook Radish and Sauce Ingredients	On low heat, add the Korean radish and the sauce ingredients. Stir fry until the radish softens, and stir frequently to make sure the sauce does not burn.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010069	Make Gochujang Sauce	Mix gochujang, vinegar, sugar and sesame seeds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010073	Prepare Green Onions and Minari	Clean green onions and minari. Cut green onions 6 inches long or 1/2 the full length. Cut minari 3 inches long.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030600010209	Cook the Okonomiyaki	Prepare a large griddle or two large frying pans with lids to cook two savory pancakes at a time. In the pans, heat a bit of neutral oil on medium heat. When its hot (400F or 200C), add one portion of the batter to each pan. Using spatulas, spread and shape the batter in a circle about 6 inches (15 cm) in diameter. We like thicker okonomiyaki (the final thickness is  inches or 2 cm). If youre new to making okonomiyaki, make it smaller and thinner so its easier to flip. Place 3 slices of pork belly on top of each okonomiyaki and cook, covered, on medium-low heat for 5 minutes. When the bottom side is nicely browned, flip them over. Gently press the okonomiyaki to fix their shape and keep them together. Cook, covered, for another 5 minutes. Flip them over one last time and fix their shape. Then cook, uncovered, for 2 minutes. Transfer the cooked okonomiyaki to individual plates. Continue cooking the rest of the okonomiyaki.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824030600010213	To Serve	Now, its time to customize your okonomiyaki with the condiments and toppings of your choice. In Japan, we spread okonomiyaki sauce on top with a brush or spoon. Then, drizzle Japanese Kewpie mayonnaise (you can make my homemade recipe) in a zigzag pattern. Drag a chopstick tip through the mayo every  inch (1.3 cm) to create the iconic look. We like to sprinkle the top with katsuobushi (dried bonito flakes), aonori (dried green laver seaweed), and chopped green onions/scallions. Finally, garnish with the remaining pickled red ginger (you can make my homemade beni shoga recipe).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010003	Fry the Pork	When you're ready to fry up the pork, remove it from the fridge. It can shake off its chill while you prep all of the other ingredients. In a few shallow bowls or plates, add the all-purpose flour to one plate, the panko crumbs in another and in a shallow bowl, beat together the eggs. Create an assembly line of sorts in this order: flour, eggs and panko. I like to get a small plate or baking sheet to put them on when they're done. Dip the first piece in the flour, pressing it onto the pork cutlet and then dusting off any excess. Transfer it to the beaten egg, allowing any excess to fall off. And then transfer it to the panko, pressing it into the onto the surface. Place on the baking sheet and repeat with the remaining cutlets. Heat up about 3 inches of oil in a cast iron skillet or pan until it reaches 335 F. Add the coated pork into the fryer and cook for about 3 minutes and then gently flip over and cook on the other side for 2 to 3 minutes, until medium golden brown, ensuring it is cooked to an internal temperature of 145 F. Transfer to a cooling rack to drain. Repeat with the other pieces of pork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010004	Assemble the Lunch Plate	Slice up the pork with a sharp knife and place atop some cooked rice. Drizzle with the tonkatsu sauce. Plate it with a side salad and Hawaiian Mac Salad.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010002	Prep the Pork	Trim any fat off of the pork loin and discard it. Then cut it into 4 equal pieces and place a sheet of plastic wrap on top. Using a meat mallet (or you could use a heavy-bottomed pot), pound one of the pieces until it's about 1/4-inch thick. Repeat with the remaining pieces of pork loin. Sprinkle both sides of the pieces in a few pinches of kosher salt. Layer them in between pieces parchment paper and transfer them to a plate and place them in the fridge for about 2 to 4 hours, ideally overnight. This salting step of them really penetrates the meat, seasoning it throughout.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010001	Make the Tonkatsu Sauce	Mix together the ketchup, worcestershire, oyster sauce, miso and a pinch of sugar. You might need to use a whisk to make it completely smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010005	Finish shaping and serve	Gently shape the rice ball into a wide triangular shape using the palms of one hand and the fingers of the other hand, rotating the rice ball as you go. Avoid compressing the rice too hard, it should hold together well but be lightly packed. Sprinkle the outside of the onigiri with black sesame seeds. Wrap each onigiri in a nori sheet and place an additional small spoonful of tuna filling on the top of each onigiri. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010006	Prepare the rice	Place the rice in a fine-meshed sieve and rinse well under cold water, rubbing the grains of rice between your fingers, until the water runs clear. This helps remove any excess starch and improves the texture of the rice once cooked. Drain well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010010	Cook the rice	Combine the rice and water, and cook in a rice cooker according to the manufacturer's directions. If you do not own a rice cooker: Combine the rice and water in a medium non-stick, if possible saucepan. Bring to a boil, reduce heat to low, and cook covered for 16 to 18 minutes or until the water has been completely absorbed. Remove from heat, gently fluff the rice with a rice paddle or wooden spoon, place a clean kitchen towel over the pot, top with the lid again, and let stand covered for 10 minutes. While the rice cools slightly, prepare the onigiri filling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010007	Assemble	Set aside a medium bowl of room temperature water and a small bowl of kosher salt for pinching. Once the sushi rice is cool enough to handle, start assembling the onigiri by hand.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010009	Shape the onigiri	Lightly moisten your hands by dipping them in the water bowl. Sprinkle both of your palms lightly with kosher salt and rub them together. Grab roughly a 1/2 cup of sushi rice and gently press into a thick oblong shape in one palm of your hand. Add a tablespoon of the tuna filling, pinched together with your fingertips, to the center of the rice and close the rice over the filling. If necessary, use an additional pinch or two of rice to cover the filling.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010008	Make the filling	In a medium bowl, combine the albacore tuna, mayonnaise, hot sauce, and rice vinegar with a fork until evenly combined. Stir in the scallions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010011	Cook Noodles	Bring a large pot of water to a boil, and salt it. Cook noodles until tender but not mushy. Drain, and quickly rinse under cold running water until cold. Drain well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010012	Combine Sauce	Combine dashi or stock, soy sauce and mirin. Taste, and add a little more soy if the flavor is not strong enough. Serve noodles with garnishes, with sauce on side for dipping (or spooning over).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010014	Prepare Stir Fry Sauce	Mix the stir fry sauce ingredients together. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010015	Serve	Remove from heat and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010017	Cook Scallions and Garlic	Heat the vegetable oil in a large skillet over medium-high heat then add the scallions and garlic and let cook for 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010016	Add Udon Noodles and Stir Fry Sauce	Next add the udon noodles and stir fry sauce and mix evenly together to evenly coat the noodles. Let cook for at least 30 seconds without touching to let the noodles brown slightly on the bottom.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010013	Add Mushrooms and Bok Choy	Next add the shiitake mushrooms and bok choy and mix together, letting cook for 3-4 minutes until the vegetables are tender. (The bok choy will shrink down a lot as it cooks.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010058	Mix Dressing and Combine	While the pasta cooks, whisk together the olive oil, rice vinegar, honey, peanut butter, soy sauce, Sriracha, ginger, and garlic. Pour over the noodle mixture and toss to combine. Add the peanuts and cilantro and toss once more. Serve chilled or at room temperature with additional Sriracha sauce as desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010054	Combine with Pasta	Add the drained pasta and continue to cook, tossing, until the pasta is warmed through, adding more of the reserved cooking water as needed if the pasta seems dry. Return the shrimp and any juices from the plate to the skillet and toss with the pasta. Stir in the parsley, then taste and adjust seasoning, if necessary. Serve with lemon wedges.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010018	Cook the Pancakes	Heat a frying pan or pancake pan over low-medium heat for about 5 minutes until moderately hot, about 160C (320F). Brush the surface of the pan very sparingly with a bit of oil. Wipe off any residue with a paper towel using bamboo chopsticks or heat-resistant tongs. Pour the batter from 8" (20 cm) above the pan, forming a pancake 3" (7 - 8 cm) in diameter. Cover with a heatproof lid and cook over low heat. Once the pancake surface bubbles, flip quickly with a spatula. Fry for another 25 - 30 seconds, or until the bottom is lightly browned. The edges will be sticky - this is OKAY! Dish out the pancake onto a plate or sheet pan and cover it with a damp cloth to keep it from drying. Once you have cooked 2 pancakes to make a pair, place the lighter sides (the bottoms) of 2 pancakes together.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031500010138	Prepare and Boil Plantains	Season a large pot of water with salt and bring to a boil over high heat. Meanwhile, cut off the ends of each plantain. Make an incision down the length of each plantain with a paring knife. Make an incision around the circumference of each plantain at the middle part of each fruit. Using your fingers, pry apart the peel from each plantain at the incisions. Cook the plantains in the pot of boiling water until tender, about 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010034	Slow Cooker Cooking	Cook for around the suggested cooking times of your particular slow cooker. About 5 hours at the high position or 8 hours at low.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010049	Cool Cake	Cool the cake in the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010126	Serve Pad Kra Pao	Serve Pad Kra Pao with steamed rice and the fried egg on top.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800000003	Prepare for Serving	When ready to serve, top each custard with about a teaspoon of sugar in a thin layer.	643986b5-d98a-4e8a-b904-464fbf2ed2d3	f	1
1824032000010033	Cool	Transfer the cookies to a wire rack to cool. Sprinkle with flaky sea salt, if desired.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010041	Continue Samosa Filling	Add the boiled & mashed potatoes and green peas to the pan. Mix everything together. I use my potato masher to combine the spices and seasonings well with the potatoes and peas. Add the coriander powder, garam masala, amchur, red chili powder and salt. Mix to combine. Once its all well incorporated, remove pan from heat and let the filling cool down a bit.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030900010020	Make the Pancake Batter	Combine the flour and baking powder, and sift twice into a large mixing bowl. In a small bowl, combine honey, mirin, water, and vanilla extract (if using) and stir until well mixed. In a separate mixing bowl, break the eggs and lightly beat with a whisk for 10-15 seconds. Add the sugar to the eggs and continue beating until the sugar dissolves and the egg mixture lightens in color, about 2-3 minutes by hand. Add the honey mixture and the flour mixture all at once. Stir with a whisk until the batter is smooth and free of lumps. The batter should be a bit thick, and not too runny. It should be able to run off the whisk or spoon smoothly. Cover the bowl with a tea cloth or seal with cling wrap. Place it in the fridge to rest the batter for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010021	Prepare Potatoes	Peel and cut the potatoes lengthwise then into wedges. Bevel the edges and soak for 10 minutes in cold water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010024	Prepare Onions	Peel and cut the onion lengthwise, then into large wedges.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010025	Prepare Shirataki Noodles	Rinse the shirataki noodles and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010029	Add Green Beans	Remove the otoshibuta, add in the green beans, and cook until tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010023	Prepare Carrots	Peel and cut the carrots into rolling wedges or large rounds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010026	Simmer with Seasonings	Pour in sake, soy sauce, sugar, dashi powder, and water and bring to a boil. When the water starts to boil, reduce to a simmer and place the otoshibuta (drop lid) over the ingredients. Simmer for about 30-40 minutes (until the potatoes are tender).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010027	Saut Onions	Turn the heat down to medium, add the onions and saut until translucent about 5-8 minutes. Add the potatoes and carrots and saut for another 5 minutes. Add the shirataki and beef into the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010022	Cook Beef	Heat oil in a pot and stir-fry the beef on medium-high heat until cooked through. Remove the beef from the pot and reserve for later.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010028	Serve	Serve in bowls and garnish with green onions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010031	Coat Pork Chop	Generously coat the pork chop in the batter and then in panko. Make sure to pat it so every part of the pork chop is coated in panko.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010032	Make Batter	In a bowl, mix flour, cold water, and two eggs till everything is combined. You want a thick but smooth consistency (refer to video tutorial) and add more flour or water until the batter reaches the consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010030	Prepare Pork Chop	Prepare the pork chop by cutting through the fat to prevent it from curling. Using the back of the knife, flatten the meat to help tenderize it. Using your palm, form the pork chop back to its shapesalt and pepper to season on both sides.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010034	Prepare Curry	In a pot, drizzle in oil and turn the heat up to medium-high. Add in sliced onion and saute together for 4-5 minutes or until soft and translucent. Next, add the vegetable and saute for 1-2 minutes. Add in 3 cups of water and let it simmer for 10 minutes on low heat. Next, add in broken curry cubes and stir till thoroughly mixed. Finally, add 2 tbsp of black pepper and let it simmer for 10-15 minutes on low heat. In a bowl, mix flour, water, and egg; this will be the batter.  Cover the pork chops with the batter and coat with panko. Turn the heat to medium-high and fry pork chops for 5-7 minutes or until golden brown on both sides.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010033	Fry Pork Chop	In a pan, add in oil; once the oil is hot (test by adding in a piece of panko, it floats within 5 seconds, and it is ready), add in the pork chop. Fry for 3-4 minutes on each side or until crispy and golden brown. Remove and let it rest on a paper towel.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010036	Prepare Rice and Eggs	Place another large sheet pan on the bottom rack to heat. In the last 5 minutes or so of vegetable roasting, remove the heated pan from the oven and evenly drizzle olive oil on it. Spread the rice over half of the pan. Crack the eggs onto the other half and carefully transfer to the oven. Bake until the egg whites are just set and the yolks are still runny, 3 to 6 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010038	Preheat Oven and Prepare Vegetables	Position racks in the top and bottom thirds of the oven and heat oven to 450 degrees. Arrange the mushrooms, sweet potato, red onion, and kale into four separate quadrants on a sheet pan. Drizzle with olive oil, season with salt and pepper, and toss to coat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010037	Serve	Divide the rice evenly among four bowls. Divide the vegetables evenly as well, placing them in neat piles over each portion of rice. Use a spatula to slide the eggs over the vegetables. Drizzle each bowl with 1 teaspoon of sesame oil and 1 teaspoon of gochujang, adding more if desired. Mix everything together with a spoon or chopsticks before diving in, and serve kimchi alongside, if you prefer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010035	Roast Vegetables	Roast on the top rack until the sweet potato is fork-tender, the onion and mushrooms are slightly caramelized, and the kale is crispy but not burnt, 20 to 25 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010041	Pack the Mixture	Pack the mixture tightly into a clean 2-quart or 2-liter glass jar with a tight fitting lid and seal the jar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010039	Rinse the Cabbage	Place a colander in the sink, drain the cabbage, and rinse with cold water. Gently squeeze out the excess liquid and transfer to a medium bowl; set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010042	Ferment	Let sit in a cool, dark place for 24 hours (the mixture may bubble). Open the jar to let the gases escape, then reseal and refrigerate at least 48 hours before eating (kimchi is best after fermenting about 1 week). Refrigerate for up to 1 month.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010040	Prepare the Cabbage	Cut the cabbage in half lengthwise, then crosswise into 2-inch pieces, discarding the root end. Place in a large bowl, sprinkle with the salt, and toss with your hands until the cabbage is coated. Add enough cold water to just cover (about 12 cups), making sure the cabbage is submerged. Cover with plastic wrap or a baking sheet and let sit at room temperature at least 12 hours and up to 24 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010043	Combine Cabbage with Mixture	Add the cabbage and toss with your hands until evenly combined and the cabbage is thoroughly coated with the mixture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010044	Combine Remaining Ingredients	Place the remaining ingredients in a large bowl and stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010047	Marinade Resting Period	Cover beef and refrigerate for at least 6 hours and up to 24 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010046	Cooking Part 2	Add remaining oil to skillet followed by remaining beef and onion and repeat until beef has just cooked through and sliced onions just begin to soften. Remove from heat and combine with rest of the cooked bulgogi.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010048	Marinade Preparation	Place all marinade ingredients into a blender and blend until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010066	Prepare Vegetables	Chop the large green onion and cabbage any way you want, then cut the Korean radish into thin strips.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010065	Add Broth, Cabbage, and Green Onion	Add the anchovy broth, cabbage, & large green onion. Optional: add a little msg.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010072	Make Chokanjang Sauce	Mix soy sauce, vinegar, sugar and water. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010060	Assemble Salad	Toss arugula with oil, salt and pepper in a medium bowl; arrange on top of the beets. Sprinkle with goat cheese and walnuts; drizzle with the balsamic reduction.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010059	Roast Beets	Preheat oven to 400 degrees F. Place a large piece of foil on a rimmed baking sheet; place beets in the center of the foil. Gather the sides of the foil up to make a packet; pour in 1/2 cup vinegar and seal the packet. Roast until the beets are very tender when pierced with a knife, about 45 minutes. Open the foil packet; let cool for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010062	Slice Beets	When the beets are cool enough to handle, peel them, then slice very thinly with a knife or a mandoline. Arrange the sliced beets, overlapping slightly, on a platter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010055	Final Seasoning	Stir in parsley; season with salt and pepper, to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010142	Cook Bacon	In a large skillet over medium heat, fry the bacon until crisp and browned. Using a slotted spoon, transfer the bacon to a plate. Reserve the bacon fat in the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010032	Prepare Octopus	Cut the head off the octopus at its base. Discard it or use it for something else, if you can find a use for it.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010048	Combine Ingredients	Mix in the cooled almond meal, ground cinnamon and brandy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010130	Serve	The mango sticky rice is ready to serve when the rice mixture and the sauce cool to room temperature or lukewarm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010142	Prepare the Sauce	Whisk together the oyster sauce, soy sauce, fish sauce and white pepper to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010002	Cooling	Remove from oven and cool.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010032	Bake	Bake the cookies in the preheated oven for about 10 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030900010067	Toss to Coat	Toss to coat everything evenly. It is ready when the rice cakes are nice and soft, and are able to hold a lot of sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010058	Prepare Frozen Rice Cakes	If using packaged refrigerated rice cakes, rinse under cold water first. If using frozen rice cakes, soak in warm water for about 10 minutes before adding.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010068	Cook Pancake	Heat pan on medium-high heat. Pour about 2 tablespoons oil into pan. Layer onions, then minari. Pour batter over. Add 2-3 tablespoons per pancake. Dot with ground beef mixture. Flip when bottom is nicely browned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010071	Prepare Seafood	Chop scallops and shrimp roughly into big chunks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010070	Season Beef	Season ground beef with soy sauce, mirin, plum syrup or sugar, chopped garlic and sesame oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010075	Whisk Eggs	Whisk egg in a small bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010076	Finish with Egg	Turn with 1/3 of whisked egg on the pancake. Cook for another 2 minutes or until pancake is nicely browned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010074	Make Batter	In another bowl, make batter by mixing flour, rice flour, sweet rice flour and anchovy stock or water. Add salt. Stir right before using.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010078	Prepare Anchovy Stock	Combine rice starch water, dried anchovy, and sea kelp in a stone pot or heavy bottom pot and bring to boil. Reduce the heat to low and simmer for 3-4 minutes. Discard the anchovies and sea kelp.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010077	Make Stew Base	Smear the pastes in a mini scoop strainer or slotted spoon and incorporate into the stock. Add the onion and bring to a gentle boil over medium heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010079	Add Garlic, Chili Flakes, and Fresh Chili	Add garlic, chili flakes, and fresh chili and heat through. Sprinkle green onion and remove from heat. Serve hot with rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010080	Add Zucchini, Tofu, and Mushroom	Add zucchini, tofu, and mushroom; continue to boil over medium-low heat for 1-2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010084	Prepare Cucumber	Trim cucumber ends and cut it in half lengthwise. Using a spoon, scrape out the seeds from each half. Cut each half lengthwise into 3 long strips to make 6 strips total. Place cucumber strips on a plate, sprinkle all over with salt, and toss well to coat. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010081	Cook Carrot and Fishcake	Add ham strips and cook, gently stirring and tossing, until heated through, 1 to 2 minutes. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010083	Mix Rice with Seasoning	In a large bowl, mix rice with sesame oil, crushed sesame seeds, and 1 teaspoon salt (see note). Divide rice into 6 even portions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010085	Assemble Kimbap	Set a bamboo sushi rolling mat on a work surface. Set a sheet of nori on top of it. Wearing plastic gloves, place a portion of rice on the seaweed sheet and use both hands to spread it evenly all over, leaving about one or two inches of the sheet exposed at the top edge. Dot a few rice grains along the top edge (they will help it stick together later). Arrange your fillings across the center of the rice: 1 cucumber stick, some egg strips, 1 ham strip, one-sixth of the carrot, some of the fishcake strips, 1 danmuji strip, 1 burdock strip, and 1 crab stick strip.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010087	Cook Eggs	In a small bowl, beat eggs with a pinch of salt. Lightly grease a 10-inch nonstick skillet with vegetable oil and heat over medium heat until warmed but not sizzling. Add half the egg, swirling to cover entire bottom of pan and cook until egg has just set on top. Using a rubber spatula, carefully free the egg round and transfer to a work surface to cool. Lightly re-grease pan if needed and repeat with remaining egg. Wipe out skillet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010082	Prepare Rice Mixture	Add the carrot to the skillet with a large pinch of salt and cook, stirring and tossing, until crisp-tender, 1 to 2 minutes; if you need to add a little more oil to the pan, you can do so at any point. Set aside to cool. Lower heat to medium. Add fishcake strips to skillet along with oligosaccharide syrup and soy sauce and cook, tossing and stirring, until fishcake has softened, 1 to 2 minutes. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010086	Roll and Seal Kimbap	Roll the bamboo mat up and away from you, curling the seaweed sheet and rice around the fillings; use the fingers of both your hands to hold the filling in place as you roll with your thumbs. Secure the roll with the exposed flap of seaweed sheet. Once the roll is sealed, gently squeeze, pressing gently on the top and the sides, to compress the roll slightly and seal the edge; if it doesn't seal well, you can also wet the seaweed at the seam to help it adhere.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010088	Prepare Carrot and Fishcake	Slice egg lengthwise into thin strips. Set aside. Rinse cucumber under cold running water, then pat dry with towels, squeezing gently to remove excess moisture. Using the same skillet, wipe it lightly with more vegetable oil and set over medium-high heat until shimmering. Add cucumber and cook until just slightly softened, about 1 minute. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010089	Cut and Serve	Repeat with remaining seaweed sheets, rice, and fillings. Lightly brush rolls with sesame oil and lightly rub a sharp knife blade with it as well. Set 2 rolls next to each other, then slice them both into 1/2 inch thick pieces (it's easier to cut through 2 rolls at once than it is to do one at a time).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010091	Stir Fry	Heat 1 tablespoon sesame oil in a large skillet over medium low heat. Add the carrots and garlic and stir fry until fragrant, about 5 minutes. Add the cauliflower, edamame, and remaining sesame oil to the pan; stir fry quickly to cook the cauliflower to a soft (but not mushy) texture.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010090	Finishing Touches	Make a well in the middle, turn the heat down, and add the eggs. Stir gently and continuously until the eggs are fully cooked. Stir in the soy sauce and green onions just before serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010092	Prep Cauliflower	Shred cauliflower using the largest side of a grater OR by just pulsing some rough cut pieces in a food processor; the end product should resemble smallish grains of rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010093	Fill Muffin Pan and Bake	Fill and place tins on a cookie sheet and bake 20 to 25 minutes, until set.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010094	Mix Ingredients	Mix in the remaining ingredients.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010096	Preheat Oven and Prepare Muffin Pan	Preheat the oven to 350F. Spray the muffin tin generously with cooking spray to prevent sticking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010095	Whisk Eggs and Season	In a large bowl whisk the eggs, season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010098	Combine Ingredients	Add all of the ingredients to a mixing bowl and stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010097	Serve	Eat the avocado egg salad plain, topped on your favorite bread or on lettuce leaves.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010136	Combine Ingredients	Add quinoa, tomatoes, cucumbers and fresh herbs into a large bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010100	Assemble the Salad	In a large bowl (the largest one you have) combine the romaine, kale, chicken, and croutons and toss with the dressing to taste. If desired, top with the ramen egg, a fresh shaving of parm, the toasted cashews, and a lemon wedge for squeezing.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010102	Make the Croutons	While the chicken is cooking, rip or cut the bread into cubes. Melt the butter in a pan over medium heat with a touch of oil and add 1 clove minced garlic and the bread and toss everything to coat. Cook until the bread is crusty, golden, and crisp, stirring occasionally. Remove from the heat and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010099	Cook the Chicken	Toss the chicken in a bit of oil and 1 tsp garlic powder. Season with salt and pepper and air fry for 12-15 minutes at 400F or until the juices run clear. Remove from the air fryer and let rest.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010061	Reduce Vinegar	Meanwhile, bring the remaining 1/2 cup vinegar to a boil in a small saucepan over medium-high heat. Cook, without stirring, until reduced to about 3 tablespoons, about 10 minutes. Remove from heat (the mixture will thicken as it cools).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010057	Cook Clams and Mussels	Stir in clams and mussels. Reduce heat to low; cover, with a tight-fitting lid, and cook until the clams and mussels are just beginning to open, about 3-4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010143	Form Balls and Bake	Form the plantain mix into balls. You can choose to make large balls for a main course or small balls for a cocktail-party appetizer. Arrange the balls on the prepared sheet and brush with the oil. Bake for 15 minutes, until lightly golden and crisp.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010036	Prepare Potatoes	To make the boiled potatoes, it's a good idea to cook them separately in fresh water. If you use the same water, your potatoes will take on a purple color. Serving the pulpo a la Gallega with boiled potatoes is traditional, but optional.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010041	Beat Eggs and Sugar	Beat the eggs and the sugar with an electric mixer until the mixture becomes pale and thick and is well combined (6-8 minutes). Don't use the whisk attachment.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010136	Cook Meat	Heat 2 tablespoons oil in a wok over high heat until just starting to smoke. Add the meat in a single layer, cook undisturbed until well browned, about 1 minute, then stir-fry until just cooked through. Remove from the pan and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010003	Tomato Topping	Combine all tomato topping ingredients into a mixing bowl and fold together. Set aside and allow mixture to marinate for 30 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010036	Kneed and Rest the Dough	Press some flour between your palm- it should form a shape (& not crumble)  means oil is enough and well incorporated. Now, start adding water, little by little and mix to form a stiff dough. Dont overwork the dough and dont knead a soft dough. It should just come together and form a stiff dough. I used around 6 tablespoons of water here. Cover the dough with a moist cloth and let it rest for 40 minutes. I usually soak a paper towel in water and then squeeze out all the water and then cover my dough with that. While the dough is resting, start working on the filling.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824030900010101	Make the Dressing	Mix together the lemon juice, dijon, Worcestershire, minced garlic, anchovy paste, parmesan cheese, and Kewpie mayo. Taste and season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010103	Stir-fry Vegetables	Heat the remaining tbsp peanut oil in the wok. Stir-fry the broccoli, garlic and chilli for 2 minutes or until tender crisp. Add the cabbage and zucchini noodles. Stir-fry for 1 minute or until just tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010104	Cook Chicken	Heat 1 tbsp peanut oil in a large wok over high heat. Stir-fry half the chicken for 2-3 minutes or until golden. Transfer to a plate. Repeat with remaining chicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030900010105	Combine and Serve	Return the chicken to the wok along with the bean sprouts, cashews, soy sauce and sesame oil. Stir-fry for 1 minute or until combined. Serve sprinkled with coriander and extra chilli.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010106	Cook Onions	Melt butter in pot over medium-high heat. Add in onions and cook, stirring frequently until nearly soft, about 4 - 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010107	Add Cheese	Remove from heat. Stir in heavy cream then stir in cheddar and parmesan cheese, mixing until melted.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010108	Stir in Broth and Broccoli	While whisking, slowly pour in milk then chicken broth. Stir in broccoli.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010110	Cook to Thicken	Cook stirring constantly until mixture begins to thicken. Then reduce heat to low and allow to cook, stirring very frequently, until broccoli is tender, about 6 - 8 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010109	Season and Serve	Season with salt and pepper to taste. Serve warm with more cheddar if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010111	Add Garlic and Flour	Add in garlic and flour, and cook for about 1 minute, stirring constantly.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010113	Add Peas and Seasoning	Chuck in the frozen peas for the last few mins of cooking time. Take off the heat and sprinkle over the lemon juice, capers and parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010112	Coat and Cook Fish and Asparagus	Coat the fish in the flour, if using. Melt the butter in a large frying pan over low-medium heat and allow to bubble and turn light golden for a minute, then add the fish and asparagus and cook for about 10 mins, until fish is cooked and asparagus softened. During this time, regularly 'baste' the fish by spooning some of the butter sauce over the top of it to ensure it cooks evenly and soaks up the butter well. If at any point the pan is going dry, add a little more butter or some olive oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010114	Process Cauliflower	Add cauliflower into a food processor and pulse until the florets break down into fine pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010117	Serve	Divide the cauliflower grits among bowls, top with shrimp, and garnish with fresh parsley. Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010115	Cook Cauliflower Grits	Add 1 tablespoon butter to a saucepan over medium heat. Transfer processed cauliflower and add milk, 1 tablespoon of butter, salt, and pepper to taste. Simmer until soft and smooth, resembling grits.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010116	Cook Shrimp	Melt remaining butter in a skillet. Add shrimp, blackened seasoning, and cook until pink and just cooked through. Remove from heat, add parsley, lemon juice, and water to coat the shrimp.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010118	Prepare Peppers	Cut the tops off the peppers. Remove and discard the stems, then finely chop the tops; set aside. Scoop out the seeds and as much of the membrane as you can. Place in a zip-top bag in the refrigerator.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010120	Preheat Oven	When you're ready to make dinner, preheat the oven to 350F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010119	Cook Vegetables	Add the remaining tablespoon of olive oil to the pan. Add the onion and chopped peppers, and cook until they begin to soften, 3 to 4 minutes. Add the garlic and zucchini, and cook for another minute. Add the tomatoes and season with more salt and pepper. Cook until everything is heated through, then stir in the beef and rice. Taste and adjust the seasonings. Stir in 1 1/2 cups of the cheese. Allow the mixture to cool and store it in an airtight container in the refrigerator. Store the extra cheese in a small container in the refrigerator.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010121	Assemble and Bake	Place the peppers, cut-side up, in a baking dish just large enough to hold them upright. Fill the peppers with the rice mixture and top each with a sprinkle of the remaining 1/2 cup of cheese. Pour a small amount of water into the bottom of the baking dish. Cover with foil and bake for 30 minutes. Uncover and bake until the peppers are soft and the cheese is melted and lightly browned, 15 to 20 minutes more. Serve piping hot!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010122	Cook Beef	In a large skillet, heat 2 tablespoons of the olive oil over medium-high heat. Add the beef, season with salt and pepper, and cook, breaking up the lumps, until the meat is cooked through. Remove to a plate.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010123	Mix Wet Ingredients	In a small bowl, whisk together the almond milk, eggs, maple syrup, and vanilla.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010127	Cook Pancakes	Heat a non-stick skillet over medium-low heat. Brush the pan with a little olive oil and use a 1/4-cup measuring cup to pour the batter onto the pan. Cook the pancakes for 1 to 2 minutes per side, turning the heat to low as needed so that the middles cook without burning the outsides. Almond flour pancakes darken a little quicker than pancakes that use regular flour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010125	Serve	Serve with maple syrup.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010124	Combine and Adjust Batter	Pour the wet ingredients into the bowl with the dry ingredients and stir. If your batter is very thick, stir in more almond milk until it resembles the photos above. If it's too thin, sprinkle in a touch more almond flour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010126	Mix Dry Ingredients	In a medium bowl, whisk together the spooned and leveled almond flour, baking powder, and salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010130	Cook Chicken	In a large skillet, heat the oil over medium heat. Add chicken and sprinkle with taco seasoning. Stir until chicken is evenly coated in the spice mixture. If necessary, add 1 tablespoon of water to help distribute everything evenly. Cook just until chicken is warm. Taste and adjust seasonings, if necessary, remove from heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010129	Serve	Drizzle with creamy cilantro lime dressing, if desired. Serve immediately with lime wedges.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010132	Layer Ingredients and Roll	Layer salmon, cream cheese, and avocado on the rice, and roll it up tightly. Slice with a sharp knife, and enjoy right away with soy sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010135	Serve or Store	Serve immediately or add in your favorite proteins (chickpeas, chicken, steak, shrimp, etc. would all be delicious).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010134	Prepare Dressing	In a separate bowl, whisk together oil, lemon, salt and pepper. Pour dressing over salad ingredients and toss to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010178	Heat Oil	Add the oil to a large saucepan over low to medium heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010128	Assemble Bowls	To assemble the bowls, divide the rice, chicken, lettuce, beans, corn, tomatoes, cheese, and cilantro between 4 bowls. Top with guacamole (or avocado), Pico de Gallo (or salsa), pickled red onions, sour cream (or plain Greek yogurt), or your favorite toppings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010131	Prepare Seaweed	Place the seaweed on a bamboo mat, then cover the sheet of seaweed with an even layer of prepared sushi rice. Smooth gently with a rice paddle.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824030200010021	Enjoy	Happy Baking!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010140	Roll the Wrap	Carefully roll the wrap/tortilla up like a burrito, taking care to make it as tight as possible.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010146	Serve	Pour the pasta primavera into a large serving bowl or dish. Garnish with parsley, extra Parmesan cheese, and crushed red pepper flakes. Serve warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010063	Reduce Vinegar	Meanwhile, bring the remaining 1/2 cup vinegar to a boil in a small saucepan over medium-high heat. Cook, without stirring, until reduced to about 3 tablespoons, about 10 minutes. Remove from heat (the mixture will thicken as it cools).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010058	Stir in Flavorings	Stir in tomato paste, garlic, oregano and red pepper flakes until fragrant, about 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010144	Simmer Chicken and Potato	When the stock has boiled add the chicken and potato to the saucepan. Bring the stock back to the boil and then reduce the heat. Simmer for 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010147	Add Corn and Pumpkin	After 10 minutes, add the corn and pumpkin to the saucepan and continue to simmer for another 5 minutes then add the green beans. Cook for another 5 minutes or until the vegetables are tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010152	Add Broth	Pour the broth slowly all around the pan and jiggle the pan to get the rice into an even layer. (Do not stir the mixture going forward).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010038	Cook Octopus	Now you can either cook it over the stovetop or in your slow cooker. For the slow cooker method, add your octopus to your slow cooker and fill with enough water to cover it.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010045	Finish and Serve	When cooled, unmold and dust thickly with powdered sugar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010138	Cook Garlic and Greens	Wipe out the pan and heat remaining 2 tablespoons oil over medium until shimmering. Stir in the garlic, then immediately add the greens and stir-fry until just bright and beginning to wilt, 30 to 45 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010004	Bake Bruschetta	Bake bruschetta for 6 minutes. Flip and continue to bake for an additional 4 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010037	Prepare Samosa Dough	Start by making the samosa dough. To a large bowl, add flour, ajwain, salt and mix well. Add the oil and then start mixing with your fingers. Rub the flour with the oil until the oil is well incorporated in all of the flour. Do this for 3 to 4 minutes, you dont want to rush this step. Once incorporated,  the mixture resembles crumbs.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010138	Add Cucumber	Add a couple slices of the cucumber in the center of the wrap, followed by a slice of the sliced cheese, turkey breast, tomato slices, and avocado.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010065	Roast Beets	Preheat oven to 400 degrees F. Place a large piece of foil on a rimmed baking sheet; place beets in the center of the foil. Gather the sides of the foil up to make a packet; pour in 1/2 cup vinegar and seal the packet. Roast until the beets are very tender when pierced with a knife, about 45 minutes. Open the foil packet; let cool for 30 minutes.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010056	Add Liquids and Tomatoes	Stir in wine, diced tomatoes, vegetable stock, clam juice and bay leaf. Bring to a boil; reduce heat and simmer until flavors have blended, about 15 minutes; season with salt and pepper, to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010146	Prepare Corn and Pumpkin	While the chicken and potato are cooking cut 2 large pieces of pumpkin, remove the husk from the corn and cut the cob in half, and remove the ends from the green beans then slice them length ways.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010040	Season	Sprinkle on a little salt and a little bit of paprika. In Spain, they usually use a combination of a sweet and a hot paprika for pulpo a la Gallega.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010137	Prepare the Noodles	Place dried noodles in a large bowl and cover with hot water. Let soak while preparing the remaining ingredients. Separate noodles occasionally with hands. When ready, noodles will be white, limp and bouncy, almost soft to the bite. Pour off and discard all the water, fluff noodles with hands and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010001	Bruschetta Prep	Preheat oven to 350F. Brush a baking sheet with 1 tablespoon oil and set aside.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010038	Fill the Samosa	Pinch the pointed ends to make it a perfect cone shape. Fill the samosa with the potato filling, around 1 to 2 tablespoons. Dont overfill the samosa. Now again apply water all around the circumference of the cone as you have to seal it. Pinch the opposite side (side opposite to where you pinched to form the cone) to form a plate (see picture #23). Now pinch the edges and seal the samosa.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010139	Assemble the Wrap	To assemble the wrap, lay the whole wheat wrap or tortilla on a flat, clean surface.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010137	Cut and Enjoy	Lay on its seem and then slice the wrap in half and enjoy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010141	Spread Hummus	Gently spread hummus around the wrap, leaving approx.  inch around the edge all around.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010142	Prepare the Sauce	Place the skillet back on the stove. Melt the butter over medium heat. Add the shallot and garlic and cook for 2 minutes. Stir in the lemon zest and vegetable broth. Simmer until the broth reduces by half, about 4 to 5 minutes. Stir in the heavy cream and 2 tablespoons of lemon juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010144	Combine Pasta and Vegetables	Stir the peas into the pot with the pasta. Stir in the cooked vegetables. Pour the lemon cream sauce over the pasta and vegetables and stir until well combined. Stir in the Parmesan cheese and remaining tablespoon of fresh lemon juice. Gently stir in the tomatoes and basil. Season with salt and black pepper, to taste.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010145	Cook the Pasta	Bring a large pot of water to a boil. Add salt and pasta to boiling water. Cook for 11 minutes, stirring occasionally. Drain well. Pour the pasta back into the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010143	Saut Vegetables	In a large skillet, heat the olive oil over medium high heat. Add the asparagus, peppers, and broccoli. Saut for 2 to 3 minutes, stirring occasionally. Add in the zucchini and cook for 1 to 2 minutes or until vegetables are tender, but still crisp. Season vegetables with salt and pepper, to taste. Transfer the vegetables to a large plate or bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010149	Prepare the Pesto	Prepare the pesto per recipe instructions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010150	Make the Balsamic Glaze	Bring the vinegar and honey to a simmer in a small pot over medium heat until reduced by 1/2. Do not boil, turn to medium low if needed. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010148	Grill the Sandwich	Heat a panini grill or grill pan and butter the outside of the sandwich. Grill until golden and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010147	Spread Pesto and Assemble Sandwich	Spread pesto on both pieces of bread. Place arugula, basil, tomatoes, mozzarella and a sprinkle of salt and pepper. Drizzle a little balsamic glaze and top with the other piece of bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010153	Tacos Step 2	In a large nonstick skillet over medium-high heat, heat vegetable oil. Remove cod from marinade; season both sides of fish with salt and black pepper. Arrange fish in skillet flesh side down. Cook, turning once, until opaque and cooked through, 3 to 5 minutes per side. Let rest 5 minutes before flaking with a fork.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010154	Tacos Step 1	In a medium shallow bowl, whisk olive oil, lime juice, paprika, chili powder, cayenne, and cumin. Add cod and toss until coated. Let marinate 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010155	Corn Slaw Step 2	Cover and refrigerate until ready to serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010151	Corn Slaw Step 1	In a large bowl, whisk mayonnaise, lime juice, cilantro, and honey. Stir in cabbage, corn, and jalapeo; season with salt and black pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010152	Tacos Step 3	Top tortillas with fish, corn slaw, and avocado. Squeeze lime juice over and drizzle with sour cream.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010158	Season and Serve	Remove the thyme bundle and season to taste. Serve topped with the parsley, red pepper flakes, and Parmesan, if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010157	Cook Vegetables	Heat the olive oil in a large pot over medium heat. Add the onion, carrots, celery, kale stems, cumin, salt, and several grinds of pepper, and cook, stirring occasionally, for 8 minutes, or until the vegetables begin to soften.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010156	Simmer Soup	Stir in the garlic, tomatoes, lentils, vinegar, thyme, and broth. Cover and simmer for 25 to 30 minutes, or until the lentils are tender. Add the kale leaves and cook for 5 minutes, or until wilted.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010159	Grill the Sandwich	Heat a grill or grill pan to medium-high heat. Grill the Cuban sandwich for 5-6 minutes per side, pressing it down very firmly with another pan or spatula to "press" it tightly, until warmed through and bread is nice and crispy.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010161	Prepare Bread	Slice the bread in half lengthwise. Butter the bottom half with 2 tablespoon softened butter. Spread the mustard on the top half.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010160	Serve	Remove, slice and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010162	Butter and Grill	Slather the remaining butter over both sides of the sandwich.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010163	Layer Ingredients	Layer the sandwich with roast pork, sliced ham, Swiss cheese and dill pickles. Top the Cubano with the top bread slice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010164	Blend Ingredients	In a high-speed blender, place the chickpeas, tahini, olive oil, lemon juice, garlic, and salt. Use the blender baton to blend until very smooth, adding water as needed to blend, and/or to reach your desired consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010165	Garnish and Serve	Transfer to a serving plate, top with desired garnishes and serve with warm pita and veggies, as desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010166	Make Dressing	Meanwhile, make the dressing. In a medium bowl, whisk together the olive oil, lemon juice, pomegranate molasses, honey, sumac, garlic, and salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010167	Preheat and Prepare	Preheat the oven to 425F and line a baking sheet with parchment paper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010169	Bake Pita	Place the pita on the baking sheet, drizzle with olive oil, and sprinkle with salt. Toss to coat and spread evenly on the baking sheet. Bake for 13 to 20 minutes, or until crisp, tossing halfway through.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010168	Assemble Salad	Assemble the salad. In a large bowl, place the romaine, cucumbers, tomatoes, radishes, onion, half the toasted pita, and half the mint and parsley. Pour on half the dressing and toss. Season to taste, adding more dressing as desired, and top with the remaining pita, mint, and parsley. Sprinkle with sumac and serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010170	Cook Garlic	Stir in the garlic and cook just until fragrant. This will only take 30 to 45 seconds.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010172	Add Anchovies and Capers	Now, add the anchovies and capers and cook for 1 to 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010174	Cook Pasta	Drop the dried pasta into a large pot of boiling salted water and cook for 7 to 8 minutes or until al dente.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010173	Add Chiles	Next, stir in the chiles and saut for 1 to 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010175	Combine Pasta and Sauce	Drain the pasta and add it to the saucepan and toss it together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010171	Add Olives and Seasonings	Finish the sauce by stirring in the olives, parsley, salt, and pepper. Set it to the side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010176	Adjust Seasonings	Adjust the seasonings with salt and pepper, and serve in a bowl with additional fresh chopped parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010181	Step 1	Toss eggplant with salt and place in a colander set over a bowl. Let sit, about 30 minutes. Rinse and pat dry.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010190	Prepare Flour Mixture	In a large bowl, whisk together the flour, cornstarch, baking powder, oregano, black pepper, and cayenne.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010186	Coat Calamari	Toss the calamari in the flour mixture to coat evenly. Put the coated calamari in the colander.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010064	Slice Beets	When the beets are cool enough to handle, peel them, then slice very thinly with a knife or a mandoline. Arrange the sliced beets, overlapping slightly, on a platter.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010061	Cook Onion and Fennel	Melt butter in a large stockpot or Dutch oven over medium high heat. Add onion and fennel. Cook, stirring occasionally, until tender, about 8 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010145	Boil Stock and Water	Pour the stock and water into a large saucepan, add paprika, coriander, oregano and pepper, and then bring the stock to boil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010151	Rest and Serve	Remove pan from heat and cover pan with a lid or tinfoil. Place a kitchen towel over the lid and allow to rest for 10 minutes. Garnish with fresh parsley and lemon slices. Serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010042	Prepare Pan	Increase the temperature to 350F/180C and butter a 9 inch/23 cm springform pan then line the base with parchment paper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010139	Marinate Meat	Mix the meat with the soy sauce and let stand at room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010005	Oil and Butter Mixture	Stir together remaining oil and melted butter.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032000010042	Shape the Samosa	Once the dough has rested, give it a quick knead. Then divide the dough into 7 equal parts of around 58-60 grams each. Start working on a piece of dough, keep the remaining dough balls covered at all times with a moist cloth else the dough will dry out. Roll one dough ball into a circle-oval kind of shape, around 6-7 inches in diameter and then cut it into two parts. Take one part and apply water on the straight edge/side. I usually mix some flour with water so that it forms a nice glue. Now bring the two ends of the straight edge together and pinch them to form a cone. See picture (#20) for a better idea.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010177	Add Tomatoes	Pour in the tomatoes and stew over low heat for 3 to 4 minutes to infuse some flavors.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010180	Step 2	Heat 2 tablespoons olive oil in a large skillet over medium heat. Add celery; cook, stirring often, until softened, about 4 minutes. Add onion and garlic; cook and stir until onion is soft and lightly golden, about 5 minutes. Transfer the mixture to a bowl using a slotted spoon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010066	Toss and Arrange	Toss arugula with oil, salt and pepper in a medium bowl; arrange on top of the beets. Sprinkle with goat cheese and walnuts; drizzle with the balsamic reduction.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010060	Serve	Serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010148	Cook Rice	In the last 5 minutes, cook the rice in the microwave according to packet directions, and chop the parsley and coriander.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010047	Bake Cake	Bake for 30-35 minutes until the surface is browned and when a skewer is inserted it comes out clean.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010141	Combine and Finish	Raise the heat to high. Add the noodles, spreading them around the pan, then tossing and separating them with a wok turner, tongs or both. When noodles are sizzling, add the sugar and 3 tablespoons sauce, and toss to coat and cook through. Keep cooking, leaving noodles undisturbed for 20 to 30 seconds at a time, so they sear and caramelize.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010006	Assembly	Top each piece of bruschetta with a couple spoonfuls of the tomato mixture, top with basil leaves and serve.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032400000002	Make the sauce	Heat oil in a large, heavy bottomed pot over medium heat. Add sausage, if using, and cook, stirring occasionally, until its starting to brown but not yet crisp, about 5 minutes. Add onion and garlic and season with salt and pepper. Cook, stirring occasionally, until the onion is totally softened and translucent (without letting it brown), 8 to 10 minutes. Add tomato paste and continue to cook, stirring until the tomato paste has turned a deeper brick red color, tinting the oil and onions a fiery orange color, about 2 minutes. Using your hands, crush the whole tomatoes into smaller, bite-size pieces and add them and the crushed tomatoes, stirring to scrape up any bits from the bottom of the pot. Fill one of the tomato cans halfway with water and add it to the pot. Season with salt and pepper. Bring to a simmer and cook, stirring occasionally, until the tomato sauce has thickened and flavors have come together, 20 to 30 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010179	Step 3	Heat remaining 2 tablespoons olive oil in the skillet. Add eggplant and cook, stirring constantly, until lightly browned, 5 to 7 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010189	Serve	Transfer the fried calamari to a serving plate and finish with a squeeze of lemon juice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010184	Marinate Calamari	Add the calamari rings to the milk mixture and refrigerate for 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010067	Roast Beets	Preheat oven to 400 degrees F. Place a large piece of foil on a rimmed baking sheet; place beets in the center of the foil. Gather the sides of the foil up to make a packet; pour in 1/2 cup vinegar and seal the packet. Roast until the beets are very tender when pierced with a knife, about 45 minutes. Open the foil packet; let cool for 30 minutes.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010071	Bake	Place on baking sheet, bake for 5-7 minutes at 400, or until cheese is melted (times may vary).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010062	Chill Mozzarella Sticks	Place a wire cooking rack on a baking sheet and place breaded mozzarella sticks on rack. Once all sticks have been dipped, transfer to the freezer and chill for at least one hour. If you are chilling for longer than 1 hour, after 1 hour remove from freezer and place in an airtight container then return to freezer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010065	Fry Mozzarella Sticks	While sticks are still in the freezer, fill a medium-sized saucepan 3" deep with vegetable oil. Attach a thermometer to the side and make sure it is suspended about halfway into the oil (and that it is not touching the bottom of the pot). Heat oil over medium heat until you reach a temperature of 350F (175C) then remove sticks from freezer. Fry sticks, 2 at a time, until golden brown (about 1 minute) then remove to a paper towel-lined plate to cool. Make sure oil returns to temperature before frying next batch. Enjoy while still warm dipped in warmed marinara sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010066	Coat Sticks	Working with one at a time, dip the stick in the flour and shake off any excess flour. Then dip in the beaten egg and let any excess drip off. Finally, dip in panko crumb mixture, making sure the entire cheese stick is coated with panko.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010072	Adjust Consistency	The consistency of this salsa varies depending on the water content of the tomatoes. If it's too watery, strain half to remove some of the liquid. Combine the chunky strained mixture with the remaining salsa. If you still prefer a chunkier texture, strain out more of the liquid to reach your desired consistency.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010075	Prepare Veggies	Wash, cut and prepare your veggies. Be sure to note the height of your mason jar, and cut your veggies 1/2 inch to 1 inch shorter than the mason jar. That way they will fit with the lid on.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010078	Form Balls	Once chilled, remove from the fridge, use a cookie scoop to form the mixture into balls and roll with your hands.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010149	Serve	Divide the rice between 2 bowls. Use a slotted spoon to remove equal portions of the chicken, potato, pumpkin, corn and beans into each bowl, then pour over stock. Sprinkle with fresh parsley and coriander and serve with a slice of fresh bread.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010051	Shred Chicken	After an hour of simmering, remove the chicken from the pot. Using two forks, pull the meat from the bone and shred it slightly. Season the broth with salt. Begin with one teaspoon and add more to your liking. I used 2-3 teaspoons. The flavor of the broth will really pop once the salt is added.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010054	Add Noodles and Chicken	Add the noodles to the pot, turn the heat up to high, and boil the noodles until tender (about 7 minutes). Return the shredded chicken to the pot. Taste and season again with salt if needed (I didnt need to). Serve hot!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010055	Saut Onions	Add the oil, butter, and onion to a soup pot over medium-high heat. Saut the onion for 5-7 minutes or until it's lightly browned.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010144	Add Meat	Add the meat back to the pan, along with any liquids in the dish, and toss everything together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010007	Brush Baguette	Brush each slice of baguette with the butter and oil mixture on both sides.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032400000001	Make the lasagna	Heat oven to 375 degrees and set a large pot of salted water to boil. Set aside 1 cup mozzarella. In a medium bowl, combine remaining mozzarella, ricotta, 1 cup Parmesan, and cream; season with salt and pepper and set aside. Cook lasagna noodles in the large pot of salted boiling water until just softened (before they are even al dente), about 4 minutes. Drain and separate any noodles that are trying to stick together, slicking them with a bit of olive oil to prevent them from sticking further. Spoon a bit of sauce on the bottom of a 3-quart baking dish and top with a layer of noodles, avoiding any heavy overlap. Top with about 1  cups of sauce, and dollop  of the cheese mixture over. Top with another layer of noodles and repeat three more times, ending with the last of the noodles (depending on size of the noodle/shape of the baking dish, you may have a few extra noodles) and the last of the sauce. Top with reserved 1 cup mozzarella and more Parmesan, if you like. Cover loosely with aluminum foil and place baking dish on a foil-lined rimmed baking sheet (to prevent any overflow from burning on the bottom of your oven). Bake until pasta is completely tender and cooked through and sauce is bubbling up around the edges, 30 to 40 minutes. Remove foil and increase temperature to 450 degrees. Continue to bake until lasagna is golden brown on top with frilly, crispy edges and corners, another 15 to 20 minutes. Let cool slightly before eating.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032400000004	Serve the Duck	Take the duck out of the oven and leave it to rest on the counter for 15 minutes. While waiting, prepare the sauce. Add sweet bean sauce and sugar to a pan. Add transfer to a small serving dish. Steam the pancakes for 3 minutes to warm up if they're cold. Slice the duck into pieces. When eating, spread a little sauce over a pancake, put the duck, scallions, and cucumber in the middle. Wrap into a cylinder and enjoy.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010182	Step 5	Season caponata with vinegar, sugar, salt, and black pepper. Transfer to a serving bowl and garnish with parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010187	Fry Calamari	Fry calamari rings in the hot oil until golden brown. Remove from the oil and arrange on the paper towel on your prepared wire rack.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010069	Assemble Salad	Toss arugula with oil, salt and pepper in a medium bowl; arrange on top of the beets. Sprinkle with goat cheese and walnuts; drizzle with the balsamic reduction.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010076	Serve	Slice with pizza cutter and enjoy!	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010064	Prepare Flour	Pour all-purpose flour in yet another shallow bowl.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010067	Prepare Eggs	In a separate, shallow bowl, crack 2 large eggs and beat with a whisk or the tines of a fork until scrambled.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010070	Add Remaining Ingredients	Add the tomatoes, jalapeno, cilantro, lime juice, lime zest, salt, cumin, and sugar. Pulse until combined but still chunky.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010074	Assemble Jars	Fill jars with approximately 3 tablespoons hummus, then veggies. Hummus makes up to 6 mason jar servings. Store for up to 5 days.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010076	Mix Ingredients	Place all the ingredients together in a large bowl and mix with a spoon or spatula until well incorporated.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010079	Enjoy or Store	Enjoy immediately or refrigerate for 7-10 days.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010080	Mixing Ingredients	All you need to do is place a big mixing bowl on your scale, press tare (to zero the measurement), pour in an ingredient until it reaches the correct weight, tare it, and repeat with the next ingredient.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010150	Prepare Chicken and Potato	Butterfly the chicken fillet, cut into 4 pieces and sprinkle the chicken with salt on both sides. Roughly cut the potato into quarters leaving the skin on.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010153	Add Rice and Parsley	Add chicken pieces, 2 tablespoons chopped parsley and rice to the pot. Cook for 1 minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010052	Saut Onion and Garlic	Dice the onion and mince the garlic. Add the onion, garlic, and olive oil to a large pot and saut over medium heat for about 5 minutes, or until the onions are soft and transparent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010050	Simmer Chicken	Pull the skin and any excess fat from the chicken breasts. Add the breasts to the pot along with the bay leaf, basil, parsley, thyme, some freshly cracked pepper, and 8 cups of water. Cover the pot, bring it to a boil over high heat, then reduce the heat to low and simmer for one hour. Make sure the pot continues to simmer for the whole hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010145	Add Sauce	Add a few dashes of black soy sauce, and taste for doneness and seasoning. Keep cooking, adding more sugar, black soy sauce or pad see ew sauce a little at a time, until the dish is very savory and a little sweet. Add hot water, 1 tablespoon at a time, if noodles are not quite soft.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010009	Prepare Ingredients	Gather all ingredients, rinse rice, peel and slice ginger, and prepare scallions and sesame seed oil or soy sauce for garnish and serving.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032400000003	Prepare the Duck	Pat dry the duck with kitchen paper then rub the salt over the skin and the cavity. Put the duck over a wire rack with a tray underneath to collect any drips. Leave to rest on the counter for 1 hour. Bring about 1 1/2 liters of water to a boil, then gently pour it over the entire duck skin (remember to flip over and do the other side). In a bowl, mix maltose with hot water and vinegar until completely dissolved. Brush a layer of the mixture over the duck skin. Leave to rest in the fridge for 1 hour then brush another layer. Keep the duck refrigerated uncovered for 24 to 48 hours.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010183	Step 4	Stir in celery mixture, tomatoes, olives, capers, tomato paste, and oregano. Bring to a boil; reduce heat to low and simmer uncovered until caponata is thickened, about 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010185	Prepare Baking Setup	Turn your oven on a low 150 degrees F. Prepare a large sheet pan and set a wire rack on top. Top the wire rack with paper towel.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010188	Prepare Milk Mixture	In a medium bowl, stir 1 teaspoon Diamond Crystal kosher salt in 1/2 cup milk.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010192	Heat Oil	Heat 4 inches of grape seed oil in a small cooking pot to between 350 and 365 degrees F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010191	Slice Calamari	Slice the calamari tubes into 3/4-inch thick rings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010194	Cook Freekeh	Add frik into the pan and cook for 10 to 15 minutes over low to medium heat, stirring regularly to prevent it from sticking to the bottom of the pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010193	Add Vegetables and Chickpeas	Add the garlic, scallions, tomatoes, and celery to meat. Add half the cilantro leaves and tomato paste. Add the chickpeas, stir and saut over low heat covered for about 5 minutes, stirring occasionally.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010195	Check Liquid Amount	Open the pressure cooker and check the amount of liquid. Add a little boiling water if necessary.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010199	Add Spices and Water	Add the spices, salt, bay leaf, mint and hot water. Increase heat to bring to a boil, then reduce heat to medium.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010198	Cook in Pressure Cooker	Lock the pressure cooker and cook on medium heat for 1 hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010196	Brown the Meat	In a pressure cooker, brown the meat in olive oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010197	Finish with Cilantro	Turn off the heat and add remaining cilantro.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010200	Broil Poblanos	Broil poblanos for 5 minutes, or until the skin is blackened and blistered. Carefully flip them over and broil for another 5 minutes, or until the skin is blackened and blistered.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010202	Secure the Opening	Gently close the opening of the peppers and secure it shut with 1-3 toothpicks. Use as many as you need to ensure that the cheese won't ooze out during the frying process. Set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010203	Coat the Peppers with Batter	Place the flour and salt into a separate shallow bowl or plate. Mix together to combine. Gently roll the stuffed peppers in the flour mixture, then give them a gentle tap to remove any excess. Then dip them in the egg batter and gently place them in the hot frying oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010204	Make the Batter	Separate the egg whites from the yolks into two separate bowls - the whites into a large mixing bowl and the yolks into a small bowl. Using an electric hand mixer, beat the egg whites until stiff peaks form. While continuing to beat the egg whites on low, add in the egg yolks one at a time until all of them are fully mixed in. The batter should be light, fluffy and smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010201	Roast the Peppers	Line a large baking sheet with aluminum foil and place poblano peppers on top. Set your oven rack directly underneath the broiler and turn the broiler on.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010206	Transfer to Baking Sheet	Transfer the peppers to the lined baking sheet to drain off any excess oil.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010209	Cut a Slit into Peppers	Cut a small slit down the middle of the peppers with a knife. (If you don't want the peppers too spicy, you can remove some of the seeds. I like to leave them in as poblano peppers aren't typically super spicy to me, but that's personal preference.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010205	Fry the Chile Rellenos	Fry the peppers for 3-5 minutes per side, until the batter is golden brown and crispy. Try not to overcrowd the peppers in the pan - I usually fry 2 at a time depending on the pan I'm using.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010212	Serve Immediately	Serve immediately serve chile rellenos on a plate with some salsa, freshly chopped cilantro and some cotija cheese. (Don't forget to remove the toothpicks when you first cut into the peppers! You can try to remove them before serving onto plates, but I find it easier to remove them when you first cut into them.)	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010210	Peel the Peppers	Peel and rub off as much of the loose skin on the peppers as possible. It doesn't have to be perfect, just as much as you can.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010207	Prepare for Frying	Heat the oil frying oil in a large saucepan or deep skillet over medium-high heat. Line a baking sheet with paper towels and set aside. While oil is heating up, prepare the batter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010208	Remove and Cover	Remove them from the oven and loosely cover the baking sheet with aluminum foil or plastic wrap to keep in some of the heat and help them steam. Let them sit for 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010211	Stuff the Peppers	Carefully stuff the peppers with the cheese. The peppers will be extra fragile because of the roasting process and may tear - that's okay. Just do the best you can.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010215	Saute Onions and Garlic	Saute the remaining chopped onion and garlic in oil until translucent.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010217	Cook Meat	Place the meat in a large saucepan and just cover with lightly salted water. Add 1/2 chopped onion, the 2 cloves peeled garlic, pepper, cumin, and oregano. Bring to a boil over medium heat, skim off any foam that rises, reduce heat, cover and simmer for 45 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010213	Prep Ingredients	Prepare the onion, peel the garlic, chop the onion, peel and chop the garlic cloves, chop the green chilies and jalapenos if you are using them and get the hominy drained and rinsed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010214	Cook Ancho Chilies	Boil ancho chilies in a separate small pot for the garnish part.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010218	Add Spices	Add the remaining spices, stir for a minute.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010216	Prepare Broth	Remove meat and broth, reserving both.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010220	Final Cooking	If necessary, cook for up to an additional 60 minutes until the chilies and onions are well blended into the broth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010221	Cut and Add Pork	Cut the reserved pork into 1 inch cubes and add to the pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010219	Combine Ingredients	Stir in the canned hominy, pork broth, green chilies and jalapenos (optional). Cook at a simmer, covered, for 45 to 60 minutes until the meat and hominy are tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010222	Soak the Corn Husks	Soak the corn husks in a bowl of very hot water for 30 minutes or until softened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010227	Prepare Desired Fillings	Prepare desired fillings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010225	Place Filling and Fold	Place 1-2 tablespoons of desired filling in a line down the center of the dough. Fold in the other long side, overlapping the first (like folding a brochure). Fold the bottom of the husk up.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010229	Assemble the Tamales	Lay a corn husk, glossy side up, on the counter with the wide end at the top. Scoop about 1/4 cup of dough onto the top, center of the corn husk. Lay a piece of plastic wrap over the dough and use your hands to press and spread the masa into a thin layer, about 1/4 inch thick. Keep the dough spread along the top half of the corn husk to allow plenty of room to fold the bottom husk up, when it's time.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010226	Cook on the Stove-top or Instant Pot	Add water to the bottom of your steamer or instant pot. (About 1 cup for IP and a few cups for a steamer potdon't fill above the steamer rack.) Lay a few extra corn husks on the bottom rack to keep the tamales from falling through and any boiling water from directly touching them.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010070	Prepare Beets	When the beets are cool enough to handle, peel them, then slice very thinly with a knife or a mandoline. Arrange the sliced beets, overlapping slightly, on a platter.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010072	Add Cheese	Sprinkle on the shredded cheese.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010063	Combine Dry Ingredients	Pour crushed panko into a shallow dish and add Italian seasoning, parsley, garlic powder, pepper, and salt and stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010068	Prepare Panko Crumbs	Place panko crumbs in a Ziploc bag and use a rolling pin or mallet to crush until you have fine crumbs.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010069	Cut Mozzarella	If using a mozzarella block, cut widthwise into 15 sticks.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010071	Combine Onion and Garlic	In a food processor, combine the onion and garlic. Pulse until well chopped.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010073	Blend Ingredients	Add all ingredients except veggies to a food processor until smooth. Add 2 tablespoons of water for thinner and smoother hummus.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010077	Chill	Cover the bowl and place in the refrigerator to set for half hour.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010154	Prepare Ingredients	Add olive oil to a skillet over medium heat. Add the onion, bell peppers and garlic and cook until onion is translucent. Add chopped tomato, bay leaf, paprika, saffron salt and pepper. Stir and cook for 5 minutes. Add white wine and cook for 10 minutes. Taste and add salt if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010053	Add Carrots and Celery	While the onion and garlic are sauting, wash and slice the carrots and celery. Add them to the pot and continue to saut for a few minutes more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010056	Simmer Soup	Increase the heat to high and bring the soup to a boil. Reduce the heat and simmer for 8 minutes, covered, with the lid slightly ajar.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010146	Finish and Serve	When the noodles have absorbed all the liquid and the flavors are balanced, serve immediately.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010010	Simmer Rice	In a large pot, add stock, rice, salt, and ginger. Bring the mixture to a boil, then reduce the heat to a low simmer. Stir occasionally so that the rice doesn't clump or stick at the bottom.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824032400000005	Roast the Duck	One hour before roasting, take the duck out of the fridge to bring it back to room temperature. Put all the stuffing ingredients into the cavity. Use toothpicks or skewers to seal the openings of the cavity. Preheat a fan-assisted oven, aka convection oven, at 200C/390F (or 220C/425F if using a conventional oven). Put the duck over the middle rack of the oven with the breast side facing up. Place a roasting tray at the bottom of the oven to collect any dripping fat during roasting. Leave to cook for 15 minutes. Then lower the temperature to 180C/350F (or 200C/390F if using a conventional oven). Use aluminium foil to cover the tip of the wings and the end of the legs. Continue cooking for a further 60 minutes or so. Check the doneness by inserting an instant-read thermometer into the thickest part of the duck. The temperature should be no lower than 74C/165F.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010232	Taste if the Tamales are Done	Remove one and try to pull the husk off. If the husk pulls away cleanly from the tamal they're done. If the dough is still sticky or wet looking, cook them for 5-10 minutes longer and try again.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010228	Tying Tamales (Optional)	You don't have to tie a corn husk string around the tamalesit does take more time and they will hold together without it. However, if you're making multiple fillings, tying ones of a certain kind can help to identify them.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010235	Simmer Pork	Stir in onion, garlic, lime juice, chili powder, oregano, and cumin. Pour in chicken broth; bring to a boil. Reduce heat to medium-low, cover, and simmer until pork is very tender, about 2 1/2 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010068	Reduce Vinegar	Meanwhile, bring the remaining 1/2 cup vinegar to a boil in a small saucepan over medium-high heat. Cook, without stirring, until reduced to about 3 tablespoons, about 10 minutes. Remove from heat (the mixture will thicken as it cools).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010082	Melt Chocolate	Put the semisweet and white chocolates into 2 separate heatproof medium bowls. Fill 2 medium saucepans with a couple inches of water and bring to a simmer over medium heat. Turn off the heat; set the bowls of chocolate over the water to melt. Stir until smooth. Alternatively, melt the chocolates in a microwave at half power, for 1 minute, stir and then heat for another minute or until melted.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010085	Arrange and Roast Chickpeas	Arrange on a baking sheet in a single layer and roast for about 35 to 45 minutes, shaking the pan every ten minutes. All ovens are different so make sure they don't burn. They will be golden brown and crunchy on the inside when done, not moist.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010094	Mix Ingredients	Mix the peanut butter with the honey in a bowl	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010156	Cook Rice	Bring mixture to a boil. Reduce heat to medium low. Give the pan a gentle shake back and forth just once or twice during cooking. (We don't ever stir the rice, so that a crispy crust forms at the bottom, called a socarrat).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010057	Blend and Season	Blend the soup (I like to use an immersion blender) until it's smooth (you may want to let it cool a little bit first). Stir in the cream and basil and season with salt & pepper as needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010147	Make Ricotta Filling	In a large bowl, stir together the ricotta, garlic, lemon zest, salt, and several grinds of pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010150	Preheat Oven and Prepare Baking Sheet	Preheat the oven to 425F and line a baking sheet with parchment paper. Oil a 9x13-inch baking dish.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010157	Prepare Egg Mixture	Place the eggs, milk, salt and pepper into a mixing bowl and whisk together until beaten. Pour this mixture over the other ingredients in the pie crust.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010162	Prepare Masala Sauce	Drizzle the remaining 1 1/2 tablespoons of oil to the pan and cook the remaining paneer. Be careful as you add the paneer to the pan, as it will splatter. Save any leftover yogurt marinade. You will add it to the sauce later. Transfer the cooked paneer to a pan.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010008	Simmer Congee for 1 Hour	Simmer the congee for about 1 hour or until the congee is thickened and creamy. Add salt to taste.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010223	Add the Broth	Add the broth, little by little to form a very soft dough. Beat on high speed for several minutes. The dough should spread like creamy peanut butter and be slightly sticky. Cover the mixing bowl with a damp paper towel, to keep the dough from drying out.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010239	Serve	Serve hot and enjoy!	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010073	Prepare Pita	Brush on a little olive oil on the pita.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010077	Add Cheese	Sprinkle on the shredded cheese.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010083	Dip Strawberries	Once the chocolates are melted and smooth, remove from the heat. Line a sheet pan with parchment or waxed paper. Holding the strawberry by the stem, dip the fruit into the dark chocolate, lift and twist slightly, letting any excess chocolate fall back into the bowl. Set strawberries on the parchment paper. Repeat with the rest of the strawberries. Dip a fork in the white chocolate and drizzle the white chocolate over the dipped strawberries.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010155	Add Seafood	Cook for about 15-18 minutes (uncovered), then nestle the shrimp, mussels and calamari into the mixture, sprinkle peas on top and continue to cook (without stirring) for about 5 more minutes. Watch for most of the liquid to be absorbed and the rice at the top nearly tender. (If for some reason your rice is still not cooked, add  cup more water or broth and continue cooking).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010058	Add Garlic and Tomatoes	Stir in the garlic and Italian seasoning, followed by the tomatoes and chicken broth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010149	Roast Vegetables	Place the mushrooms, red pepper, zucchini, and onion on the baking sheet. Drizzle with olive oil, sprinkle with salt and pepper, and toss to coat. Spread evenly on the baking sheet and roast for 20 to 25 minutes, or until tender and browned around the edges. Reduce the oven temperature to 400F.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010152	Cook Noodles	Meanwhile, cook the noodles. Bring a large pot of salted water to a boil and prepare the lasagna noodles according to the package instructions, cooking until al dente. Drain and toss with a drizzle of olive oil to prevent sticking.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010155	Preheat Oven and Prepare Baking Sheet	Pre-heat the oven to 425 degrees. Line a heavy baking sheet with aluminum foil and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010158	Assemble Quiche	Sprinkle the shredded Mozzarella cheese across the bottom of the pie crust and top with the wilted spinach. Sprinkle the crumbled Feta over top of the spinach.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010159	Saut Onions and Spices	In a separate large saut pan, add another 2 tablespoons of safflower oil over medium heat. Add the onions and 1/2 teaspoon salt and cook for 5 minutes. Stir frequently to prevent the onions from burning. Add the garlic, coriander, paprika, garam masala, turmeric, black pepper, and remaining teaspoon of salt to the skillet. Cook for 30 seconds and coat the onions with the spices.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010164	Combine Sauce Ingredients	Add the tomatoes, sugar, and water, and reduce the heat to medium-low. Cover the pan, and let everything simmer for 10 minutes. Remove the lid and add the heavy cream, leftover yogurt marinade, and cayenne pepper. Stir to combine.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010011	Serve with Ingredients	Serve the congee hot with scallions, sesame seed oil, and soy sauce.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010231	Steamer or Instant Pot Cooking	For steamer: Bring water to a boil (in Mexico they would often place a coin at the bottom of the steamer and when the coin started to tap in the pot you knew there was boiling.) Once boiling, reduce to a simmer and steam for 45 minutes to 1 hour, or longer. Check them after 45 minutes. For Instant Pot: Cook on Manual/High Pressure for 25 minutes. Allow pressure to naturally release for 10 minutes, and then quick release.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010238	Preheat Oven	Preheat the oven to 400 degrees F (200 degrees C).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010074	Add Herbs and Toppings	Sprinkle on pinches of desired herbs and spices, and add any toppings you'd like.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010081	Set Chocolate	Set the strawberries aside until the chocolate sets, about 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010101	Combine Ingredients	Place chia seeds, honey or maple syrup (for vegan option), vanilla and liquid of choice in a jar with a lid.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010157	Garnish Preparation	Finely chop 1/4 of the cucumber and reserve for garnish.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010060	Finish with Barley and Season	Discard bones and herb sachet. Add barley, reserved vegetables, and fish sauce, if using, and simmer until barley and vegetables are tender, about 30 minutes. Season with salt and pepper. If soup is too dry, top up with water to achieve desired consistency. Serve, garnishing with parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010151	Assemble Lasagna	Spread 1 cup of the marinara sauce at the bottom of the prepared baking dish. Top with a layer of noodles, followed by half the ricotta mixture. Spread the ricotta in an even layer, then arrange half the spinach evenly on top. Top with half the vegetables and dot with  cup of the remaining marinara sauce. Repeat with another layer of noodles, followed by the remaining ricotta, spinach, vegetables, and another  cup sauce. Top with the remaining noodles.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010148	Add Cheese and Bake	Spread the remaining  cup marinara over the pasta, then evenly sprinkle with the mozzarella and pecorino cheeses. Bake in the 400F oven for 30 minutes, or until the cheese is browned and bubbling. Let stand for 20 minutes before garnishing with fresh basil or parsley, slicing, and serving.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010154	Prepare Pie Crust	Place the frozen pie crust on the baking sheet and use strips of aluminum foil to loosely cover the outside edges of the crust.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010156	Bake Quiche	Place the baking sheet with the quiche on it into the oven and bake for 15 minutes at 425. Remove from the oven and reduce the heat to 350 degrees. Remove the strips of aluminum foil from the edges of the pie crust and place back in the oven. Bake for another 25 minutes or until an inserted toothpick comes out clean. Allow to cool for a few minutes before slicing and serving. Cut into 8 slices and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010160	Pan Fry Paneer	Once the paneer has been marinated, pan fry the paneer. Heat a nonstick frying pan (or well-seasoned cast-iron skillet) with 1 1/2 tablespoons of oil over medium heat. Arrange the pieces of paneer over the pan in a single layer. Cook for 2 to 3 minutes until golden brown. Flip over all the pieces, and pan fry for another 2 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010016	Prepare Batter	Pour about 1/4 cup batter for each pancake onto a hot buttered griddle or large nonstick skillet. Cook 3 to 4 minutes or until tops are covered with bubbles and edges look dry and cooked.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010230	Steam Tamales	Place tamales standing upright, with their open end up, just tightly enough to keep them standing. If using a steamer pot, lay a few soaked corn husks or a wet towel over the top of the tamales before closing the lid.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010234	Bake Pork	Bake pork in the preheated oven until browned, about 30 minutes. Drizzle more cooking liquid every 10 minutes; use two forks to shred pork as it browns.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010237	Gather Ingredients	Gather all ingredients.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010075	Add Sauce	Spread sauce on top of the pita.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010086	Preheat Oven and Dry Chickpeas	Preheat oven to 375F. Drain chickpeas in a colander and let them dry completely. Pat dry with a paper towel if needed, usually leave them on the counter an hour to make sure they are very dry.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010093	Refrigerate	Refrigerate the cookies for at least 1 hour and eat within 4-5 days. Store in the fridge.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010099	Refrigerate	Cover with the lid and refrigerate overnight.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010158	Chill and Serve	Season to taste and chill for at least 2 hours. Serve the soup with the reserved diced cucumber, fresh herbs, drizzles of olive oil, and freshly ground black pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010059	Simmer Beef with Sachet and Vegetables	Meanwhile, cut beef into chunks and add to pot, along with reserved bones, if using, and herb sachet. Bring to a simmer, then reduce heat to maintain a low simmer and cook until beef is tender, 1 to 2 hours; skim any foam that rises to the top.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010153	Cook Spinach	Drizzle the olive oil in a large skillet and bring over medium heat. Add the spinach and saut, stirring occasionally, for 1-2 minutes until the spinach is wilted. Remove the spinach from heat and when cooled enough to touch, squeeze out any excess liquid from the spinach.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010163	Marinate Paneer	Slice the block of paneer into 1-inch cubes. Then, slice each cube into 2 or 3 slices. Transfer the paneer to a mixing bowl. In a small bowl, stir the yogurt, ginger, garlic, cumin, paprika, and salt. Pour this yogurt marinade over the paneer and mix together. Refrigerate the paneer for at least 30 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010013	Combine Dry Ingredients	Whisk together first 2 ingredients in a large bowl.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031800010014	Baking	Turn and cook 3 to 4 minutes. Place on a single layer on a baking sheet, and keep warm in a 200F oven up to 30 minutes.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010224	Make the Tamal Dough	In a large bowl, use an electric mixer to beat the lard and 2 tablespoons of broth until fluffy, about 3-5 minutes. Combine the masa flour, baking powder, salt, and cumin in a separate bowl; stir into the lard mixture and beat well with an electric mixer.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010233	Prepare for Baking	Transfer pork shoulder to a large baking sheet; reserve cooking liquid. Drizzle a small amount of cooking liquid over pork pieces and lightly season with salt.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010080	Add Herbs and Toppings	Sprinkle on pinches of desired herbs and spices, and add any toppings you'd like.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010083	Add Cheese	Sprinkle on the shredded cheese.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010084	Season and Serve	In a medium bowl, combine all the spices. Remove chickpeas from oven when done and spray with olive oil. Immediately toss with spices while hot. Eat at room temperature.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010095	Drizzle Chocolate	Drizzle the chocolate over the cookies quickly in all directions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010105	Brown Pork and Add Puree	When the water is almost all gone, remove the avocado leaves and add the lard. Turn the heat to medium-high and brown the pork, stirring often. Once the pork has browned, pour in a little water or stock and use a wooden spoon to remove any browned bits off the bottom of the pot. Now pour in the contents of the blender and stir. Add a little water to the blender to get any good stuff out of it and add that to the pot, too. Return the avocado leaves to the pot, add the orange juice and zest and salt everything to taste. Let this simmer until the sauce thickens a bit, about 15 to 20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010159	Blend Ingredients	Peel the remaining cucumber, cut into chunks, and transfer to a blender. Add the tomatoes, peppers, onion, garlic, cilantro, vinegar, olive oil, salt, and pepper. Blend until smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031600010061	Cook Vegetables and Scrape Pot	Add carrot, onion, celery, and garlic to pot and cook, stirring and scraping up any browned bits from the bottom, until lightly browned, about 6 minutes. Scrape vegetables into a heatproof bowl and set aside. Add stock to pot, return to heat, and scrape up any browned bits from bottom of pot.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010161	Blend and Combine with Paneer	If you are blending the sauce, turn off the heat now and let the sauce cool for 5 minutes before transferring to a blender to blend. Pour the sauce back into the pan and turn the heat to medium. Finally, add the cooked paneer to the sauce and let it heat up for about 1 minute. Turn off the heat. Garnish the paneer tikka masala with cilantro and pepper flakes, if you like. Serve with cooked basmati rice or jasmine rice.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010165	Combine Ingredients	Whisk together the vegetable stock, Worcestershire and flour until smooth. Pour the vegetable stock mixture into the pan, along with the thyme, and stir to combine. Let the mixture simmer for an additional 5 minutes, stirring occasionally, until slightly thickened.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010167	Serve	Serve immediately over the egg noodles, garnished with your desired toppings.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010175	Assemble and Bake the Eggplant Parmesan	Spread  cup of the marinara sauce over the bottom of a 9x13-inch baking dish. Layer one-third of the eggplant slices, overlapping the slices to fit. Cover the eggplant with another  cup of marinara sauce. Sprinkle with 1 cup of the mozzarellas cheese, then spoon about one-third of the bchamel sauce over the cheese (if the bchamel has solidified a bit, it's fine to add it in dollops, no need to spread it around). Repeat two more layers, leaving the edges of the eggplant exposed on the top layer to create crispy edges. Sprinkle with the Parmigiano Reggiano. Bake until bubbling and golden brown, 30 to 35 minutes. Cool loosely covered with foil for about 20 minutes. Scatter the basil over the top (if using), slice and serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010180	Add Parmesan and Season	Stir in Parmesan cheese and season with salt and pepper.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010015	Add Wet Ingredients	Gradually stir milk and next 3 ingredients in until dry ingredients are moistened.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
1824031000010236	Brown Pork	Heat vegetable oil in a large Dutch oven over high heat. Season pork shoulder pieces with salt, then arrange in the Dutch oven. Cook until browned on all sides, about 10 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010241	Saute Onions and Garlic	Saute the onions and garlic in olive oil over medium heat until golden brown, about 10 minutes. Add spices and toast for 1-2 more minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010240	Adjust Seasonings	Add more salt, heat, chocolate, or other flavors as needed. Add sweetness with agave or maple syrup if desired.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010243	Loosen Sauce	If necessary, loosen the sauce with more broth or stock.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010245	Simmer Chilies	Place the chilies in a pot, add the broth, bring to a boil, cover, reduce heat, and simmer for 10-15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010247	Add Prunes	Add the prunes, cover, simmer on low for 10 more minutes, turn off the heat, let cool, and save the liquid.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010246	Prepare Chilies	Tear the dried chilies apart, discard seeds and stems, and toast them in a dry skillet over medium heat until they begin to release their oils, about 3-4 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010244	Blend Mixture	Place the cooked onion-spice mixture in a blender with the chilies, prunes, and all the liquid, and blend until very smooth. Pour back into the pan when done.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010260	Preheat Your Smoker	Preheat your smoker to 275 degrees F using your favorite hardwood. I used cherry wood for this cook, but oak, maple, or apple would all work well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010259	Marinate the Pork	Place your sliced pork shoulder in a large glass bowl or gallon-sized zip bag. Pour the cooled marinade over the pork and massage everything together to thoroughly coat each piece of pork. Cover with plastic wrap or seal tightly in the bag and refrigerate for at least 4 hours, or up to 24 hours.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010242	Stir in Final Ingredients	Stir in the salt, peanut butter, and chocolate until melted and incorporated. Adjust for consistency and taste. Whisk.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031000010251	Form Dough Balls	Form dough into twelve 2-inch balls. Place balls onto parchment paper and flatten to 1/2-inch thick circles.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010249	Fry Sopes	Working in batches, fry a few sopes at a time until lightly browned, about 30 seconds per side. Transfer with tongs to a paper towel-lined plate and let cool just until they can be handled, 2 to 3 minutes. Pinch the edges of each sope together to form a little boat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010252	Heat Oil	Heat oil in a deep fryer or large saucepan to 400 degrees F (200 degrees C).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010248	Mix Dough	Whisk masa harina and salt together in a bowl. Stir in enough water until dough is smooth and holds together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010261	Grill the Pineapple	During the last 30 minutes of smoking, place the pineapple wedges on the grill next to the al pastor. Close the lid and cook, flipping once after 15 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010258	Slice and Serve	Remove the al pastor and the pineapple from the smoker. Top the al pastor skewer with the pineapple top and chop up the grilled pineapple. Slice the pastor from the spit with a sharp knife, using a light sawing motion to remove small, bite-sized pieces. Place the al meat and pineapple in taco shells and top with fresh cilantro, diced onion, and a squeeze of fresh lime.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010250	Finish Frying	Return sopes to the hot oil and fry until golden and cooked through, 1 to 2 more minutes. Drain on paper towels. Top with preferred ingredients and serve. 	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031000010254	Make the Chilaquiles Sauce	In a big saucepan or Dutch oven, over high heat, add the vegetable oil. When the oil is hot, add the roma tomatoes and sear on first side for about 3 to 5 minutes, flip, using tongs, and sear on the opposite side for an additional 2 minutes. Set your moved heat to do this in batches. Remove the tomatoes and set them aside in a bowl or on a cutting board. Next, add the onion, garlic cloves and guajillo chiles, searing and toasting them for about 2 to 3 minutes. Take a peek at the onion and if it needs more time, leave it for an additional minute or two. Remove the onion and garlic cloves and set them aside. Add the tomatoes back to the pot with the chiles and add 2 cups of water. Cover the pot and cook for about 10 minutes. This will soften the tomatoes quite a bit and soften the chiles too. To a blender, add the mixture from the pot (the chiles, garlic cloves, onion and water). You may need to blend this sauce in batches, depending on how big your blender is (I had to do in batches). While you blend it, make sure you allow a bit of steam out of the blender, about about 1 minute, until super smooth. Add back to the pot and cook, uncovered, for 10 minutes. Bring to a simmer. Give it a taste and adjust the salt to your liking. I needed about 1 teaspoon.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010253	Assemble the Chilaquiles	Get your tortillas ready because the end of the dish happens quickly. Bring the sauce to a rapid simmer (you want it hot!). And fry up your eggs. Add the garnish chips to the pot with the sauce and toss until they're evenly coated. It may be easier to do this in a large bowl (you can add the tortillas to a large bowl and ladle the sauce over it). Divide the chips amongst plates and top with the a fried egg, a handful of sliced radishes, crumbled queso fresco, cilantro leaves and avocado, if you like.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010255	Prepare the Marinade	In a medium saucepan, melt butter over medium heat. Stir in the onions and garlic and cook, stirring occasionally, for 2-3 minutes or until fragrant. Add the chicken stock, ancho chili peppers, and chipotle chili peppers with adobo sauce to the pan and bring to a boil. Cook the peppers and onions in the stock for 4-5 minutes. Reduce the heat to low and stir in the achiote paste, cumin, Mexican oregano, salt, sugar, and vinegar. Simmer the marinade for 4-5 more minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010257	Blend the Marinade	Turn off the heat. Carefully remove the stems from the ancho chili peppers and place in a blender jar. Transfer the remaining contents of the pan to the blender jar, close the lid, and blend until completely smooth. Allow to cool to at least room temperature. Marinade can be made a day in advance, if needed.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010078	Bake	Place on baking sheet, bake for 5-7 minutes at 400, or until cheese is melted (times may vary).	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031200010088	Serve	Slice with pizza cutter and enjoy!	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031000010264	Slice Vegetables	While your chicken is cooking, cut the bell peppers and onion into thin slices.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010014	Drain and Serve	Drain on a rack lined cookie sheet tray. Garnish with parsley and serve with optional garlic yogurt sauce.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010007	Mix Ingredients	Stir in the spice blend, fresh basil, fresh mint, salt, and toasted pine nuts, and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031400010087	Cook Broccoli	In a large pot of salted boiling water, cook broccoli for 3 mins or until tender. Drain and transfer to a plate lined with paper towel. Set aside to cool.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010262	Smoke the Al Pastor	Place the assembled al pastor meat on the grill grates and close the lid. Smoke for about 4 hours, or until the internal temperature of the pork in the thickest portion reads 145 degrees F. If using a vertical skewer, baste the outside of the meat with the drippings from the pan every 30 minutes during the cooking process (skip this step if cooking on a rotisserie, it will self-baste).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010256	Assemble the Meat on the Spit	Using a vertical skewer or rotisserie attachment, slide the meat onto the skewer one piece at a time, keeping the meat even around the edges and sides so there aren't any large pieces of meat overhanging any other.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010263	Prepare Fajita Seasoning	Add the fajitas seasoning ingredients to a small mixing bowl and stir together.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010265	Combine and Serve	Add the chicken back into the skillet, add a squeeze of fresh lime juice and stir everything together. Serve immediately with tortillas and extra toppings such as sour cream, pico de gallo, and guacamole.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010267	Slice Chicken	When the bell peppers are just about done sauting, slice the chicken breasts into strips.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010269	Saut Vegetables	Once the chicken has finished cooking, remove it to a plate and let it rest for a couple of minutes. Add the bell peppers and onion to the same skillet over medium heat and saut for 4-5 minutes, stirring frequently.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010268	Cook Chicken	Heat the oil in a large skillet over medium heat. Sear the chicken breasts for about 7-8 minutes on each side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010266	Season Chicken	Generously sprinkle the fajita seasoning on both sides of the chicken and use your fingers to press it into the chicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010270	Combine Ingredients	Drain the black beans and add them to a bowl along with the frozen corn (no need to thaw). Finely dice the onion, mince the garlic, and roughly chop the cilantro. Add the onion, garlic, cilantro, shredded cheddar, and taco seasoning to the bowl with the beans and corn. Stir until everything is evenly combined and coated in seasoning.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010271	Freezing Instructions	To freeze the quesadillas, stack the filled and uncooked quesadillas with a piece of parchment paper between each quesadilla. Place in a freezer bag and freeze for up to three months. To reheat either microwave (for a soft quesadilla) or cook in a skillet on low heat (make sure to use low heat so that the filling has time to thaw and melt before the outside burns).	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031000010272	Prepare Quesadillas	Place a half cup of the filling on one side of each tortilla and fold over. Cook the quesadillas in a skillet over medium heat on each side until brown and crispy and the cheesy filling has melted. Slice into triangles then serve.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010016	Prepare Rice	In a pot melt ghee and then add the rice. Stir rice until the rice grains are covered with ghee. Mix in turmeric and salt then pour in water. Bring to a boil, reduce heat, cover and cook until done.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010017	Saute Onions	In the same pot melt 2 tablespoons of ghee then add onions and saut for a couple of minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010001	Pulse Wet Ingredients	In the food processor add onion, garlic and red bell pepper. Pulse twice. Add mayonnaise, tomato paste lemon zest, orange zest and yogurt then pulse until combined.	a525810e-5531-4f97-95a4-39a082f7416b	f	2
1824031100010002	Combine Wet Ingredients	In a deep bowl, pour lemon juice, orange juice, vinegar, olive oil and all the spices crumble bay leaves on top and mix. Add the ingredients in the food processor and mix well.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010003	Prepare Chicken	Add thighs and toss to coat well. Refrigerate for at least 6 hours or better overnight. Preheat oven to 430F. Divide chicken into two equal piles. Fold one piece of chicken in half and thread it into two metal skewers. Repeat with the remaining chicken until you are done with one pile. Repeat with the second pile of chicken.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010004	Arrange Chicken and Bake	Choose a pan or a baking sheet that is smaller than the skewers but can contain the drippings from the chicken while being cooked. Line with tin foil. Arrange the metal skewers over the pan as shown above. Place chicken skin over the skewers to cover chicken. Bake in the oven for about 40 minutes. Remove skin and brown the chicken for about 10 minutes each side.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010005	Finish and Serve	Remove pan from oven, cover with foil, make a vent and let it set for 5-10 minutes. Remove skewers and cut chicken into thin slices. In a small bowl. mix the sauce ingredients well. Serve with rice or as a wrap with white sauce, cucumber slices, thinly sliced ice berg lettuce, pickles, onion rings, hummus and much more.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010008	Fill Kibbeh Shell	Spoon in some of the cooked lamb and caramelized onion mixture into the inside of the hollowed-out kibbeh shell.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010009	Fry Kibbeh	Fry the kibbeh in batches in a pan of neutral flavored oil at 350 for 2  to 3 minutes per side or until golden brown and cooked throughout.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010006	Cook Onions and Lamb	Add 2 tablespoons of olive oil to a large frying pan over low to medium heat and add in the small-diced onions and brown stirring occasionally, which takes about 20 minutes. Turn the heat to high and add in the ground lamb and cook until lightly browned and cooked through, which takes about 4-6 minutes. Stir often to break up into small pieces.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010012	Form Kibbeh Shell	Lightly dip your hands in some water and grab about a golf ball size of the processed meat and wheat and form to a ball. Dip your thumb in some water and press in the center while rotating the meat with your other hand to form a hollow cone-like shape.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010011	Process Bulgur Wheat Mixture	Transfer the soaked bulgur wheat to a food processor along with the roughly chopped onions and pulse on high speed until the onions are finely minced. Next, add in the ground lamb, spices, fresh herbs, and salt, and pulse on high speed until it becomes smooth.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010013	Shape Kibbeh	Pull up the sides of the kibbeh shell and pinch the top. Cup your hands, roll the kibbeh to form a pointy cylinder-like shape or quenelle.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010010	Soak Bulgur Wheat	Pour the water over the bulgur wheat in a medium-size bowl just until covered. Mix and set aside for 15-20 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010021	Brown Meat	Add the spices, meat cubes and brown for about 5 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010019	Assemble Dish	Right before serving assemble your dish. On a big platter arrange the bread and then ladle some of the Jameed sauce on top. Spread the rice over bread and place the cooked lamb meat on top. Ladle more sauce over and sprinkle the top with toasted almonds and chopped parsley.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010081	Add Sauce	Spread sauce on top of the pita.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031700010169	Cook Pasta	Cook egg noodles al dente in boiling, generously-salted water according to package instructions.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010015	Make Jameed Sauce	When the meat is done start making the Jameed sauce. In a large bowl add yogurt and spring with cornstarch. Mix the cornstarch in using a whisk. Pour in the liquid Jameed and whisk well. Then mix in about 1 1/2 cups of the meat broth. In a pot over medium heat melt ghee and then saut the garlic for just 30 seconds. Pour the Jameed mixture whisking everything well and bring to a boil. Add in the the cooked meat. Taste and season to your liking. Let everything cook together for about 10 minutes over medium heat.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010018	Simmer Meat	Cover with hot water and bring to a boil. Reduce heat and simmer until done. This will probably take about 75 minutes.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010020	Boil Meat	Fill a deep pot with enough water to cover the meat and bring to a boil. Add meat and wait for the water to boil again. Let the meat boil with water for 5 minutes, then take the meat pieces out and dump the water.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010022	Prepare Pomegranate Molasses	If making your own pomegranate molasses*, heat pomegranate juice in a small saucepan over medium heat until it reaches a low boil. Then reduce heat to a steady simmer (low/medium low) and cook for 20-30 minutes or until reduced by half. Set aside to cool. Otherwise, use store-bought.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010024	Combine Ingredients	To a food processor, add pomegranate molasses, bread crumbs, cumin, salt, chili flakes, garlic, walnuts, olive oil, and lemon juice and pulse (instead of blend) to combine. Then add roasted peppers and pulse a few more times to combine. I think a little texture is nice in this dip instead of a pure.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010023	Adjust Seasoning	Taste and adjust flavor as needed, adding more lemon for acidity, garlic for "zing," chili flakes for spice, pomegranate molasses for sweetness / depth of flavor, sea salt for saltiness, or cumin for smokiness.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010025	Serve	Serve with fresh pita, flatbread, crackers, or vegetables of choice! Best when fresh. Store leftovers covered in the refrigerator up to 3 days. Let come to room temperature before enjoying - I like it warm.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010026	Roast Red Bell Peppers	In the meantime, heat oven to 450 degrees F (232 C) and place whole bell peppers directly on a baking sheet. Roast for 20-25 minutes or until blackened on the outside. Cover with foil to let steam and cool for 10 minutes. Then peel away core, seeds, and skins and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010028	Assemble Maqluba	For assembly, my hack is to cut parchment paper the same size as the bottom of the pot you're using and lay it flat. Add tomato slices, then layer the chicken on top. Add the vegetables and finally the rice. Now once your maqluba is assembled, make sure to add HOT broth. You don't want this to be warm or cold. Let it boil on medium-high heat, then cover and lower heat until rice is fully cooked, anywhere from 15-25 minutes. The rice on top should be fluffy and cooked.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010029	Cook Chicken	Once the chicken is cooked, remove it and strain the broth. You can now leave the chicken as is, bake it to crisp up, or fry it. I like air frying it.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010027	Prepare Chicken	Add the chicken to a pot with oil and the onion and saut. Add maqluba spices, whole garlic, black pepper, cinnamon, coriander, and cardamom and mix. Add water to cover. Let it boil and skim off any foam that forms and discard. Let it cook for about 30-40 mins until done.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010031	Prepare Rice	Wash the rice a few times to make sure the starches are removed. Soak in cold water for about 30 minutes. Once soaked, strain and add the 7 spices, maqluba spices, and salt. Mix well and set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031100010030	Prepare Vegetables	Prep your vegetables ahead of time. Cut the cauliflower into medium size florets, peel the potatoes, and cut them into -inch thick rounds. For the eggplants, you can peel them or leave the skin. Cut into -inch rounds and place on top of a paper towel. Sprinkle a small amount of salt on top of each round to draw out the moisture, about 10 minutes. If you're using carrots, the baby ones work great. Deep fry all the vegetables, air fry, or bake them. Once done, set aside.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031200010079	Prepare Pita	Brush on a little olive oil on the pita.	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031400010088	Shape Broccoli Mixture	Roll tablespoonfuls of broccoli mixture into balls. Using moistened hands, press balls into cylinder shapes. Place onto the prepared baking tray.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031500010161	Final Cooking	Heat a non-stick skillet over medium heat. Depending on how good your non-stick pan is, you may need to very lightly spray it with some oil. Spread the bottom of the skillet with the injera batter - not as thin as crepes but not as thick as traditional pancakes. Allow the injera to bubble and let the bubbles pop. Once the bubbles have popped, place a lid on top of the pan and turn off the heat. Let the injera steam cook for a couple or so more minutes until cooked through. Be careful not to overcook the injera or they will become gummy and soggy. 	88f9c145-b9f7-4dd3-8b0c-3a4e34501326	f	1
1824031600010062	Season and Brown Beef	Season beef with salt and pepper. In a large pot or Dutch oven, heat oil over high heat until lightly smoking. Working in batches if necessary, add beef and cook, turning occasionally, until well browned on all sides, about 5 minutes per side. Transfer to a large platter.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010168	Add Mushrooms and Garlic	Add the remaining 2 tablespoons butter, garlic and mushrooms, and stir to combine. Continue sauting for an additional 5-7 minutes, until the mushrooms are cooked and tender.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010170	Saut Onions	Melt 1 tablespoon butter in a large saut pan over medium-high heat. Add onions and saut for 5 minutes, stirring occasionally.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031700010172	Prepare the Breading and Eggplant	Combine the flour and  teaspoon salt on a large plate. Whisk the eggs with 2 tablespoons cold water in a wide bowl. Mix the breadcrumbs with  teaspoon salt on a large plate. Lightly coat each slice of eggplant in the flour, shaking off excess. Dip in egg mixture, letting any excess drip off, then dredge in the breadcrumbs, pressing with your fingertips so the crumbs adhere. (Use one hand for the dry ingredients  the flour and breadcrumbs  and one for the egg mixture  it's much neater this way!) Set the breaded eggplant slices on a baking sheet.	a525810e-5531-4f97-95a4-39a082f7416b	f	1
1824031800010012	Serve	Serve with Caramel Syrup.	ade96f70-4ec5-4ab9-adfe-0645b16e1ced	f	1
